(1, 32, 2025, '<p style=\"line-height:1.0\"><span style=\"color:null\"><span style=\"font-size:10px\"><strong>AN&Aacute;LISIS DEL PROGRAMA DE MANTENIMIENTO HIGI&Eacute;NICO-SANITARIO</strong><br />\r\n&nbsp;&nbsp; - Diagn&oacute;stico de situaci&oacute;n. Programa de actuaci&oacute;n<br />\r\n&nbsp;&nbsp; - Evaluaci&oacute;n</span></span></p>\r\n\r\n<p style=\"line-height:1.0\"><span style=\"color:null\"><span style=\"font-size:10px\"><strong>IDENTIFICACI&Oacute;N DE LOS ASPECTOS T&Eacute;CNICOS Y PUNTOS CR&Iacute;TICOS A CONSIDERAR</strong><br />\r\n&nbsp;&nbsp; - Valoraci&oacute;n del riesgo en instalaciones susceptibles de proliferaci&oacute;n de legionela que constituyen un riesgo emergente por su ubicaci&oacute;n en espacios p&uacute;blicos (ej.: humectadores)</span></span></p>\r\n\r\n<p style=\"line-height:1.0\"><span style=\"color:null\"><span style=\"font-size:10px\"><strong>DEFINICI&Oacute;N DE BIOCIDAS Y PRODUCTOS QU&Iacute;MICOS A USAR</strong><br />\r\n&nbsp;&nbsp; - Biocidas. Definici&oacute;n y tipos<br />\r\n&nbsp;&nbsp; - Elegir el adecuado para cada una de las instalaciones de riesgo en las que legionela puede proliferar y diseminarse</span></span></p>\r\n\r\n<p style=\"line-height:1.0\"><span style=\"color:null\"><span style=\"font-size:10px\"><strong>EJECUCI&Oacute;N DE LOS DIFERENTES PROCESOS</strong><br />\r\n&nbsp;&nbsp; - La toma de muestras. Certificaci&oacute;n y acreditaci&oacute;n</span></span></p>\r\n\r\n<p style=\"line-height:1.0\"><span style=\"color:null\"><span style=\"font-size:10px\"><strong>APLICACI&Oacute;N DE LAS ACTUALIZACIONES</strong><br />\r\n&nbsp;&nbsp; - T&eacute;cnicas anal&iacute;ticas de detecci&oacute;n de legionela (t&eacute;cnicas de detecci&oacute;n r&aacute;pida).</span></span></p>\r\n\r\n<p style=\"line-height:1.0\"><span style=\"color:null\"><span style=\"font-size:10px\"><strong>ENUMERACI&Oacute;N DE LAS RESPONSABILIDADES</strong><br />\r\n&nbsp;&nbsp; - Responsabilidades seg&uacute;n normativa<br />\r\n&nbsp;&nbsp; - Empresas de mantenimiento</span></span></p>\r\n\r\n<p style=\"line-height:1.0\"><span style=\"color:null\"><span style=\"font-size:10px\"><strong>AN&Aacute;LISIS DE LA NORMATIVA EN RELACI&Oacute;N CON LA LEGIONELOSIS, PREVENCI&Oacute;N DE RIESGOS LABORALES Y MEDIO AMBIENTE</strong><br />\r\n&nbsp;&nbsp; - Legionela: actualizaci&oacute;n legislaci&oacute;n auton&oacute;mica y nacional. Legislaci&oacute;n nacional y auton&oacute;mica referida a la prevenci&oacute;n de riesgos laborales<br />\r\n&nbsp;&nbsp; - Legislaci&oacute;n nacional y auton&oacute;mica referida a la protecci&oacute;n del medioambiente</span></span></p>\r\n\r\n<p style=\"line-height:1.0\">&nbsp;</p>\r\n'),
(2, 31, 2025, '<p style=\"line-height:0.8\"><span style=\"color:#000000\"><span style=\"font-size:10px\">1. LA LEGIONELLA</span></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"color:#000000\"><span style=\"font-size:10px\">2. NORMATIVA APLICABLE<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Normativa para la prevenci&oacute;n y control de la legionelosis<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Instalaciones de riesgo incluidas en el &aacute;mbito de aplicaci&oacute;n del RD 487/2022<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Novedades Real Decreto 487/2022, de 21 de junio</span></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"color:#000000\"><span style=\"font-size:10px\">3. PAR&Aacute;METROS DE ESTUDIO LAS OPERACIONES MENORES DE PREVENCI&Oacute;N Y CONTROL DE LEGIONELLA<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Par&aacute;metros de estudio fundamentales<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Medici&oacute;n de par&aacute;metros en el control y prevenci&oacute;n de legionella<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Frecuencia m&iacute;nima de muestreo<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Protocolo de toma de muestras.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; o Envases para toma de muestras<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; o Pr&aacute;cticas correctas de higiene en la toma de muestras</span></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"color:#000000\"><span style=\"font-size:10px\">4. PLAN DE PREVENCI&Oacute;N Y CONTROL DE LEGIONELLA (PPCL)<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Datos t&eacute;cnicos y de funcionamiento, dise&ntilde;o y ubicaci&oacute;n de la instalaci&oacute;n &nbsp;<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Plano o esquema se&ntilde;alizado para cada instalaci&oacute;n<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Puntos de toma de muestra y puntos de posible emisi&oacute;n de aerosoles<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Programa de mantenimiento y revisi&oacute;n y programa de tratamiento de instalaciones y equipos<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Programa de muestreo y an&aacute;lisis del agua<br />\r\n&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Programa de formaci&oacute;n del personal. Documentaci&oacute;n y registros</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(3, 38, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CALIDAD ALIMENTARIA<br />\r\n-&nbsp;Definici&oacute;n de alimentos. Clasificaci&oacute;n de los alimentos<br />\r\n-&nbsp;Criterios de calidad de los alimentos</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>ALTERACIONES DE LOS ALIMENTOS<br />\r\n-&nbsp;Deterioro de los alimentos de origen animal y de origen vegetal</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>MANIPULACI&Oacute;N HIGI&Eacute;NICA DE LOS ALIMENTOS<br />\r\n-&nbsp;Cadena alimentaria: origen, transformaci&oacute;n, tratamientos y trazabilidad de los alimentos<br />\r\n-&nbsp;El papel del manipulador de alimentos. Manipulaci&oacute;n de los alimentos espec&iacute;ficos del curso</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>LOCALES E INSTALACIONES<br />\r\n-&nbsp;Distribuci&oacute;n de las instalaciones, iluminaci&oacute;n, ventilaci&oacute;n<br />\r\n-&nbsp;Maquinaria, herramientas y utillaje, limpieza y desinfecci&oacute;n. Eliminaci&oacute;n de basuras y residuos</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>HIGIENE PERSONAL: ASEO, H&Aacute;BITOS HIGI&Eacute;NICOS, ESTADO DE SALUD Y PREVENCI&Oacute;N DE ENFERMEDADES TRANSMISIBLES<br />\r\n-&nbsp;Aseo y h&aacute;bitos higi&eacute;nicos. Estado de salud y prevenci&oacute;n de enfermedades transmisibles</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>INFORMACI&Oacute;N DE PRODUCTOS ALIMENTICIOS: IDENTIFICACI&Oacute;N, ETIQUETADO, CADUCIDAD, COMPOSICI&Oacute;N<br />\r\n-&nbsp;Etiquetado: Identificaci&oacute;n y composici&oacute;n<br />\r\n-&nbsp;Caducidad</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>HIGIENE ALIMENTARIA: MICROORGANISMOS EN LOS ALIMENTOS, CONTAMINACIONES, INFECCIONES E INTOXICACIONES ALIMENTARIAS</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CONSERVACI&Oacute;N DE LOS ALIMENTOS</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CARACTER&Iacute;STICAS ESPEC&Iacute;FICAS DE LOS ALIMENTOS Y PRODUCTOS ALIMENTICIOS</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>PLAN DE AN&Aacute;LISIS DE PELIGROS Y PUNTOS DE CONTROL CR&Iacute;TICOS<br />\r\n-&nbsp;Diagrama de flujo Sector c&aacute;rnicas</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>GU&Iacute;A DE PR&Aacute;CTICAS CORRECTAS DE HIGIENE<br />\r\n-&nbsp;Programa de prerrequisitos. Control de procesos<br />\r\n-&nbsp;Revisiones de autocontrol peri&oacute;dicas</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>LEGISLACI&Oacute;N APLICABLE AL MANIPULADOR DE ALIMENTOS</strong></span></p>\r\n'),
(4, 6225, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Calidad alimentaria</strong><br />\r\n- Definici&oacute;n de alimentos.<br />\r\n- Clasificaci&oacute;n de los alimentos.<br />\r\n- Criterios de calidad de los alimentos.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Alteraciones de los alimentos</strong><br />\r\n- Deterioro de los alimentos de origen animal y de origen vegetal.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Manipulaci&oacute;n higi&eacute;nica de los alimentos</strong><br />\r\n- Cadena alimentaria: origen, transformaci&oacute;n, tratamientos y trazabilidad de los alimentos.<br />\r\n- El papel del manipulador de alimentos.<br />\r\n- Manipulaci&oacute;n de los alimentos espec&iacute;ficos del curso.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Locales e instalaciones</strong><br />\r\n- Maquinaria, herramientas y utillaje, limpieza y desinfecci&oacute;n.<br />\r\n- Distribuci&oacute;n de las instalaciones, iluminaci&oacute;n, ventilaci&oacute;n.<br />\r\n- Eliminaci&oacute;n de basuras y residuos.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Higiene personal: Aseo, h&aacute;bitos higi&eacute;nicos, estado de salud y prevenci&oacute;n de enfermedades transmisibles</strong><br />\r\n- Aseo y h&aacute;bitos higi&eacute;nicos.<br />\r\n- Estado de salud y prevenci&oacute;n de enfermedades transmisibles.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Informaci&oacute;n de productos alimenticios: Identificaci&oacute;n, etiquetado, caducidad, composici&oacute;n</strong><br />\r\n- Etiquetado: Identificaci&oacute;n y composici&oacute;n.<br />\r\n- Caducidad.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Higiene alimentaria: Microorganismos en los alimentos, contaminaciones, infecciones e intoxicaciones alimentarias</strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Conservaci&oacute;n de los alimentos</strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Caracter&iacute;sticas espec&iacute;ficas de los alimentos y productos alimenticios</strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Plan de An&aacute;lisis de Peligros y Puntos de Control Cr&iacute;ticos</strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Gu&iacute;a de Pr&aacute;cticas correctas de higiene</strong><br />\r\n- Fase de recepci&oacute;n de materias primas. Control de proveedores.<br />\r\n- Fase de conservaci&oacute;n y almacenamiento.<br />\r\n- Fase de preparaci&oacute;n, elaboraci&oacute;n y cocinado.<br />\r\n- Fase de recalentamiento y utilizaci&oacute;n de productos cocinados.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:12px\"><strong>Legislaci&oacute;n aplicable al manipulador de alimentos</strong></span></p>\r\n'),
(5, 7225, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\"><strong>1. CARRETILLAS PARA EL TRANSPORTE DE MERCANC&Iacute;AS</strong></span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Clasificaci&oacute;n, tipos y usos de las carretillas manuales y automotoras. Motores t&eacute;rmicos y motores el&eacute;ctricos</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Elementos principales de los distintos tipos de carretillas</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Mantenimiento b&aacute;sico e indicadores de funcionamiento incorrecto</span></span></p>\r\n\r\n<p style=\"line-height:0.5\">&nbsp;</p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\"><strong>2. MANEJO Y CONDUCCI&Oacute;N DE CARRETILLAS</strong></span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Eje directriz. Acceso y descenso de la carretilla</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Uso de sistemas de retenci&oacute;n: cabina y cintur&oacute;n de seguridad</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Puesta en marcha y detenci&oacute;n de la carretilla</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Circulaci&oacute;n: velocidad de desplazamiento, trayectoria, naturaleza, piso, etc.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Maniobras. Frenado, aparcado, marcha atr&aacute;s, descenso en pendiente</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Aceleraciones y maniobras incorrectas</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Maniobras de carga y descarga. Circulaci&oacute;n</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Elevaci&oacute;n de la carga</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Prevenci&oacute;n de Riesgos laborales en el manejo de la carretilla</span></span></p>\r\n\r\n<p style=\"line-height:0.5\">&nbsp;</p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\"><strong>3. CARGA Y DESCARGA DE MERCANC&Iacute;AS</strong></span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Estabilidad de la carga y de la carretilla. Nociones de equilibrio</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Evitaci&oacute;n de vuelcos transversales o longitudinales</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Comportamiento din&aacute;mico y est&aacute;tico de la carretilla cargada</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Colocaci&oacute;n incorrecta de la carga en la carretilla. Sobrecarga</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><span style=\"color:black\">- Modos de colocaci&oacute;n de las mercanc&iacute;as en las estanter&iacute;as</span></span></p>\r\n'),
(6, 39, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">GESTI&Oacute;N INFORMATIZADA<br />\r\nNecesidad de la gesti&oacute;n<br />\r\nObligaciones contables<br />\r\nPlanificaci&oacute;n<br />\r\nDificultades: Tiempo. Trabajo<br />\r\nLa inform&aacute;tica de gesti&oacute;n<br />\r\nEjemplos de gesti&oacute;n y planificaci&oacute;n informatizada</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">FICHEROS MAESTROS<br />\r\nInternos: Art&iacute;culos. Clientes. Formas de pago. Formas de cobro<br />\r\nExternos: Bancos. Proveedores</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">GESTI&Oacute;N DE COMPRAS<br />\r\nPedidos, entradas, albaranes y facturas<br />\r\nConsultas<br />\r\nInformes, impresos<br />\r\nContabilidad de compras<br />\r\nConexi&oacute;n con el TPV</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PREVISI&Oacute;N Y PLANIFICACI&Oacute;N<br />\r\nEstad&iacute;sticas de compras, ventas y almac&eacute;n<br />\r\nPresupuestos de planificaci&oacute;n<br />\r\nRatios econ&oacute;micos y comerciales<br />\r\nAn&aacute;lisis de costes<br />\r\nViabilidad financiera</span></p>\r\n'),
(7, 40, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CONCEPTOS B&Aacute;SICOS DEL ESTR&Eacute;S<br />\r\n&iquest;Qu&eacute; es el estr&eacute;s?<br />\r\nDiferencia entre estr&eacute;s y ansiedad<br />\r\nIndicadores del estr&eacute;s: respuestas<br />\r\nCausas<br />\r\nConsecuencias del estr&eacute;s</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">&Aacute;MBITOS<br />\r\nLaboral<br />\r\nFamiliar<br />\r\nAcad&eacute;mico<br />\r\nIndividual</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">GESTI&Oacute;N DEL ESTR&Eacute;S<br />\r\nFases del estr&eacute;s<br />\r\nAsertividad<br />\r\nResiliencia<br />\r\nDelegar tareas</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">T&Eacute;CNICAS Y ESTRATEGIAS PARA SUPERAR EL ESTR&Eacute;S<br />\r\nMindfulness<br />\r\nMejorar la atenci&oacute;n y concentraci&oacute;n<br />\r\nDeporte y h&aacute;bitos de vida saludables</span></p>\r\n'),
(8, 1, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>INTRODUCCI&Oacute;N A LA NUEVA LEY DE PROTECCI&Oacute;N DE DATOS Y GARANT&Iacute;A DE LOS DERECHOS DIGITALES (LOPDGDD)</strong><br />\r\nIntroducci&oacute;n de la nueva Ley de Protecci&oacute;n de Datos en Espa&ntilde;a (LOPDGDD)<br />\r\nEl impacto de las tecnolog&iacute;as en el sector empresarial<br />\r\nEl objetivo de la convivencia entre RGPD y la nueva LOPDGDD<br />\r\n&nbsp;&nbsp;&nbsp; Competencias de la ejecuci&oacute;n normativa<br />\r\nLos principios de la protecci&oacute;n de datos<br />\r\n&nbsp;&nbsp;&nbsp; Ejemplo de aplicaci&oacute;n (whistleblowing)<br />\r\nAspectos gen&eacute;ricos sobre derechos de la ciudadan&iacute;a en la aplicaci&oacute;n de la normativa<br />\r\nFiguras del tratamiento de datos en la LOPDGDD<br />\r\n&nbsp;&nbsp;&nbsp; El responsable.&nbsp; El encargado. El delegado de protecci&oacute;n de datos (DPD)<br />\r\nR&eacute;gimen sancionador en la LOPDGDD<br />\r\n&nbsp;&nbsp;&nbsp; Tipos de infracciones y clasificaci&oacute;n<br />\r\n<br />\r\n<strong>&ldquo;EL DERECHO DIGITAL&rdquo;</strong><br />\r\nEl &ldquo;derecho digital&rdquo; en la LOPDGDD<br />\r\n&iquest;En qu&eacute; consiste el derecho digital?<br />\r\n&iquest;Por qu&eacute; es importante proteger el derecho digital?<br />\r\n&iquest;Sabes cu&aacute;les son los derechos digitales?<br />\r\n&nbsp;&nbsp;&nbsp; Derechos digitales de los trabajadores. La desconexi&oacute;n digital<br />\r\n&nbsp;&nbsp;&nbsp; Derechos digitales de los menores de edad<br />\r\n&nbsp;&nbsp;&nbsp; Derechos en el universo de internet<br />\r\n&nbsp;&nbsp;&nbsp; C&oacute;mo proceder frente a la vulneraci&oacute;n de los derechos digitales<br />\r\n&nbsp;&nbsp;&nbsp; Qu&eacute; sanciones pueden recaer a las empresas.<br />\r\n<br />\r\n<strong>LA EMPRESA Y LA LOPDGDD</strong><br />\r\nLa empresa y la Ley de Protecci&oacute;n de Datos y garant&iacute;a de los derechos digitales<br />\r\nGu&iacute;a f&aacute;cil para la implementaci&oacute;n de la LOPDGDD en la empresa<br />\r\n&nbsp;&nbsp;&nbsp; Auditor&iacute;a de datos. Consentimiento<br />\r\n&nbsp;&nbsp;&nbsp; Obligaciones. An&aacute;lisis exhaustivo de riesgos<br />\r\n&nbsp;&nbsp;&nbsp; Comunicaci&oacute;n de incidencias<br />\r\n&nbsp;&nbsp;&nbsp; Tratamiento y evaluaci&oacute;n<br />\r\n&nbsp;&nbsp;&nbsp; Especificaciones de los contratos de gesti&oacute;n de datos a terceros<br />\r\n&nbsp;&nbsp;&nbsp; Cumplimiento de la garant&iacute;a de los derechos digitales</span></p>\r\n'),
(9, 2, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>MARCO NORMATIVO B&Aacute;SICO</strong><br />\r\n&nbsp; &nbsp;- Introducci&oacute;n.<br />\r\n&nbsp; &nbsp;- Marco normativo b&aacute;sico.<br />\r\n<strong>&nbsp;PLATAFORMAS ELEVADORAS M&Oacute;VILES DE PERSONAL (PEMP)</strong><br />\r\n&nbsp; &nbsp;- Introducci&oacute;n.<br />\r\n&nbsp; &nbsp;- Tipos de plataformas elevadoras.<br />\r\n&nbsp; &nbsp;- Plataformas elevadoras m&oacute;viles de personal (PEMP).<br />\r\n<strong>&nbsp;RIESGOS, FACTORES DE RIESGO Y MEDIDAS PREVENTIVAS POR LA UTILIZACI&Oacute;N DE PLATAFORMAS ELEVADORAS M&Oacute;VILES DE&nbsp;PERSONAL</strong><br />\r\n&nbsp; &nbsp;- Introducci&oacute;n.<br />\r\n&nbsp; &nbsp;- Riesgos.<br />\r\n&nbsp; &nbsp;- Factores de riesgo.<br />\r\n&nbsp; &nbsp;- Medidas preventivas.<br />\r\n<strong>&nbsp;DIRECTRICES DE SEGURIDAD ANTE LA UTILIZACI&Oacute;N DE PLATAFORMAS ELEVADORAS M&Oacute;VILES DE PERSONAL</strong><br />\r\n&nbsp; &nbsp;- Introducci&oacute;n.<br />\r\n&nbsp; &nbsp;- Directrices previas a la puesta en marcha de la PEMP.<br />\r\n&nbsp; &nbsp;- Directrices previas a la elevaci&oacute;n de la PEMP.<br />\r\n&nbsp; &nbsp;- Directrices de movimiento de la PEMP.<br />\r\n&nbsp; &nbsp;- Directrices despu&eacute;s del uso de la PEMP.<br />\r\n&nbsp; &nbsp;- Otras directrices o normas a tener en cuenta.<br />\r\n<strong>&nbsp;SISTEMAS Y ELEMENTOS DE PROTECCI&Oacute;N</strong><br />\r\n&nbsp; &nbsp;- Introducci&oacute;n.<br />\r\n&nbsp; &nbsp;- Sistemas de protecci&oacute;n colectiva.<br />\r\n&nbsp; &nbsp;- Equipos de protecci&oacute;n individual (EPI).<br />\r\n<strong>&nbsp;DOCUMENTACI&Oacute;N DE UNA PLATAFORMA ELEVADORA M&Oacute;VIL DE PERSONAL</strong><br />\r\n&nbsp; &nbsp;- Introducci&oacute;n.<br />\r\n&nbsp; &nbsp;- Manual de instrucciones.<br />\r\n&nbsp; &nbsp;- Elementos de se&ntilde;alizaci&oacute;n.<br />\r\n<strong>&nbsp;PRIMEROS AUXILIOS</strong><br />\r\n&nbsp; &nbsp;- Introducci&oacute;n.<br />\r\n&nbsp; &nbsp;- Principios generales de actuaci&oacute;n.<br />\r\n&nbsp; &nbsp;- Activaci&oacute;n del sistema de emergencia.<br />\r\n&nbsp; &nbsp;- Principales situaciones de emergencia: actuaci&oacute;n en cada caso.<br />\r\n&nbsp; &nbsp;- T&eacute;cnicas de reanimaci&oacute;n.</span></p>\r\n'),
(10, 3, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>TABLAS Y LISTAS DE DATOS&nbsp;</strong><br />\r\n&nbsp; &nbsp;- Creaci&oacute;n de una tabla. Modificar los datos y estructura de la tabla.&nbsp;<br />\r\n&nbsp; &nbsp;- Cambiar el estilo de la tabla. Ordenar los datos de la tabla.&nbsp;<br />\r\n&nbsp; &nbsp;- Aplicaci&oacute;n de filtros a la tabla. Crear un resumen de datos.<br />\r\n<strong>&nbsp;BASES DE DATOS</strong><br />\r\n&nbsp; &nbsp;- Obtener datos externos desde el texto.&nbsp;<br />\r\n&nbsp; &nbsp;- Obtener datos externos desde Access.&nbsp;<br />\r\n&nbsp; &nbsp;- Obtener datos externos desde la web.&nbsp;<br />\r\n&nbsp; &nbsp;- Obtener datos externos de otras fuentes. Funciones de bases de datos.&nbsp;<br />\r\n<strong>TABLAS Y GR&Aacute;FICOS DIN&Aacute;MICOS&nbsp;</strong><br />\r\n&nbsp; &nbsp;- Creaci&oacute;n y manejo de tablas din&aacute;micas. Creaci&oacute;n de campos calculados. Importaci&oacute;n de datos. Gr&aacute;ficos din&aacute;micos.&nbsp;<br />\r\n<strong>AN&Aacute;LISIS DE DATOS&nbsp;</strong><br />\r\n&nbsp; - Creaci&oacute;n y uso de escenarios. B&uacute;squeda de objetivos. La herramienta Solver.&nbsp;<br />\r\n<strong>MACROS&nbsp;</strong><br />\r\n&nbsp; &nbsp;- Creaci&oacute;n y ejecuci&oacute;n de una macro. Modificaci&oacute;n y seguimiento de una macro.&nbsp;<br />\r\n&nbsp; &nbsp;- Macros y seguridad. Definici&oacute;n de funciones.&nbsp;<br />\r\n<strong>CONOCIENDO VISUAL BASIC PARA APLICACIONES (VBA)&nbsp;</strong><br />\r\n&nbsp; &nbsp;- La pantalla de Visual Basic. La ventana Inmediato.&nbsp;<br />\r\n&nbsp; &nbsp;- &iquest;Qu&eacute; son y para qu&eacute; sirven las variables y constantes?&nbsp;<br />\r\n&nbsp; &nbsp;- Tipos de operadores en Visual Basic. Sentencias condicionales. Sentencias de repetici&oacute;n.&nbsp;<br />\r\n<strong>OPERACIONES M&Aacute;S COTIDIANAS CON VBA.&nbsp;</strong><br />\r\n&nbsp; &nbsp;- Instrucciones b&aacute;sicas para trabajar con libros. Instrucciones b&aacute;sicas para trabajar con hojas.&nbsp;<br />\r\n&nbsp; &nbsp;- Instrucciones b&aacute;sicas para trabajar con celdas y rangos.&nbsp;<br />\r\n<strong>CREACI&Oacute;N DE CUADROS DE DI&Aacute;LOGO.&nbsp;</strong><br />\r\n&nbsp; &nbsp;- Utilizaci&oacute;n de los cuadros de di&aacute;logo predise&ntilde;ados de Excel. Cuadros de mensajes.&nbsp;<br />\r\n&nbsp; &nbsp;- Cuadros de introducci&oacute;n de datos. Creaci&oacute;n de cuadros de di&aacute;logo propios.&nbsp;<br />\r\n<strong>TRABAJO EN GRUPO Y SEGURIDAD.&nbsp;</strong><br />\r\n&nbsp; &nbsp;- Compartir libros. Ver y restaurar versiones anteriores.<br />\r\n&nbsp; &nbsp;- Control de cambios. Limitar el acceso a distintos usuarios.</span></p>\r\n'),
(11, 4, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;INTRODUCCI&Oacute;N Y CONCEPTOS B&Aacute;SICOS</strong><br />\r\n&nbsp; &nbsp;- Definici&oacute;n del t&eacute;rmino acoso.<br />\r\n&nbsp; &nbsp;- Acoso sexual y acoso por raz&oacute;n de sexo. Concepto y diferencias.<br />\r\n&nbsp; &nbsp;- Tipos de acoso en el trabajo.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;ACERCAMIENTO A LA MAGNITUD DEL PROBLEMA DEL ACOSO SEXUAL Y DEL ACOSO POR RAZ&Oacute;N DE SEXO.</strong><br />\r\n&nbsp; &nbsp;- Origen del acoso sexual y por raz&oacute;n de sexo.<br />\r\n&nbsp; &nbsp;- Creencias versus realidades del acoso sexual en el trabajo.<br />\r\n&nbsp; &nbsp;- Datos estad&iacute;sticos sobre el acoso laboral en Espa&ntilde;a.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;EL TRATAMIENTO INSTITUCIONAL Y NORMATIVO (&Aacute;MBITO INTERNACIONAL, EUROPEO Y NACIONAL)</strong><br />\r\n&nbsp; &nbsp;- Marco institucional internacional, europeo y nacional sobre el acoso en el &aacute;mbito laboral.<br />\r\n&nbsp; &nbsp;- Marco normativo sobre el acoso en el trabajo.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;LEY ORG&Aacute;NICA 3/2007 PARA LA IGUALDAD EFECTIVA DE MUJERES Y HOMBRES</strong><br />\r\n&nbsp; &nbsp;- La Ley de igualdad. Objeto y &aacute;mbito de aplicaci&oacute;n.<br />\r\n&nbsp; &nbsp;- El acoso sexual y por raz&oacute;n de sexo en la Ley Org&aacute;nica 3/2007.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;&Aacute;MBITO LABORAL: RESPONSABILIDAD EMPRESARIAL Y RLT</strong><br />\r\n&nbsp; &nbsp;- Aspectos sobre el dise&ntilde;o de medidas preventivas.<br />\r\n&nbsp; &nbsp;- Medidas espec&iacute;ficas para prevenir el acoso sexual y el acoso por raz&oacute;n de sexo.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;MEDIDAS Y PROPUESTAS PARA LA NEGOCIACI&Oacute;N COLECTIVA: CONVENIOS Y PLANES DE IGUALDAD.</strong><br />\r\n&nbsp; &nbsp;- Negociaci&oacute;n colectiva. Medidas frente al acoso sexual y por raz&oacute;n de sexo en el convenio colectivo.<br />\r\n&nbsp; &nbsp;- Los planes de igualdad. Medidas preventivas y actuaciones frente al acoso sexual y al acoso por raz&oacute;n de sexo.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;PROTOCOLOS DE ACTUACI&Oacute;N FRENTE AL ACOSO SEXUAL Y AL ACOSO POR RAZ&Oacute;N DE SEXO.</strong><br />\r\n&nbsp; &nbsp;- Caracter&iacute;sticas y contenido. Elaboraci&oacute;n e implantaci&oacute;n en la empresa del protocolo de actuaci&oacute;n.<br />\r\n&nbsp; &nbsp;- Procedimiento de tramitaci&oacute;n de denuncias.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;ANTECEDENTES HIST&Oacute;RICOS Y SOCIALES DE LA IGUALDAD</strong><br />\r\n&nbsp; &nbsp; - Los movimientos reivindicativos. &nbsp; &nbsp;&nbsp;</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>BASES LEGALES DE LA IGUALDAD</strong><br />\r\n&nbsp; &nbsp;- La igualdad formal. La negociaci&oacute;n colectiva como herramienta para la igualdad.<br />\r\n&nbsp; &nbsp;- La Ley Org&aacute;nica 3/2007 o Ley de Igualdad.</span></p>\r\n'),
(12, 5, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>EL TRABAJO Y LA SALUD: LOS RIESGOS PROFESIONALES. FACTORES DE RIESGO</strong><br />\r\n&nbsp; &nbsp;- El trabajo y la salud. Los riesgos profesionales. Factores de riesgo.<br />\r\n<strong>DA&Ntilde;OS DERIVADOS DEL TRABAJO. ACCIDENTE DE TRABAJO Y ENFERMEDADES PROFESIONALES. OTRAS PATOLOG&Iacute;AS DERIVADAS DEL&nbsp;TRABAJO</strong><br />\r\n&nbsp; &nbsp;- Da&ntilde;os derivados del trabajo. Los accidentes de trabajo y las enfermedades profesionales.<br />\r\n<strong>MARCO NORMATIVO B&Aacute;SICO EN MATERIA DE PREVENCI&Oacute;N DE RIESGOS LABORALES. DERECHOS Y DEBERES B&Aacute;SICOS EN ESTA&nbsp;MATERIA</strong><br />\r\n&nbsp; &nbsp;- Marco normativo b&aacute;sico en materia de Prevenci&oacute;n de Riesgos Laborales. La Ley de Prevenci&oacute;n de Riesgos Laborales (LPRL).<br />\r\n&nbsp; &nbsp;- Ley 54/2003, reforma del marco normativo de la Prevenci&oacute;n de Riesgos Laborales. El Reglamento de los Servicios de Prevenci&oacute;n&nbsp;(RSP).<br />\r\n&nbsp; &nbsp;- Otras normas espec&iacute;ficas derivadas de la Ley de Prevenci&oacute;n de Riesgos Laborales.<br />\r\n<strong>RIESGOS LIGADOS A LAS CONDICIONES DE SEGURIDAD. EL LUGAR DE TRABAJO</strong><br />\r\n&nbsp; &nbsp;- Las herramientas y las m&aacute;quinas. La electricidad. Los incendios. Almacenamiento, manipulaci&oacute;n y transporte. Se&ntilde;alizaci&oacute;n.<br />\r\n<strong>RIESGOS LIGADOS AL MEDIO AMBIENTE DE TRABAJO</strong><br />\r\n&nbsp; &nbsp;- La exposici&oacute;n laboral a agentes qu&iacute;micos. La exposici&oacute;n laboral a agentes f&iacute;sicos. La exposici&oacute;n laboral a agentes biol&oacute;gicos. El&nbsp;control del riesgo.<br />\r\n<strong>LA CARGA DE TRABAJO, LA FATIGA Y LA INSATISFACCI&Oacute;N LABORAL</strong><br />\r\n&nbsp; &nbsp;- La carga de trabajo. La carga f&iacute;sica. La carga mental. La fatiga. La insatisfacci&oacute;n laboral.<br />\r\n<strong>SISTEMAS ELEMENTALES DE CONTROL DE RIESGOS. PROTECCI&Oacute;N COLECTIVA E INDIVIDUAL</strong><br />\r\n&nbsp; &nbsp;- La prevenci&oacute;n y protecci&oacute;n de los trabajadores. La protecci&oacute;n colectiva. La protecci&oacute;n individual.<br />\r\n<strong>EL PLAN DE EMERGENCIA<br />\r\nEL CONTROL DE LA SALUD DE LOS TRABAJADORES</strong><br />\r\n&nbsp; &nbsp;- La vigilancia de la salud de los trabajadores en el marco de la Ley de Prevenci&oacute;n de Riesgos laborales.<br />\r\n&nbsp; &nbsp;- Objetivos de vigilancia de la salud. Las t&eacute;cnicas de vigilancia de la salud.<br />\r\n&nbsp; &nbsp;- Integraci&oacute;n de los programas de vigilancia de la salud en el programa de Prevenci&oacute;n de Riesgos Laborales.<br />\r\n<strong>COMPONENTES IMPLICADOS EN LA PREVENCI&Oacute;N DE RIESGOS LABORALES</strong><br />\r\n&nbsp; &nbsp;- Organismos internacionales. Organismos nacionales. El empresario y su deber de prevenci&oacute;n. El trabajador y sus obligaciones&nbsp;preventivas.<br />\r\n<strong>LA GESTI&Oacute;N DE LA PREVENCI&Oacute;N DE RIESGOS LABORALES EN LA EMPRESA</strong><br />\r\n&nbsp; &nbsp;- Pol&iacute;tica de prevenci&oacute;n. Control de las actuaciones. Organizaci&oacute;n de recursos para las actividades preventivas.<br />\r\n<strong>DOCUMENTACI&Oacute;N PARA LA GESTI&Oacute;N DE LA PREVENCI&Oacute;N DE RIESGOS</strong><br />\r\n&nbsp; &nbsp;- Documentaci&oacute;n necesaria. Elaboraci&oacute;n de la documentaci&oacute;n.<br />\r\n<strong>PRIMEROS AUXILIOS</strong><br />\r\n&nbsp; &nbsp;- &iquest;Qu&eacute; son los primeros auxilios? Activaci&oacute;n del sistema de emergencia. Socorrismo laboral.<br />\r\n&nbsp; &nbsp;- Evaluaci&oacute;n primaria de un accidentado. Principales emergencias m&eacute;dicas. T&eacute;cnicas de reanimaci&oacute;n.</span></p>\r\n'),
(13, 6, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;INTRODUCCI&Oacute;N A LA INTELIGENCIA EMOCIONAL</strong><br />\r\n&nbsp; - La inteligencia emocional.<br />\r\n&nbsp; &nbsp;- Las emociones.<br />\r\n<strong>COMPONENTES DE LA INTELIGENCIA EMOCIONAL</strong><br />\r\n&nbsp; &nbsp;- Componentes de la inteligencia emocional.&nbsp;<br />\r\n&nbsp; &nbsp;- El coeficiente de inteligencia y la inteligencia emocional.<br />\r\n<strong>INTELIGENCIA EMOCIONAL Y EMPRESA: CONCEPTOS RELACIONADOS</strong><br />\r\n&nbsp; &nbsp;- Motivaci&oacute;n.<br />\r\n&nbsp; &nbsp;- Comunicaci&oacute;n.<br />\r\n&nbsp; &nbsp;- Liderazgo.<br />\r\n&nbsp; &nbsp;- Trabajo en equipo.<br />\r\n<strong>&nbsp;INFLUENCIA DE LA INTELIGENCIA EMOCIONAL EN EL TRABAJO</strong><br />\r\n&nbsp; &nbsp;- Inteligencia emocional y trabajo.<br />\r\n&nbsp; &nbsp;- Importancia de la inteligencia emocional en las organizaciones.<br />\r\n&nbsp; &nbsp;- Ventajas de la aplicaci&oacute;n de la inteligencia emocional en las empresas.<br />\r\n&nbsp; &nbsp;- Conclusiones. Datos de inter&eacute;s.<br />\r\n<strong>&nbsp;INTELIGENCIA EMOCIONAL Y LIDERAZGO</strong><br />\r\n&nbsp; &nbsp;- Concepto de liderazgo.<br />\r\n&nbsp; &nbsp;- Inteligencia emocional y liderazgo.<br />\r\n<strong>INTELIGENCIA EMOCIONAL, TRABAJO DIRECTIVO Y EQUIPOS DE TRABAJO</strong><br />\r\n&nbsp; &nbsp;- El trabajo directivo.<br />\r\n&nbsp; &nbsp;- Inteligencia emocional en los equipos de trabajo.<br />\r\n<strong>INTELIGENCIA EMOCIONAL Y MANEJO DE CONFLICTOS</strong><br />\r\n&nbsp; &nbsp;- El conflicto laboral.<br />\r\n&nbsp; &nbsp;- Formas de prevenir el conflicto en la organizaci&oacute;n.<br />\r\n&nbsp; &nbsp;- Inteligencia emocional en el manejo de conflictos.<br />\r\n<strong>INTELIGENCIA EMOCIONAL Y MANEJO DEL ESTR&Eacute;S</strong><br />\r\n&nbsp; &nbsp;- El estr&eacute;s laboral. T&eacute;cnicas de afrontamiento del estr&eacute;s.<br />\r\n&nbsp; &nbsp;- Influencia de la inteligencia emocional en el manejo del estr&eacute;s.<br />\r\n<strong>INTELIGENCIA EMOCIONAL Y SELECCI&Oacute;N DE PERSONAL</strong><br />\r\n&nbsp; &nbsp;- La selecci&oacute;n de personal.<br />\r\n&nbsp; &nbsp;- La selecci&oacute;n basada en inteligencia emocional.</span></p>\r\n'),
(14, 7, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>INTRODUCCI&Oacute;N A LA WEB 2.0</strong><br />\r\n&nbsp; &nbsp;- Historia de internet. Origen de la web 2.0. Caracter&iacute;sticas de las redes sociales. Perfil del usuario en Social Media. Las marcas en la&nbsp;web 2.0.<br />\r\n<strong>&nbsp;GESTOR DE COMUNIDAD O COMMUNITY MANAGER</strong><br />\r\n&nbsp; &nbsp;- Caracter&iacute;sticas del Community Manager. Funciones del Community Manager. Responsabilidades del gestor de comunidad.&nbsp;<br />\r\n<strong>REDES SOCIALES: TIPOS Y USOS (I)</strong><br />\r\n&nbsp; &nbsp;- Facebook. Twitter. LinkedIn.<br />\r\n<strong>&nbsp;REDES SOCIALES: TIPOS Y USOS (II)</strong><br />\r\n&nbsp; &nbsp;- YouTube. Flickr. Foursquare. Google+. Otras redes sociales: Vimeo, Pinterest, Instagram, Xing y Tuenti.<br />\r\n<strong>&nbsp;GENERACI&Oacute;N DE CONTENIDOS. CREACI&Oacute;N DE BLOGS</strong><br />\r\n&nbsp; &nbsp;- La generaci&oacute;n de contenidos en las redes sociales. &iquest;C&oacute;mo act&uacute;a el usuario en un espacio web? Sobre la propiedad intelectual.<br />\r\n<strong>&nbsp;HERRAMIENTA PARA LA MEDICI&Oacute;N DE LAS REDES SOCIALES</strong><br />\r\n&nbsp; &nbsp;- Herramientas para varias redes sociales. Herramientas para Twitter, Facebook., Pinterest, Google e Instagram.<br />\r\n<strong>&nbsp;ESTRATEGIA PARA ACTUAR CON &Eacute;XITO EN SOCIAL MEDIA</strong><br />\r\n&nbsp; &nbsp;- &iquest;Cu&aacute;l es nuestro punto de partida? &iquest;Cu&aacute;les son nuestros objetivos? &iquest;Cu&aacute;l es nuestro p&uacute;blico objetivo? &iquest;Qu&eacute; herramientas&nbsp;plantearemos?<br />\r\n<strong>&nbsp;ANAL&Iacute;TICA: MEDICI&Oacute;N E INTERPRETACI&Oacute;N DE RESULTADOS</strong><br />\r\n&nbsp; &nbsp;- Google Analytics. Google Insights. Facebook Insights. YouTube Insights. LinkedIn Insights.<br />\r\n<strong>&nbsp;&iquest;QU&Eacute; ES SEO?</strong><br />\r\n&nbsp; &nbsp;- Los buscadores de internet. Errores comunes en SEO. Herramientas SEO. Estrategias SEO.<br />\r\n<strong>&nbsp;INTRODUCCI&Oacute;N AL MARKETING DIGITAL</strong><br />\r\n&nbsp; &nbsp;- Aplicaci&oacute;n de las claves del marketing directo en el marketing digital. Ventajas del marketing digital.<br />\r\n<strong>&nbsp;ELEMENTOS DEL MARKETING DIGITAL</strong><br />\r\n&nbsp; &nbsp;- El producto. El precio. Formas de pago. Los canales. La promoci&oacute;n. Los banners. El correo electr&oacute;nico. Mensajes personalizados.&nbsp;P&uacute;blicos objetivos.<br />\r\n<strong>&nbsp;HERRAMIENTAS ESTRAT&Eacute;GICAS DEL MARKETING DIGITAL</strong><br />\r\n&nbsp; &nbsp;- Aplicaci&oacute;n de la segmentaci&oacute;n en el dise&ntilde;o de la estrategia comercial. Segmentaci&oacute;n a trav&eacute;s de la comunicaci&oacute;n. El marketplace.&nbsp;Caracter&iacute;sticas.<br />\r\n<strong>&nbsp;LA PERSONALIZACI&Oacute;N Y EL MARKETING DIGITAL</strong><br />\r\n&nbsp; &nbsp;- Marketing one to one. Pasos del proceso de marketing one to one. Herramientas. Estrategias de CRM. Implantaci&oacute;n de CRM.&nbsp;<br />\r\n<strong>CAMPA&Ntilde;AS DE COMUNICACI&Oacute;N ONLINE</strong><br />\r\n&nbsp; &nbsp;- Caracter&iacute;sticas de la campa&ntilde;a integral. Efectos de implantaci&oacute;n de una campa&ntilde;a. Preparaci&oacute;n del briefing publicitario como punto&nbsp;de partida.<br />\r\n<strong>&nbsp;OCHO MANERAS ESENCIALES DE PROMOCI&Oacute;N EN INTERNET.</strong><br />\r\n&nbsp; &nbsp;- La comunicaci&oacute;n 360&deg;. El proceso de comunicaci&oacute;n. La regla de las 4F. Flujo de informaci&oacute;n. La funcionalidad. El feedback&nbsp;(retroalimentaci&oacute;n).<br />\r\n<strong>&nbsp;LA PUBLICIDAD ONLINE Y SU EFICACIA</strong><br />\r\n&nbsp; &nbsp;- Formas de publicidad online. Factores que mejoran el &eacute;xito de los banners. Datos de inversi&oacute;n y eficacia publicitaria. Eficacia de una&nbsp;campa&ntilde;a publicitaria.</span></p>\r\n'),
(15, 9, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;MANIPULACI&Oacute;N Y TRANSPORTE DE MERCANC&Iacute;AS</strong><br />\r\n&nbsp; &nbsp;- Flujo log&iacute;stico interno de cargas y servicios. Importancia socioecon&oacute;mica.<br />\r\n&nbsp; &nbsp;- Almacenamiento, suministro y expedici&oacute;n de mercanc&iacute;as.<br />\r\n&nbsp; &nbsp;- Normativa comunitaria y espa&ntilde;ola sobre manipulaci&oacute;n de mercanc&iacute;as.<br />\r\n&nbsp; &nbsp;- Prevenci&oacute;n de riesgos laborales y medidas de seguridad en el transporte de mercanc&iacute;as.<br />\r\n&nbsp; &nbsp;- Medios de transporte internos y externos de las mercanc&iacute;as. Condiciones b&aacute;sicas.<br />\r\n&nbsp; &nbsp;- Simbolog&iacute;a y se&ntilde;alizaci&oacute;n de entorno y medios de transporte: placas, se&ntilde;ales informativas luminosas y ac&uacute;sticas.<br />\r\n&nbsp; &nbsp;- Unidad de carga. Medici&oacute;n y c&aacute;lculo de cargas. Documentaci&oacute;n que acompa&ntilde;a a las mercanc&iacute;as.<br />\r\n&nbsp; &nbsp;- Documentaci&oacute;n que genera el movimiento de cargas. Transmisi&oacute;n por v&iacute;as digitales.<br />\r\n<strong>&nbsp;EMBALAJE Y PALETIZACI&Oacute;N DE MERCANC&Iacute;AS</strong><br />\r\n&nbsp; &nbsp;- Tipos de embalajes y envases en la industria. Condiciones de los embalajes para la protecci&oacute;n de los productos.<br />\r\n&nbsp; &nbsp;- Condiciones de los embalajes para el transporte seguro de los productos. Tipos de paletizaciones. Aplicaciones seg&uacute;n tipos de&nbsp;mercanc&iacute;as.<br />\r\n&nbsp; &nbsp;- Condiciones que deben cumplir las unidades de carga. Precauciones y medidas a adoptar con cargas peligrosas.<br />\r\n<strong>&nbsp;CARRETILLAS PARA EL TRANSPORTE DE MERCANC&Iacute;AS</strong><br />\r\n&nbsp; &nbsp;- Clasificaci&oacute;n, tipos y usos de las carretillas manuales y automotoras. Motores t&eacute;rmicos y motores el&eacute;ctricos.<br />\r\n&nbsp; &nbsp;- Elementos principales de los distintos tipos de carretillas. Mantenimiento b&aacute;sico e indicadores de funcionamiento incorrecto.<br />\r\n<strong>&nbsp;MANEJO Y CONDUCCI&Oacute;N DE CARRETILLAS</strong><br />\r\n&nbsp; &nbsp;- Eje directriz. Acceso y descenso de la carretilla.<br />\r\n&nbsp; &nbsp;- Uso de sistemas de retenci&oacute;n: cabina y cintur&oacute;n de seguridad. Puesta en marcha y detenci&oacute;n de la carretilla.<br />\r\n&nbsp; &nbsp;- Circulaci&oacute;n: velocidad de desplazamiento, trayectoria, naturaleza y estado del piso, etc.<br />\r\n&nbsp; &nbsp;- Maniobras. Frenado, aparcado, marcha atr&aacute;s, descenso en pendiente. Aceleraciones y maniobras incorrectas.<br />\r\n&nbsp; &nbsp;- Maniobras de carga y descarga. Circulaci&oacute;n. Elevaci&oacute;n de la carga.<br />\r\n<strong>&nbsp;CARGA Y DESCARGA DE MERCANC&Iacute;AS</strong><br />\r\n&nbsp; &nbsp;- Estabilidad de la carga y de la carretilla. Nociones de equilibrio.<br />\r\n&nbsp; &nbsp;- Evitaci&oacute;n de vuelcos transversales o longitudinales.<br />\r\n&nbsp; &nbsp;- Comportamiento din&aacute;mico y est&aacute;tico de la carretilla cargada.<br />\r\n&nbsp; &nbsp;- Colocaci&oacute;n incorrecta de la carga en la carretilla. Sobrecarga.<br />\r\n&nbsp; &nbsp;- Modos de colocaci&oacute;n de las mercanc&iacute;as en las estanter&iacute;as.</span></p>\r\n'),
(16, 10, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CALIDAD ALIMENTARIA</strong><br />\r\n&nbsp; &nbsp;- Definici&oacute;n de alimentos. Clasificaci&oacute;n de los alimentos. Criterios de calidad de los alimentos.<br />\r\n<strong>&nbsp;ALTERACIONES DE LOS ALIMENTOS</strong><br />\r\n&nbsp; &nbsp;- Deterioro de los alimentos de origen animal y de origen vegetal.<br />\r\n<strong>&nbsp;MANIPULACI&Oacute;N HIGI&Eacute;NICA DE LOS ALIMENTOS</strong><br />\r\n&nbsp; &nbsp;- Cadena alimentaria: origen, transformaci&oacute;n, tratamientos y trazabilidad de los alimentos.<br />\r\n&nbsp; &nbsp;- El papel del manipulador de alimentos. Manipulaci&oacute;n de los alimentos espec&iacute;ficos del curso.<br />\r\n<strong>&nbsp;LOCALES E INSTALACIONES</strong><br />\r\n&nbsp; &nbsp;- Distribuci&oacute;n de las instalaciones, iluminaci&oacute;n, ventilaci&oacute;n.<br />\r\n&nbsp; &nbsp;- Maquinaria, herramientas y utillaje, limpieza y desinfecci&oacute;n. Eliminaci&oacute;n de basuras y residuos.<br />\r\n<strong>&nbsp;HIGIENE PERSONAL: ASEO, H&Aacute;BITOS HIGI&Eacute;NICOS, ESTADO DE SALUD Y PREVENCI&Oacute;N DE ENFERMEDADES TRANSMISIBLES</strong><br />\r\n&nbsp; &nbsp;- Aseo y h&aacute;bitos higi&eacute;nicos. Estado de salud y prevenci&oacute;n de enfermedades transmisibles.<br />\r\n<strong>&nbsp;INFORMACI&Oacute;N DE PRODUCTOS ALIMENTICIOS: IDENTIFICACI&Oacute;N, ETIQUETADO, CADUCIDAD, COMPOSICI&Oacute;N</strong><br />\r\n&nbsp; &nbsp;- Etiquetado: Identificaci&oacute;n y composici&oacute;n. Caducidad.<br />\r\n<strong>&nbsp;HIGIENE ALIMENTARIA: MICROORGANISMOS EN LOS ALIMENTOS, CONTAMINACIONES, INFECCIONES E INTOXICACIONES&nbsp;ALIMENTARIAS<br />\r\n&nbsp;CONSERVACI&Oacute;N DE LOS ALIMENTOS<br />\r\n&nbsp;CARACTER&Iacute;STICAS ESPEC&Iacute;FICAS DE LOS ALIMENTOS Y PRODUCTOS ALIMENTICIOS<br />\r\n&nbsp;PLAN DE AN&Aacute;LISIS DE PELIGROS Y PUNTOS DE CONTROL CR&Iacute;TICOS</strong><br />\r\n&nbsp; &nbsp;- Diagramas de flujo Sector Conservas, precocinados y cocinados.<br />\r\n<strong>&nbsp;GU&Iacute;A DE PR&Aacute;CTICAS CORRECTAS DE HIGIENE</strong><br />\r\n&nbsp; &nbsp;- Programa de prerrequisitos. Control de procesos.<br />\r\n&nbsp; &nbsp;- Revisiones de autocontrol peri&oacute;dicas.<br />\r\n<strong>&nbsp;LEGISLACI&Oacute;N APLICABLE AL MANIPULADOR DE ALIMENTOS</strong></span></p>\r\n'),
(17, 12, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;INTRODUCCI&Oacute;N Y CONCEPTOS B&Aacute;SICOS</strong><br />\r\n&nbsp; &nbsp;- Definici&oacute;n del t&eacute;rmino acoso.<br />\r\n&nbsp; &nbsp;- Acoso sexual y acoso por raz&oacute;n de sexo. Concepto y diferencias. Tipos de acoso en el trabajo.<br />\r\n<strong>&nbsp;ACERCAMIENTO A LA MAGNITUD DEL PROBLEMA DEL ACOSO SEXUAL Y DEL ACOSO POR RAZ&Oacute;N DE SEXO.</strong><br />\r\n&nbsp; &nbsp;- Origen del acoso sexual y por raz&oacute;n de sexo.<br />\r\n&nbsp; &nbsp;- Creencias versus realidades del acoso sexual en el trabajo. Datos estad&iacute;sticos sobre el acoso laboral en Espa&ntilde;a.<br />\r\n<strong>&nbsp;EL TRATAMIENTO INSTITUCIONAL Y NORMATIVO (&Aacute;MBITO INTERNACIONAL, EUROPEO Y NACIONAL)</strong><br />\r\n&nbsp; &nbsp;- Marco institucional internacional, europeo y nacional sobre el acoso en el &aacute;mbito laboral.<br />\r\n&nbsp; &nbsp;- Marco normativo sobre el acoso en el trabajo.<br />\r\n<strong>&nbsp;LEY ORG&Aacute;NICA 3/2007 PARA LA IGUALDAD EFECTIVA DE MUJERES Y HOMBRES</strong><br />\r\n&nbsp; &nbsp;- La Ley de igualdad. Objeto y &aacute;mbito de aplicaci&oacute;n.<br />\r\n&nbsp; &nbsp;- El acoso sexual y por raz&oacute;n de sexo en la Ley Org&aacute;nica 3/2007.<br />\r\n<strong>&nbsp;&Aacute;MBITO LABORAL: RESPONSABILIDAD EMPRESARIAL Y RLT</strong><br />\r\n&nbsp; &nbsp;- Aspectos sobre el dise&ntilde;o de medidas preventivas.<br />\r\n&nbsp; &nbsp;- Medidas espec&iacute;ficas para prevenir el acoso sexual y el acoso por raz&oacute;n de sexo.<br />\r\n<strong>&nbsp;MEDIDAS Y PROPUESTAS PARA LA NEGOCIACI&Oacute;N COLECTIVA: CONVENIOS Y PLANES DE IGUALDAD.</strong><br />\r\n&nbsp; &nbsp;- Negociaci&oacute;n colectiva. Medidas frente al acoso sexual y por raz&oacute;n de sexo en el convenio colectivo.<br />\r\n&nbsp; &nbsp;- Los planes de igualdad. Medidas preventivas y actuaciones frente al acoso sexual y al acoso por raz&oacute;n de sexo.<br />\r\n<strong>&nbsp;PROTOCOLOS DE ACTUACI&Oacute;N FRENTE AL ACOSO SEXUAL Y AL ACOSO POR RAZ&Oacute;N DE SEXO.</strong><br />\r\n&nbsp; &nbsp;- Caracter&iacute;sticas y contenido. Elaboraci&oacute;n e implantaci&oacute;n en la empresa del protocolo de actuaci&oacute;n.<br />\r\n&nbsp; &nbsp;- Procedimiento de tramitaci&oacute;n de denuncias.<br />\r\n<strong>&nbsp;LEGISLACI&Oacute;N DE REFERENCIA</strong><br />\r\n- Ley Org&aacute;nica 8/2021, de 4 de junio, de protecci&oacute;n integral a la infancia y la adolescencia frente a la violencia.<br />\r\n- Ley 15/2022, de 12 de julio, integral para la igualdad de trato y la no discriminaci&oacute;n.<br />\r\n- Ley Org&aacute;nica 6/2022, de 12 de julio, complementaria de la Ley 15/2022, de 12 de julio, integral para la igualdad de trato y la no discriminaci&oacute;n, de modificaci&oacute;n de la Ley Org&aacute;nica 10/1995, de 23 de noviembre, del C&oacute;digo Penal.<br />\r\n- Ley Org&aacute;nica 10/2022, de 6 de septiembre, de garant&iacute;a integral de la libertad sexual.</span></p>\r\n');
INSERT INTO `contenidos` (`idcontenido`, `N_Accion`, `Anno`, `Contenido`) VALUES
(18, 13, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>&nbsp;PROACTIVIDAD COMERCIAL</strong><br />\r\n&nbsp; &nbsp;- La importancia de ser proactivo. El esfuerzo continuado. La orientaci&oacute;n al cliente y la imagen que le transmitimos.<br />\r\n&nbsp; &nbsp;- Planificaci&oacute;n y optimizaci&oacute;n de recursos. Reglas para ser proactivos.<br />\r\n<strong>&nbsp;LA ATENCI&Oacute;N Y GESTI&Oacute;N TELEF&Oacute;NICA DE CLIENTES</strong><br />\r\n&nbsp; &nbsp;- La orientaci&oacute;n al cliente. Proceso de asesoramiento comercial a clientes. Atenci&oacute;n de las necesidades del cliente. Incrementar el&nbsp;valor de los clientes actuales.<br />\r\n&nbsp; &nbsp;- Elementos que intervienen en la comunicaci&oacute;n. La expresi&oacute;n verbal. El lenguaje positivo y negativo. La entonaci&oacute;n. La articulaci&oacute;n.<br />\r\n&nbsp; &nbsp;- La escucha activa. Descubrir necesidades. Llamadas de petici&oacute;n de informaci&oacute;n. Tratamiento de reclamaciones.<br />\r\n<strong>&nbsp;LA ENTREVISTA COMERCIAL</strong><br />\r\n&nbsp; &nbsp;- Preparaci&oacute;n de la entrevista comercial. La entrevista comercial y la comunicaci&oacute;n.<br />\r\n&nbsp; &nbsp;- Estructura de la comunicaci&oacute;n. La comunicaci&oacute;n no verbal. La comunicaci&oacute;n verbal. El saludo y la presentaci&oacute;n. La detecci&oacute;n de&nbsp;necesidades.<br />\r\n&nbsp; &nbsp;- Las preguntas. La escucha activa y la empat&iacute;a. La capacidad de sintonizar emocionalmente con la otra persona.<br />\r\n&nbsp; &nbsp;- Las habilidades comerciales como emisores y como receptores de la comunicaci&oacute;n. Defectos y barreras para una buena&nbsp;comunicaci&oacute;n.<br />\r\n<strong>&nbsp;CONVERTIR OPORTUNIDADES EN NECESIDADES</strong><br />\r\n&nbsp; &nbsp;- El proceso comercial y la detecci&oacute;n de oportunidades. Proceso de asesoramiento comercial a clientes. Atenci&oacute;n de las necesidades&nbsp;del cliente.<br />\r\n&nbsp; &nbsp;- Incrementar el valor de los clientes actuales. La venta cruzada. Beneficios de la venta cruzada. C&oacute;mo enfocar la venta cruzada.&nbsp;Generaci&oacute;n de confianza.<br />\r\n<strong>&nbsp;ARGUMENTACI&Oacute;N COMERCIAL</strong><br />\r\n&nbsp; &nbsp;- Las caracter&iacute;sticas del producto o servicio- Las ventajas comerciales del producto o servicio. Los beneficios del producto o servicio.<br />\r\n&nbsp; &nbsp;- Secuencia de la argumentaci&oacute;n comercial: Apertura. Secuencia de la argumentaci&oacute;n comercial: Desarrollo.<br />\r\n&nbsp; &nbsp;- Secuencia de la argumentaci&oacute;n comercial: Demostraci&oacute;n y presentaci&oacute;n de beneficios.<br />\r\n&nbsp; &nbsp;- La argumentaci&oacute;n: esquema a seguir. Algunas recomendaciones pr&aacute;cticas para la argumentaci&oacute;n comercial.<br />\r\n<strong>&nbsp;TRATAMIENTO DE OBJECIONES</strong><br />\r\n&nbsp; &nbsp;- Tratamiento de objeciones. Qu&eacute; debemos hacer cuando el cliente nos plantea una objeci&oacute;n. Tipos de objeciones y formas de&nbsp;afrontarlas.<br />\r\n&nbsp; &nbsp;- T&eacute;cnicas para rebatir objeciones. Reglas de oro en el tratamiento de objeciones.<br />\r\n<strong>&nbsp;EL CIERRE DE VENTAS</strong><br />\r\n&nbsp; &nbsp;- Actividad. El cierre de la venta. Fases en el proceso de cierre de la venta. Las se&ntilde;ales de compra. Algunos tipos de se&ntilde;ales de&nbsp;inter&eacute;s.<br />\r\n&nbsp; &nbsp;- Requisitos para el cierre de venta. T&eacute;cnicas de cierre.<br />\r\n<strong>&nbsp;FIDELIZACI&Oacute;N Y SEGUIMIENTO DE CLIENTES</strong><br />\r\n&nbsp; &nbsp;- Concepto de fidelizaci&oacute;n de clientes. Gesti&oacute;n de clientes. Vinculaci&oacute;n de clientes. Ventajas de la fidelizaci&oacute;n. Factores de fidelizaci&oacute;n.<br />\r\n<strong>ATENCI&Oacute;N EFICAZ AL CLIENTE</strong><br />\r\n&nbsp; &nbsp;- La orientaci&oacute;n al cliente. La comunicaci&oacute;n con el cliente. Escuchar al cliente. La importancia de la imagen. Evitar una imagen&nbsp;negativa.<br />\r\n&nbsp; &nbsp;- La expresi&oacute;n verbal. La calidez de la voz. Comunicaci&oacute;n no verbal. La oficina o establecimiento y el puesto de trabajo.<br />\r\n&nbsp; &nbsp;- C&oacute;mo tratar a nuestros clientes seg&uacute;n su actitud. El cliente que asiente o permanece en silencio. El cliente impulsivo y el cliente&nbsp;indeciso.<br />\r\n&nbsp; &nbsp;- El cliente que se da importancia y lo sabe todo. El cliente riguroso y minucioso. El cliente rudo y pol&eacute;mico. El cliente hablador. El&nbsp;cliente desconfiado y esc&eacute;ptico.<br />\r\n&nbsp; &nbsp;- Tratamiento de quejas y reclamaciones. Recomendaciones finales.<br />\r\n<strong>&nbsp;LA COMUNICACI&Oacute;N Y EL LENGUAJE NO VERBAL PARA EL &Eacute;XITO DE LA VENTA</strong><br />\r\n&nbsp; &nbsp;- El proceso de la venta y la comunicaci&oacute;n. Estructura de la comunicaci&oacute;n. Preparaci&oacute;n de la venta. La venta.<br />\r\n&nbsp; &nbsp;- La comunicaci&oacute;n no verbal. La mirada. Los gestos y posturas. La voz. Comunicaci&oacute;n verbal: la primera impresi&oacute;n. Recomendaciones&nbsp;para la presentaci&oacute;n.<br />\r\n&nbsp; &nbsp;- La detecci&oacute;n de necesidades. Las preguntas. La escucha activa. Actividad &ldquo;la escucha activa&rdquo;. La empat&iacute;a. Sinton&iacute;a emocional.<br />\r\n&nbsp; &nbsp;- Habilidades como emisores. Habilidades como receptores. Barreras en la comunicaci&oacute;n.<br />\r\n<strong>&nbsp;T&Eacute;CNICAS EFICACES PARA EL CIERRE DE VENTAS</strong><br />\r\n&nbsp; &nbsp;- El cierre de venta. Fases en el proceso de cierre de la venta. Se&ntilde;ales de compra. Algunos tipos de se&ntilde;ales de inter&eacute;s. Requisitos&nbsp;para el cierre de la venta.<br />\r\n&nbsp; &nbsp;- T&eacute;cnicas de cierre. Recordemos que&hellip;<br />\r\n&nbsp; &nbsp;- Despu&eacute;s del cierre. Actividad. Seguimiento de la venta.</span></p>\r\n'),
(19, 11, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CONCEPTOS GENERALES SOBRE EL MEDIO AMBIENTE</strong><br />\r\n&nbsp; &nbsp;- Concepto de medio ambiente. Componentes del medio ambiente. El modelo de sistema de medio ambiente. Ecolog&iacute;a y medio&nbsp;ambiente.<br />\r\n&nbsp; &nbsp;- Los seres humanos y el medio ambiente. Los recursos ambientales. Los problemas ambientales.<br />\r\n<strong>&nbsp;REGULACI&Oacute;N JUR&Iacute;DICA DEL MEDIO AMBIENTE</strong><br />\r\n&nbsp; &nbsp;- El Derecho Ambiental. El Derecho Internacional del Medio Ambiente. El Derecho ambiental en la Uni&oacute;n Europea. El Derecho&nbsp;ambiental en Espa&ntilde;a.<br />\r\n&nbsp; &nbsp;- La Responsabilidad ambiental y el delito ecol&oacute;gico. El derecho de acceso a la informaci&oacute;n ambiental. La participaci&oacute;n p&uacute;blica en la&nbsp;pol&iacute;tica ambiental.<br />\r\n<strong>&nbsp;CONTAMINACI&Oacute;N DEL MEDIO ACU&Aacute;TICO</strong><br />\r\n&nbsp; &nbsp;- Caracter&iacute;sticas generales del agua. La calidad del agua. Sistemas de tratamiento y depuraci&oacute;n de las aguas.<br />\r\n&nbsp; &nbsp;- La contaminaci&oacute;n del agua. Obligaciones legales para los vertidos. Legislaci&oacute;n aplicable al medio acu&aacute;tico.<br />\r\n<strong>&nbsp;EL AIRE Y SU CONTAMINACI&Oacute;N</strong><br />\r\n&nbsp; &nbsp;- Descripci&oacute;n del aire y de la atm&oacute;sfera. Contaminantes atmosf&eacute;ricos y sus fuentes de contaminaci&oacute;n.<br />\r\n&nbsp; &nbsp;- Efectos de la contaminaci&oacute;n atmosf&eacute;rica. Instrumentos para el tratamiento de la contaminaci&oacute;n atmosf&eacute;rica. Calidad del aire y&nbsp;protecci&oacute;n de la atm&oacute;sfera.<br />\r\n<strong>&nbsp;CONTAMINACI&Oacute;N AC&Uacute;STICA</strong><br />\r\n&nbsp; &nbsp;- El sonido. El ruido. Instrumentos para la medida del sonido. Evaluaci&oacute;n del ruido.<br />\r\n&nbsp; &nbsp;- Efectos producidos por la contaminaci&oacute;n ac&uacute;stica. Medidas de protecci&oacute;n frente el ruido. Legislaci&oacute;n sobre el ruido.<br />\r\n<strong>&nbsp;CONTAMINACI&Oacute;N DE SUELOS</strong><br />\r\n&nbsp; &nbsp;- Concepto y formaci&oacute;n del suelo. Clasificaci&oacute;n de los suelos. La degradaci&oacute;n del suelo. Descontaminaci&oacute;n de suelos.<br />\r\n&nbsp; &nbsp;- Legislaci&oacute;n aplicable a la contaminaci&oacute;n de suelos.<br />\r\n<strong>&nbsp;LA GESTI&Oacute;N DE RESIDUOS</strong><br />\r\n&nbsp; &nbsp;- Residuos: Concepto y Tipolog&iacute;a. El problema de los residuos. Normativa aplicable a la gesti&oacute;n de los residuos. La gesti&oacute;n de&nbsp;residuos.<br />\r\n&nbsp; &nbsp;- La gesti&oacute;n de residuos industriales. La minimizaci&oacute;n de los residuos.<br />\r\n<strong>&nbsp;T&Eacute;CNICAS DE GESTI&Oacute;N AMBIENTAL (I)</strong><br />\r\n&nbsp; &nbsp;- Sistemas de Gesti&oacute;n Ambiental. An&aacute;lisis del Ciclo de Vida. Etiquetado ecol&oacute;gico. Marketing ecol&oacute;gico. Evaluaci&oacute;n Ambiental.<br />\r\n&nbsp; &nbsp;- Prevenci&oacute;n y control integrado de la contaminaci&oacute;n. Desarrollo sostenible y Agenda 21.<br />\r\n<strong>&nbsp;T&Eacute;CNICAS DE GESTI&Oacute;N AMBIENTAL (II)</strong><br />\r\n&nbsp; &nbsp;- Red Natura 2000. Espacios naturales protegidos. Energ&iacute;as renovables.<br />\r\n<strong>&nbsp;AUDITOR&Iacute;AS AMBIENTALES</strong><br />\r\n&nbsp; &nbsp;- Generalidades sobre la Auditor&iacute;a. Metodolog&iacute;a de realizaci&oacute;n de la Auditor&iacute;a Ambiental. El auditor ambiental.<br />\r\n<strong>&nbsp;EL MEDIO AMBIENTE EN LA GESTI&Oacute;N EMPRESARIAL</strong><br />\r\n&nbsp; &nbsp;- El entorno ambiental en la empresa. Introducci&oacute;n del factor ambiental en el entorno empresarial.<br />\r\n&nbsp; &nbsp;- La estrategia ambiental de la empresa. Empresa y desarrollo sostenible. Impacto ambiental de las empresas.</span></p>\r\n'),
(20, 14, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>FUNDAMENTOS DE INTELIGENCIA ARTIFICIAL Y CHATGPT</strong><br />\r\n&nbsp;&nbsp;&nbsp;- Introducci&oacute;n a la inteligencia artificial.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Conceptos b&aacute;sicos. Historia y evoluci&oacute;n.<br />\r\n&nbsp;&nbsp;&nbsp;- Tipos de inteligencia artificial.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- IA d&eacute;bil vs. IA fuerte. Aprendizaje supervisado, no supervisado y por refuerzo.<br />\r\n&nbsp;&nbsp;&nbsp;- Funcionamiento del ChatGPT.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Arquitectura del mismo. Algoritmos subyacentes.<br />\r\n&nbsp;&nbsp;&nbsp;- Procesamiento del lenguaje natural (NLP).<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- T&eacute;cnicas. Desaf&iacute;os.<br />\r\n&nbsp;&nbsp;&nbsp;- Entrenamiento y fine-tuning de modelos de lenguaje.<br />\r\n&nbsp;&nbsp;&nbsp;- Resumen.<br />\r\n<strong>&nbsp;DESAF&Iacute;OS Y AVANCES EN INTELIGENCIA ARTIFICIAL</strong><br />\r\n&nbsp;&nbsp;&nbsp;- Aplicaciones de ChatGPT en diferentes sectores:<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Medicina.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Educaci&oacute;n.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Servicio al cliente.<br />\r\n&nbsp;&nbsp;&nbsp;- Avances recientes en IA y ChatGPT.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Modelos preentrenados. Transferencia de aprendizaje. GPT-4.<br />\r\n&nbsp;&nbsp;&nbsp;- El futuro de la IA.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Tendencias. Perspectivas.<br />\r\n&nbsp;&nbsp;&nbsp;- Casos de estudio y proyectos pr&aacute;cticos con ChatGPT.<br />\r\n&nbsp;&nbsp;&nbsp;- Integraci&oacute;n de ChatGPT en Bing.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Implicaciones de la integraci&oacute;n de la IA en navegadores web: beneficios y desaf&iacute;os de incorporar asistentes de IA en&nbsp;plataformas de b&uacute;squeda en l&iacute;nea.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Incorporaci&oacute;n del ChatGPT en Microsoft. Uso del ChatGPT en Bing: ejemplos y demostraciones.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Evaluaci&oacute;n del rendimiento del ChatGPT en Bing.<br />\r\n&nbsp;&nbsp;&nbsp;- Consideraciones &eacute;ticas y de privacidad en la integraci&oacute;n del ChatGPT en un navegador web.<br />\r\n&nbsp;&nbsp;&nbsp;- Resumen.<br />\r\n<strong>&nbsp;APLICACIONES PR&Aacute;CTICAS DE CHATGPT</strong><br />\r\n&nbsp;&nbsp;&nbsp;- Superalineaci&oacute;n en la superinteligencia.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Concepto de superalineaci&oacute;n y su importancia para garantizar que est&eacute; alineada con los valores y objetivos humanos.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Riesgos y beneficios. Estrategias para lograrla.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Investigaci&oacute;n y desarrollos actuales: avances tecnol&oacute;gicos y te&oacute;ricos de OpenAI y otras organizaciones.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- &Eacute;tica y seguridad en el desarrollo de la superinteligencia.<br />\r\n&nbsp;&nbsp;&nbsp;- Implementaci&oacute;n del ChatGPT en proyectos reales.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Gu&iacute;a paso a paso.<br />\r\n&nbsp;&nbsp;&nbsp;- Trabajo con el ChatGPT.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Herramientas. Plataformas.<br />\r\n&nbsp;&nbsp;&nbsp;- Optimizaci&oacute;n del rendimiento del ChatGPT.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Ajuste de hiperpar&aacute;metros. Integraci&oacute;n del ChatGPT en aplicaciones web y m&oacute;viles.<br />\r\n&nbsp;&nbsp;&nbsp;- Resumen.<br />\r\n<strong>&nbsp;ESCENARIO PR&Aacute;CTICO</strong><br />\r\n&nbsp;&nbsp;&nbsp;- Introducci&oacute;n pr&aacute;ctica a ChatGPT.<br />\r\n&nbsp;&nbsp;&nbsp;- Explorar GPT.</span></p>\r\n'),
(21, 15, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>INTRODUCCI&Oacute;N</strong><br />\r\n&nbsp;- &iquest;Qu&eacute; es la inteligencia social?<br />\r\n&nbsp;- Saber comunicar: comunicaci&oacute;n verbal y no verbal.<br />\r\n&nbsp;- Asertividad.<br />\r\n&nbsp;- Escucha activa.<br />\r\n&nbsp;- Empat&iacute;a.<br />\r\n&nbsp;- Resumen.<br />\r\n<strong>&nbsp;RESOLUCI&Oacute;N DE CONFLICTOS</strong><br />\r\n&nbsp;- &iquest;Qu&eacute; son problemas y conflictos?<br />\r\n&nbsp;- Solucionar mediante habilidades sociales.<br />\r\n&nbsp;- Gesti&oacute;n del conflicto y toma de decisiones.<br />\r\n&nbsp;- Modelo de comunicaci&oacute;n no violenta.<br />\r\n&nbsp;- Aprender a negociar.<br />\r\n&nbsp;- Resumen.<br />\r\n<strong>&nbsp;GESTI&Oacute;N DEL TIEMPO</strong><br />\r\n&nbsp;- &iquest;Qu&eacute; es una gesti&oacute;n adecuada del tiempo?<br />\r\n&nbsp;- Planificar y organizar el tiempo.<br />\r\n&nbsp;- Ladrones de tiempo.<br />\r\n&nbsp;- Resumen.<br />\r\n<strong>&nbsp;APLICACI&Oacute;N PR&Aacute;CTICA DE HABILIDADES SOCIALES</strong><br />\r\n&nbsp;- Hablar en p&uacute;blico: presentaciones efectivas.<br />\r\n&nbsp;- Desarrollo de equipos: liderazgo.<br />\r\n&nbsp;- Afrontar y prevenir el estr&eacute;s laboral.<br />\r\n&nbsp;- Resumen.</span><br />\r\n&nbsp;</p>\r\n'),
(22, 16, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;INTRODUCCI&Oacute;N A EXCEL 365</strong><br />\r\n&nbsp; &nbsp; - Entrar y salir del programa. La Ventana de Microsoft Excel. El Concepto de hoja de c&aacute;lculo. Introducci&oacute;n de Datos.<br />\r\n<strong>&nbsp;OPERACIONES B&Aacute;SICAS</strong><br />\r\n&nbsp; &nbsp; - Crear nuevos libros de trabajo. Diversas formas de guardar los libros. Abrir un libro de trabajo. Desplazamiento por el libro de&nbsp;trabajo.<br />\r\n&nbsp; &nbsp; - Los datos de Excel. Vista previa de impresi&oacute;n e imprimir.<br />\r\n<strong>&nbsp;TRABAJAR CON CELDAS</strong><br />\r\n&nbsp; &nbsp; - Selecci&oacute;n de celdas. Copiar y mover bloques. Modificaci&oacute;n de datos. Comandos deshacer y rehacer.<br />\r\n&nbsp; &nbsp; - B&uacute;squeda y reemplazo de datos. Insertar y eliminar celdas. Repetici&oacute;n de celdas. El comando Suma.<br />\r\n<strong>&nbsp;FORMATO DE TEXTO Y HOJAS DE C&Aacute;LCULO</strong><br />\r\n&nbsp; &nbsp; - Tipos de letra. Alineaci&oacute;n de datos. Aplicaci&oacute;n de tramas, bordes y color. Sangrado.<br />\r\n&nbsp; &nbsp; - Configurar p&aacute;gina. Encabezados y pies de p&aacute;gina. Saltos de p&aacute;gina. Estilos. Validaci&oacute;n de datos.<br />\r\n<strong>&nbsp;USO DE NOMBRES Y REFERENCIAS EXTERNAS</strong><br />\r\n&nbsp; &nbsp;- Selecci&oacute;n de hojas de c&aacute;lculo. Mover y copiar hojas de c&aacute;lculo. Insertar y eliminar hojas de c&aacute;lculo. Generalidades de las hojas de&nbsp;c&aacute;lculo. Uso de nombres.&nbsp;<br />\r\n<strong>LA AYUDA DE OFFICE</strong><br />\r\n&nbsp; &nbsp; - La Ayuda de Office. La Ayuda contextual.<br />\r\n<strong>&nbsp;VISUALIZACI&Oacute;N DE LOS LIBROS DE TRABAJO</strong><br />\r\n&nbsp; &nbsp; - Formas de ver una hoja de c&aacute;lculo. Cuadro de nombre y de f&oacute;rmula. Zoom. Visualizaci&oacute;n del libro y de las hojas. Gesti&oacute;n de&nbsp;ventanas.<br />\r\n<strong>&nbsp;FORMATOS DE HOJA</strong><br />\r\n&nbsp; &nbsp; - Relleno autom&aacute;tico de celdas. Celdas de referencia absoluta, relativa y mixta. Formatos de datos num&eacute;ricos.<br />\r\n&nbsp; &nbsp; - Formatos condicionales. Protecci&oacute;n de datos. Comentarios y notas. Creaci&oacute;n de esquemas.<br />\r\n<strong>&nbsp;HERRAMIENTAS M&Aacute;S &Uacute;TILES EN EXCEL</strong><br />\r\n&nbsp; &nbsp; - Autocorrecci&oacute;n. Ordenaciones. C&aacute;lculos autom&aacute;ticos en la barra de estado. Otras caracter&iacute;sticas de Excel.<br />\r\n<strong>&nbsp;F&Oacute;RMULAS Y FUNCIONES I</strong><br />\r\n&nbsp; &nbsp; - Crear f&oacute;rmulas. Localizaci&oacute;n de errores en las f&oacute;rmulas. Calcular subtotales. Rango de funciones.<br />\r\n&nbsp; &nbsp; - Funciones estad&iacute;sticas y matem&aacute;ticas. Funciones financieras. La funci&oacute;n Euroconvert. Funciones de informaci&oacute;n.<br />\r\n<strong>&nbsp;F&Oacute;RMULAS Y FUNCIONES II</strong><br />\r\n&nbsp; &nbsp; - Funciones de fecha y hora. Funciones de texto. Funciones l&oacute;gicas. Funciones de b&uacute;squeda y referencia.<br />\r\n<strong>&nbsp;CREACI&Oacute;N DE GR&Aacute;FICOS</strong><br />\r\n&nbsp; &nbsp; - WordArt. Insertar y eliminar im&aacute;genes. Insertar gr&aacute;ficos. Los Minigr&aacute;ficos.</span></p>\r\n'),
(23, 17, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>&nbsp;UD1. VIVO EN UNA CASITA DE CAMPO (I LIVE IN A COTTAGE)</strong><br />\r\n&nbsp; &nbsp;- She always jogs in the morning. I&acute;m buying a new house. Do you understand me?. My brother works in a crew.&nbsp;<br />\r\n<strong>UD2. &iexcl;FUE TAN DIVERTIDO! (IT WAS SO ENJOYABLE!)</strong><br />\r\n&nbsp; &nbsp;- I passed my exams in June. I was watching tv when. Wearing glasses. At harrods&rsquo;s.&nbsp;<br />\r\n<strong>UD3. &iexcl;SER&Aacute; O NO SER&Aacute;! (WILL IT BE OR WON&acute;T IT BE!)</strong><br />\r\n&nbsp; &nbsp;- It&rsquo;s never too late!. Will it rain tomorrow?. Emma will study hard at university. I like english!.&nbsp;<br />\r\n<strong>UD4. EN EL COLEGIO (AT SCHOOL)</strong><br />\r\n&nbsp; &nbsp;- A day at school. Choosing the subjects. How many subjects do you have?. How do i register?.&nbsp;<br />\r\n<strong>UD5. LOS MEDIOS DE COMUNICACI&Oacute;N BRIT&Aacute;NICOS (THE BRITISH MASS MEDIA)</strong><br />\r\n&nbsp; &nbsp;- Have you ever been to a tv programme?. The world&acute;s best tv programme!. Meeting one another. What magazine have you bought?.&nbsp;<br />\r\n<strong>UD6. AFICIONES (HOBBIES)</strong><br />\r\n&nbsp; &nbsp; - It&acute;s already done!. For a long time!. You can&acute;t smoke here. Things i like doing.&nbsp;<br />\r\n<strong>UD7. EN LA AGENCIA DE VIAJES (AT THE TRAVEL AGENCY)</strong><br />\r\n&nbsp; &nbsp;- Where have you been on holiday?. Have they finished?. Which one do you like?. What&acute;s london like?.&nbsp;<br />\r\n<strong>UD8. &iexcl;NUNCA HE HECHO ESO! (I HAD NEVER DONE THAT!)</strong><br />\r\n&nbsp; &nbsp;- I hadn&acute;t flown before. The car had broken down. So do i!. A special family.&nbsp;<br />\r\n<strong>UD9. NO ME ENCUENTRO BIEN (I DON&acute;T FEEL WELL)</strong><br />\r\n&nbsp; &nbsp;- Going to the doctor&acute;s. I hate hospitals. My back aches. The chemist&acute;s.&nbsp;<br />\r\n<strong>UD10. &iexcl;UN FIN DE SEMANA INOLVIDABLE! (AN UNFORGETTABLE WEEKEND!)</strong><br />\r\n&nbsp; &nbsp;- Famous people. Have you got a house?. Faster, please!. Somewhere to go.&nbsp;<br />\r\n<strong>UD11. &iexcl;CAMBIANDO MI VIDA! (CHANGING MY LIFE!)</strong><br />\r\n&nbsp; &nbsp;- You can do it yourself!. He used to love me!. What are you looking for?. The best and the worst.&nbsp;<br />\r\n<strong>UD12. VIDA SALVAJE (WILD LIFE)</strong><br />\r\n&nbsp; &nbsp;- He&acute;s about to come. I enjoy looking after my pets. As fast as a lion. Living with animals.&nbsp;<br />\r\n<strong>UD13. ME ENCANTA MI TRABAJO (I LOVE MY JOB)</strong><br />\r\n&nbsp; &nbsp;- Lunch is served. Hamlet was written by Shakespeare. A kind old man. Work, work, work!.&nbsp;<br />\r\n<strong>UD14. AMISTAD (FRIENDSHIP)</strong><br />\r\n&nbsp; &nbsp;- Becoming rich. I have a wonderful friend. I gave her a present. New technologies.&nbsp;<br />\r\n<strong>UD15. DECISIONES (DECISIONS)</strong><br />\r\n&nbsp; &nbsp;- My cousin and I. To go or not to go. I went but. This isn&acute;t enough.&nbsp;<br />\r\n<strong>UD16. COTILLEANDO (GOSSIPING)</strong><br />\r\n&nbsp; &nbsp;- Do you know what?. Mystery stories. Urban legends. Today&acute;s news.&nbsp;<br />\r\n<strong>UD17. PALABRA CORRECTA, PALABRA INCORRECTA (RIGHT WORD, WRONG WORD)</strong><br />\r\n&nbsp; &nbsp;- He said he was happy. Who said that?. He ordered me to open the window. Surfing on the internet.<br />\r\n<strong>&nbsp;UD18. &iexcl;QU&Eacute; PROBLEMA! (WHAT A PROBLEM!)</strong><br />\r\n&nbsp; &nbsp;- I&acute;ll do it if i have time. I wish you were here. Unless you help me!. What an interesting language!.&nbsp;<br />\r\n<strong>UD19. ESCOCIA (SCOTLAND)</strong><br />\r\n&nbsp; &nbsp;- She loved me as a friend. He came to see me. Living on an island. I love that accent!.<br />\r\n<strong>&nbsp;UD20. &iexcl;PALABRAS CONFUSAS! (CONFUSING WORDS!)</strong><br />\r\n&nbsp; &nbsp;- Possible or impossible. My boyfriend is a psychologist. I hate washing-machines. Are you constipated?.</span></p>\r\n'),
(24, 18, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>LET ME INTRODUCE MYSELF</strong><br />\r\n&nbsp; &nbsp;- Need for a change. Just what i am looking for!!!<br />\r\n&nbsp; &nbsp;- Welcome to edinburgh. Getting to know my host family.<br />\r\n<strong>&nbsp;ONCE UPON A TIME</strong><br />\r\n&nbsp; &nbsp;- A strange night. The poets&acute; corner. Once upon a time in england<br />\r\n&nbsp; &nbsp;- The storyteller<br />\r\n<strong>&nbsp;ENJOY YOUR TRIP!</strong><br />\r\n&nbsp; &nbsp;- What a difficult decision!. Getting ready<br />\r\n&nbsp; &nbsp;- Destination: Ireland. *auld lang syne<br />\r\n<strong>&nbsp;I HAVEN&rsquo;T SEEN YOU FOR AGES</strong><br />\r\n&nbsp; &nbsp;- I&acute;ve never tried it before! Yummy, yummy!<br />\r\n&nbsp; &nbsp;- The bill, please. Enjoy your meal!<br />\r\n<strong>&nbsp;HOW CAN I HELP YOU?</strong><br />\r\n&nbsp; &nbsp;- I&acute;m a shopaholic. Shopping at harrods<br />\r\n&nbsp; &nbsp;- How can i help you?. I want my money back<br />\r\n<strong>&nbsp;I&rsquo;M INTO NEW TECHNOLOGY</strong><br />\r\n&nbsp; &nbsp;- I&acute;m a technophile. My first day at work<br />\r\n&nbsp; &nbsp;- It&acute;s so exciting!. I am the best candidate for that job!<br />\r\n<strong>&nbsp;IF I WERE IN YOUR SHOES</strong><br />\r\n&nbsp; &nbsp;- If i could, i would. I wish i could study at oxford!<br />\r\n&nbsp; &nbsp;- It&acute;s so exciting! Dear mr jones<br />\r\n<strong>&nbsp;I&rsquo;M NOT FEELING A HUNDRED PER CENT</strong><br />\r\n&nbsp; &nbsp;- I need a rest! I feel under the weather!<br />\r\n&nbsp; &nbsp;- The honour of the knight Beyond words<br />\r\n<strong>&nbsp;FAREWELL!</strong><br />\r\n&nbsp; &nbsp;- The film is being shot. Would you fancy a rom-com? Definitely!<br />\r\n&nbsp; &nbsp;- I&acute;ll miss you!. Irregular verbs<br />\r\n<strong>&nbsp;LISTENING TRANSCRIPTS</strong><br />\r\n&nbsp; &nbsp;- Exercises key.</span></p>\r\n'),
(25, 19, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;CONCEPTOS B&Aacute;SICOS EN TORNO AL ESTR&Eacute;S</strong><br />\r\n&nbsp; &nbsp;- Concepto de estr&eacute;s.<br />\r\n&nbsp; &nbsp;- Fisiolog&iacute;a del estr&eacute;s.<br />\r\n&nbsp; &nbsp;- Estr&eacute;s y personalidad.<br />\r\n&nbsp; &nbsp;- Consecuencias negativas del estr&eacute;s sobre la salud.<br />\r\n<strong>&nbsp;EL ESTR&Eacute;S LABORAL</strong><br />\r\n&nbsp; &nbsp;- Estr&eacute;s laboral.<br />\r\n&nbsp; &nbsp;- Agentes estresores en el entorno laboral.<br />\r\n&nbsp; &nbsp;- Principales causas del estr&eacute;s laboral.<br />\r\n&nbsp; &nbsp;- Fases del estr&eacute;s.<br />\r\n&nbsp; &nbsp;- S&iacute;ndrome de Burnout.<br />\r\n&nbsp; &nbsp;- Consecuencias del estr&eacute;s para la organizaci&oacute;n.<br />\r\n&nbsp; &nbsp;- Prevenci&oacute;n del estr&eacute;s.<br />\r\n<strong>&nbsp;MANEJO DEL ESTR&Eacute;S</strong><br />\r\n&nbsp; &nbsp;- &iquest;C&oacute;mo hacer frente al estr&eacute;s?<br />\r\n&nbsp; &nbsp;- T&eacute;cnicas organizacionales.<br />\r\n&nbsp; &nbsp;- T&eacute;cnicas individuales.</span></p>\r\n'),
(26, 20, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>INTRODUCCI&Oacute;N A LOS PRIMEROS AUXILIOS</strong><br />\r\n&nbsp; &nbsp;- Concepto de primeros auxilios. &nbsp;Limitaciones.<br />\r\n&nbsp; &nbsp;- &iquest;Qu&eacute; hacer ante una situaci&oacute;n de urgencia? El botiqu&iacute;n de primeros auxilios.&nbsp;</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>EL SISTEMA INTEGRAL DE EMERGENCIAS</strong><br />\r\n&nbsp; &nbsp;- Conceptos. Caracter&iacute;sticas y estructura de un sistema integral de urgencias y emergencias (SIE). La cadena asistencial.<br />\r\n&nbsp; &nbsp;- Centro coordinador de urgencias y emergencias (CCUE). Actuaci&oacute;n prehospitalaria al paciente en situaci&oacute;n de emergencia.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;PRIMEROS AUXILIOS EN SITUACIONES B&Aacute;SICAS</strong><br />\r\n&nbsp; &nbsp;- Quemaduras. Otras quemaduras. Hemorragias. Heridas.<br />\r\n&nbsp; &nbsp;- Lesiones m&uacute;sculo-esquel&eacute;ticas. Cuerpos extra&ntilde;os.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;SITUACIONES GRAVES QUE PODEMOS ENCONTRARNOS</strong><br />\r\n&nbsp; &nbsp;- Fracturas especiales. Intoxicaciones.<br />\r\n&nbsp; &nbsp;- Lesiones por calor. Shock.<br />\r\n&nbsp; &nbsp;- Problemas del sistema nervioso. Problemas del sistema respiratorio. Problemas cardiacos.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;RECOMENDACIONES EN REANIMACI&Oacute;N CARDIOPULMONAR B&Aacute;SICA</strong><br />\r\n&nbsp; &nbsp;- Introducci&oacute;n. An&aacute;lisis de la situaci&oacute;n. Planes de actuaci&oacute;n en RCP b&aacute;sica. T&eacute;cnicas de RPC b&aacute;sica.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;ACTUACI&Oacute;N EN ACCIDENTES DE TR&Aacute;FICO</strong><br />\r\n&nbsp; &nbsp;- Introducci&oacute;n. Proteger. Avisar. Socorrer.</span></p>\r\n'),
(27, 5525, 2025, '<p style=\"line-height:2.5\"><span style=\"font-size:14px\"><strong>M&Oacute;DULO 1.</strong> CARACTER&Iacute;STICAS DEL PUESTO DE TRABAJO, TIPO DE VEH&Iacute;CULOS Y DOCUMENTACI&Oacute;N<br />\r\n<strong>M&Oacute;DULO 2.</strong> EQUIPO DE TRABAJO Y CARACTER&Iacute;STICAS T&Eacute;CNICAS DEL VEH&Iacute;CULO-GR&Uacute;A<br />\r\n<strong>M&Oacute;DULO 3.</strong> PRESTACI&Oacute;N DEL SERVICIO. SEGURIDAD VIAL<br />\r\n<strong>M&Oacute;DULO 4.</strong> PREVENCI&Oacute;N DE RIESGOS LABORALES Y PRIMEROS AUXILIOS<br />\r\n<strong>M&Oacute;DULO 5.</strong> CALIDAD DEL SERVICIO Y ATENCI&Oacute;N AL CLIENTE</span></p>\r\n\r\n<p style=\"line-height:2.5\"><span style=\"font-size:14px\">Seg&uacute;n el Real Decreto 159/2021, de 16 de marzo, por el que se regulan los servicios de auxilio en las v&iacute;as p&uacute;blicas.</span></p>\r\n'),
(28, 21, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;EL TRABAJO Y LA SALUD: LOS RIESGOS PROFESIONALES. FACTORES DE RIESGO</strong><br />\r\n&nbsp; &nbsp; - El trabajo y la salud. Los riesgos profesionales. Factores de riesgo.<br />\r\n<strong>&nbsp;DA&Ntilde;OS DERIVADOS DEL TRABAJO. ACCIDENTE DE TRABAJO Y ENFERMEDADES PROFESIONALES. OTRAS PATOLOG&Iacute;AS DERIVADAS DEL&nbsp;TRABAJO</strong><br />\r\n&nbsp; &nbsp; &nbsp;- Da&ntilde;os derivados del trabajo. Los accidentes de trabajo y las enfermedades profesionales.<br />\r\n<strong>&nbsp;MARCO NORMATIVO B&Aacute;SICO EN MATERIA DE PREVENCI&Oacute;N DE RIESGOS LABORALES. DERECHOS Y DEBERES B&Aacute;SICOS EN ESTA&nbsp;MATERIA</strong><br />\r\n&nbsp; &nbsp; - Marco normativo b&aacute;sico en materia de Prevenci&oacute;n de Riesgos Laborales. La Ley de Prevenci&oacute;n de Riesgos Laborales (LPRL).<br />\r\n&nbsp; &nbsp; - Ley 54/2003, reforma del marco normativo de la Prevenci&oacute;n de Riesgos Laborales. El Reglamento de los Servicios de Prevenci&oacute;n&nbsp;(RSP).<br />\r\n&nbsp; &nbsp; - Otras normas espec&iacute;ficas derivadas de la Ley de Prevenci&oacute;n de Riesgos Laborales.<br />\r\n<strong>&nbsp;RIESGOS LIGADOS A LAS CONDICIONES DE SEGURIDAD. EL LUGAR DE TRABAJO</strong><br />\r\n&nbsp; &nbsp; - Las herramientas y las m&aacute;quinas. La electricidad. Los incendios. Almacenamiento, manipulaci&oacute;n y transporte. Se&ntilde;alizaci&oacute;n.<br />\r\n<strong>&nbsp;RIESGOS LIGADOS AL MEDIO AMBIENTE DE TRABAJO</strong><br />\r\n&nbsp; &nbsp; - La exposici&oacute;n laboral a agentes qu&iacute;micos. La exposici&oacute;n laboral a agentes f&iacute;sicos. La exposici&oacute;n laboral a agentes biol&oacute;gicos. El&nbsp;control del riesgo.<br />\r\n<strong>&nbsp;LA CARGA DE TRABAJO, LA FATIGA Y LA INSATISFACCI&Oacute;N LABORAL</strong><br />\r\n&nbsp; &nbsp; - La carga de trabajo. La carga f&iacute;sica. La carga mental. La fatiga. La insatisfacci&oacute;n laboral.<br />\r\n<strong>&nbsp;SISTEMAS ELEMENTALES DE CONTROL DE RIESGOS. PROTECCI&Oacute;N COLECTIVA E INDIVIDUAL</strong><br />\r\n&nbsp; &nbsp; - La prevenci&oacute;n y protecci&oacute;n de los trabajadores. La protecci&oacute;n colectiva. La protecci&oacute;n individual.<br />\r\n<strong>&nbsp;EL PLAN DE EMERGENCIA</strong><br />\r\n&nbsp; &nbsp; - Actuaci&oacute;n frente a emergencias. El plan de emergencia.<br />\r\n<strong>&nbsp;EL CONTROL DE LA SALUD DE LOS TRABAJADORES</strong><br />\r\n&nbsp; &nbsp; - La vigilancia de la salud de los trabajadores en el marco de la Ley de Prevenci&oacute;n de Riesgos laborales. Objetivos de vigilancia de la&nbsp;salud.<br />\r\n&nbsp; &nbsp; - Las t&eacute;cnicas de vigilancia de la salud. Integraci&oacute;n de los programas de vigilancia de la salud en el programa de Prevenci&oacute;n de&nbsp;Riesgos Laborales.<br />\r\n<strong>&nbsp;COMPONENTES IMPLICADOS EN LA PREVENCI&Oacute;N DE RIESGOS LABORALES</strong><br />\r\n&nbsp; &nbsp; - Organismos internacionales. Organismos nacionales. El empresario y su deber de prevenci&oacute;n. El trabajador y sus obligaciones&nbsp;preventivas.<br />\r\n<strong>&nbsp;LA GESTI&Oacute;N DE LA PREVENCI&Oacute;N DE RIESGOS LABORALES EN LA EMPRESA</strong><br />\r\n&nbsp; &nbsp; - Pol&iacute;tica de prevenci&oacute;n. Control de las actuaciones. Organizaci&oacute;n de recursos para las actividades preventivas.<br />\r\n<strong>&nbsp;DOCUMENTACI&Oacute;N PARA LA GESTI&Oacute;N DE LA PREVENCI&Oacute;N DE RIESGOS</strong><br />\r\n&nbsp; &nbsp; - Documentaci&oacute;n necesaria. Elaboraci&oacute;n de la documentaci&oacute;n.<br />\r\n<strong>&nbsp;PRIMEROS AUXILIOS</strong><br />\r\n&nbsp; &nbsp;- &iquest;Qu&eacute; son los primeros auxilios? Activaci&oacute;n del sistema de emergencia. Socorrismo laboral. Evaluaci&oacute;n primaria de un accidentado.<br />\r\n&nbsp; &nbsp;- Principales emergencias m&eacute;dicas. T&eacute;cnicas de reanimaci&oacute;n.</span></p>\r\n'),
(29, 22, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;INTRODUCCI&Oacute;N A LA DESCONEXI&Oacute;N DIGITAL</strong><br />\r\n&nbsp; &nbsp;- El estr&eacute;s: la otra pandemia del siglo XXI<br />\r\n&nbsp; &nbsp;- El impacto de las tecnolog&iacute;as en el &aacute;mbito empresarial<br />\r\n&nbsp; &nbsp;- S&iacute;ndrome de burnout: tipos y diagn&oacute;stico<br />\r\n<strong>&nbsp;DESCONEXI&Oacute;N DIGITAL EN EL TRABAJO</strong><br />\r\n&nbsp; &nbsp;- Desconexi&oacute;n digital. El Derecho digital del trabajador en la LOPDGDD<br />\r\n&nbsp; &nbsp;- Adicci&oacute;n a la conexi&oacute;n: &iquest;C&oacute;mo superarla con tecnolog&iacute;a?<br />\r\n&nbsp; &nbsp;- Volver a lo b&aacute;sico: el gran ant&iacute;doto<br />\r\n<strong>&nbsp;&iquest;PORQU&Eacute; UNA POL&Iacute;TICA DE DESCONEXI&Oacute;N DIGITAL?</strong><br />\r\n&nbsp; &nbsp;- Riesgos y desaf&iacute;os relacionados con el uso de las herramientas digitales.<br />\r\n&nbsp; &nbsp;- Objetivos de la desconexi&oacute;n digital.<br />\r\n<strong>&nbsp;ENTORNO NORMATIVO Y ASPECTOS CLAVE</strong><br />\r\n&nbsp; &nbsp;- La Ley Org&aacute;nica de Protecci&oacute;n de Datos Personales y garant&iacute;a de los derechos digitales (LOPDGDD)<br />\r\n&nbsp; &nbsp;- Texto Refundido de la Ley del Estatuto de los Trabajadores<br />\r\n&nbsp; &nbsp;- Real Decreto Ley 28/2020, de 22 de septiembre de trabajo a distancia<br />\r\n&nbsp; &nbsp;- Ley 10/2021, de 9 de julio, de trabajo a distancia<br />\r\n&nbsp; &nbsp;- Enfoque preventivo del derecho a la desconexi&oacute;n digital (arts.14-16 LPRL y 36,5ET)<br />\r\n&nbsp; &nbsp;- Incumplimientos y sanciones.<br />\r\n<strong>&nbsp;ELABORACI&Oacute;N DE UNA POL&Iacute;TICA DE DESCONEXI&Oacute;N DIGITAL</strong><br />\r\n&nbsp; &nbsp;- &iquest;Qu&eacute; debemos tener en cuenta en una Pol&iacute;tica de Desconexi&oacute;n Digital?<br />\r\n&nbsp; &nbsp;- Teletrabajo y desconexi&oacute;n digital.&nbsp;<br />\r\n&nbsp; &nbsp;- Modalidades de trabajo y desconexi&oacute;n digital: BYOD, trabajo flexible&hellip;<br />\r\n&nbsp; &nbsp;- Ejemplos de pol&iacute;ticas de desconexi&oacute;n digital.</span></p>\r\n'),
(30, 23, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CONDICIONES DE SEGURIDAD DERIVADAS DEL TRABAJO</strong><br />\r\n- El lugar y la superficie de trabajo.<br />\r\n- Se&ntilde;alizaci&oacute;n de seguridad.<br />\r\n- La protecci&oacute;n individual y colectiva.<br />\r\n- Prevenci&oacute;n de trabajos de peligrosidad.</span></p>\r\n'),
(31, 5625, 2025, '<p style=\"line-height:2.5\"><span style=\"font-size:14px\"><strong>M&Oacute;DULO 1.</strong> CARACTER&Iacute;STICAS DEL PUESTO DE TRABAJO, TIPO DE VEH&Iacute;CULOS Y DOCUMENTACI&Oacute;N<br />\r\n<strong>M&Oacute;DULO 2.</strong> EQUIPO DE TRABAJO Y CARACTER&Iacute;STICAS T&Eacute;CNICAS DEL VEH&Iacute;CULO-GR&Uacute;A<br />\r\n<strong>M&Oacute;DULO 3.</strong> PRESTACI&Oacute;N DEL SERVICIO. SEGURIDAD VIAL<br />\r\n<strong>M&Oacute;DULO 4.</strong> PREVENCI&Oacute;N DE RIESGOS LABORALES Y PRIMEROS AUXILIOS<br />\r\n<strong>M&Oacute;DULO 5.</strong> CALIDAD DEL SERVICIO Y ATENCI&Oacute;N AL CLIENTE</span></p>\r\n\r\n<p style=\"line-height:2.5\"><span style=\"font-size:14px\">Seg&uacute;n el Real Decreto 159/2021, de 16 de marzo, por el que se regulan los servicios de auxilio en las v&iacute;as p&uacute;blicas.</span></p>\r\n'),
(32, 30, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>PREVENCI&Oacute;N DE RIESGOS LABORALES: PRINCIPIOS B&Aacute;SICOS Y CONCEPTOS GENERALES&nbsp;</strong><br />\r\n- Riesgos generales en la prevenci&oacute;n. Medidas de prevenci&oacute;n en la prevenci&oacute;n.<br />\r\n- Protecci&oacute;n colectiva. Protecci&oacute;n individual.<br />\r\n- Se&ntilde;alizaci&oacute;n. Seguridad vial.&nbsp;<br />\r\n- Medidas de emergencia y evacuaci&oacute;n.<br />\r\n<strong>PREVENCI&Oacute;N DE RIESGOS LABORALES: APARATOS ELEVADORES</strong><br />\r\n- Carga: definici&oacute;n, caracter&iacute;sticas, almacenamiento y equipos de manipulaci&oacute;n.<br />\r\n- Eslingado. Concepto, caracter&iacute;sticas y buenas pr&aacute;cticas.<br />\r\n- Equipos de trabajo. Normativa y descripci&oacute;n.<br />\r\n- Mantenimiento de equipos de trabajo PALA.<br />\r\n- Manejo y Operaciones frecuentes con la pala.&nbsp;<br />\r\n- Elementos auxiliares para la carga. Estabilidad de la m&aacute;quina y la carga.<br />\r\n- Mantenimiento. La seguridad en el manejo de la m&aacute;quina.&nbsp;<br />\r\n<strong>RIESGOS ASOCIADOS&nbsp;</strong><br />\r\n- Medidas de seguridad.<br />\r\n- Requisitos del operador.&nbsp;<br />\r\n- Operaciones y manejo.<br />\r\n- Protecci&oacute;n colectiva e individual.<br />\r\n- Mantenimiento. Se&ntilde;alizaci&oacute;n.<br />\r\n<strong>CONTENIDO FORMATIVO ADECUADO A LA LEY 31/1995 DE PREVENCI&Oacute;N DE RIESGOS LABORALES Y AL REAL DECRETO 1215/97 DE EQUIPOS DE TRABAJO&nbsp;</strong></span></p>\r\n'),
(33, 29, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CALIDAD ALIMENTARIA</strong><br />\r\n&nbsp; &nbsp;- Definici&oacute;n de alimentos.<br />\r\n&nbsp; &nbsp;- Clasificaci&oacute;n de los alimentos.<br />\r\n&nbsp; &nbsp;- Criterios de calidad de los alimentos.<br />\r\n<strong>ALTERACIONES DE LOS ALIMENTOS</strong><br />\r\n&nbsp; &nbsp;- Deterioro de los alimentos de origen animal y de origen vegetal.<br />\r\n<strong>MANIPULACI&Oacute;N HIGI&Eacute;NICA DE LOS ALIMENTOS</strong><br />\r\n&nbsp; &nbsp;- Cadena alimentaria: origen, transformaci&oacute;n, tratamientos y trazabilidad de los alimentos.<br />\r\n&nbsp; &nbsp;- El papel del manipulador de alimentos. Manipulaci&oacute;n de los alimentos espec&iacute;ficos del curso.<br />\r\n<strong>LOCALES E INSTALACIONES</strong><br />\r\n&nbsp; &nbsp;- Maquinaria, herramientas y utillaje, limpieza y desinfecci&oacute;n.<br />\r\n&nbsp; &nbsp;- Distribuci&oacute;n de las instalaciones, iluminaci&oacute;n, ventilaci&oacute;n. &nbsp;Eliminaci&oacute;n de basuras y residuos.<br />\r\n<strong>HIGIENE PERSONAL: ASEO, H&Aacute;BITOS HIGI&Eacute;NICOS, ESTADO DE SALUD Y PREVENCI&Oacute;N DE ENFERMEDADES TRANSMISIBLES</strong><br />\r\n&nbsp; &nbsp;- Aseo y h&aacute;bitos higi&eacute;nicos.<br />\r\n&nbsp; &nbsp;- Estado de salud y prevenci&oacute;n de enfermedades transmisibles.<br />\r\n<strong>INFORMACI&Oacute;N DE PRODUCTOS ALIMENTICIOS: IDENTIFICACI&Oacute;N, ETIQUETADO, CADUCIDAD, COMPOSICI&Oacute;N</strong><br />\r\n&nbsp; &nbsp;- Etiquetado: Identificaci&oacute;n y composici&oacute;n. Caducidad.<br />\r\n<strong>HIGIENE ALIMENTARIA: MICROORGANISMOS EN LOS ALIMENTOS, CONTAMINACIONES, INFECCIONES E INTOXICACIONES&nbsp;ALIMENTARIAS CONSERVACI&Oacute;N DE LOS ALIMENTOS<br />\r\nCARACTER&Iacute;STICAS ESPEC&Iacute;FICAS DE LOS ALIMENTOS Y PRODUCTOS ALIMENTICIOS<br />\r\nPLAN DE AN&Aacute;LISIS DE PELIGROS Y PUNTOS DE CONTROL CR&Iacute;TICOS<br />\r\nGU&Iacute;A DE PR&Aacute;CTICAS CORRECTAS DE HIGIENE</strong><br />\r\n&nbsp; &nbsp;- Fase de recepci&oacute;n de materias primas. Control de proveedores.<br />\r\n&nbsp; &nbsp;- Fase de conservaci&oacute;n y almacenamiento.<br />\r\n&nbsp; &nbsp;- Fase de preparaci&oacute;n, elaboraci&oacute;n y cocinado.<br />\r\n&nbsp; &nbsp;- Fase de recalentamiento y utilizaci&oacute;n de productos cocinados.<br />\r\n<strong>&nbsp;LEGISLACI&Oacute;N APLICABLE AL MANIPULADOR DE ALIMENTOS</strong></span><br />\r\n&nbsp;</p>\r\n'),
(34, 3625, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>Unidad 1: Introducci&oacute;n</strong><br />\r\n- Breve introducci&oacute;n al impacto de ChatGPT en la productividad y optimizaci&oacute;n de tareas.<br />\r\n- Din&aacute;mica inicial:<br />\r\n&nbsp;&nbsp; &nbsp;- Presentaci&oacute;n de los participantes.<br />\r\n&nbsp;&nbsp; &nbsp;- Intercambio de experiencias previas con ChatGPT.<br />\r\n<strong>Unidad 2: Contexto y Metodolog&iacute;a</strong><br />\r\n- C&oacute;mo funcionan la Inteligencia Artificial y el Machine Learning: Explicaci&oacute;n b&aacute;sica sobre los principios de estas tecnolog&iacute;as y su relaci&oacute;n con ChatGPT.<br />\r\n- C&oacute;mo funciona ChatGPT:<br />\r\n&nbsp;&nbsp; &nbsp;- Mecanismos de generaci&oacute;n de respuestas.<br />\r\n&nbsp;&nbsp; &nbsp;- Limitaciones y capacidades.<br />\r\n- Cu&aacute;ndo usar ChatGPT: Identificaci&oacute;n de tareas y procesos donde puede aportar mayor valor.<br />\r\n<strong>Unidad 3: Interactuar con ChatGPT</strong><br />\r\n- La primera conversaci&oacute;n: C&oacute;mo presentarte y establecer un contexto claro con ChatGPT.<br />\r\n- Tareas clave: Identificaci&oacute;n de &aacute;reas donde ChatGPT puede apoyar, como:<br />\r\n&nbsp;&nbsp; &nbsp;- Respuestas automatizadas.<br />\r\n&nbsp;&nbsp; &nbsp;- Generaci&oacute;n de contenido.<br />\r\n&nbsp;&nbsp; &nbsp;- Resoluci&oacute;n de problemas simples.<br />\r\n- Generaci&oacute;n de prompts efectivos:<br />\r\n&nbsp;&nbsp; &nbsp;- T&eacute;cnicas para a&ntilde;adir contexto relevante.<br />\r\n&nbsp;&nbsp; &nbsp;- Dise&ntilde;ar la estructura de los prompts y definir los datos de salida deseados.<br />\r\n- Mejorar los prompts: M&eacute;todos para iterar y optimizar las interacciones con el modelo.<br />\r\n<strong>Unidad 4: Consejos Profesionales</strong><br />\r\n- La suscripci&oacute;n: Diferencias entre la versi&oacute;n gratuita y ChatGPT Plus, y c&oacute;mo elegir seg&uacute;n las necesidades del negocio.<br />\r\n- Filosof&iacute;a para trabajar con IA:<br />\r\n&nbsp;&nbsp; &nbsp;- Importancia del an&aacute;lisis cr&iacute;tico, la iteraci&oacute;n y la evaluaci&oacute;n constante.<br />\r\n&nbsp;&nbsp; &nbsp;- Integraci&oacute;n de ChatGPT en flujos de trabajo empresariales.<br />\r\n<strong>Unidad 5: Fundamentos de GPT y Tecnolog&iacute;a RAG</strong><br />\r\n- Qu&eacute; son los GPTs: Conceptos b&aacute;sicos sobre los modelos de lenguaje y sus aplicaciones.<br />\r\n- Explorando la Tecnolog&iacute;a RAG (Retrieval-Augmented Generation):<br />\r\n&nbsp;&nbsp; &nbsp;- Introducci&oacute;n a esta t&eacute;cnica y c&oacute;mo potencia la personalizaci&oacute;n de respuestas.<br />\r\n<strong>Unidad 6: Creaci&oacute;n y Personalizaci&oacute;n de Custom GPTs</strong><br />\r\n- Creando nuestro primer GPT personalizado:<br />\r\n&nbsp; &nbsp;- Introducci&oacute;n al proceso de configuraci&oacute;n de un GPT.<br />\r\n&nbsp; &nbsp;- A&ntilde;adir herramientas &uacute;tiles para tareas espec&iacute;ficas.<br />\r\n- Personalizaci&oacute;n avanzada:<br />\r\n&nbsp; &nbsp;- Incorporaci&oacute;n de informaci&oacute;n relevante para la empresa.<br />\r\n&nbsp; &nbsp;- Configuraci&oacute;n de acciones automatizadas.<br />\r\n<strong>Unidad 7: Publicaci&oacute;n y Uso de GPTs</strong><br />\r\n- Completar un flujo completo: Desde la personalizaci&oacute;n hasta la implementaci&oacute;n.<br />\r\n- Exploraci&oacute;n de la GPT Store: C&oacute;mo publicar, compartir y aprovechar herramientas personalizadas.</span></p>\r\n'),
(35, 8025, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><strong>Fundamentos de la Fotograf&iacute;a Digital.</strong><br />\r\n- Tipos de c&aacute;maras digitales (DSLR, mirrorless, compactas). Diferencias entre modelos y cu&aacute;l se adapta mejor a cada necesidad profesional.<br />\r\n- Tri&aacute;ngulo de exposici&oacute;n: ISO, velocidad y apertura. Fundamentos esenciales para controlar la luz.<br />\r\n- Formatos de imagen: JPG vs RAW. Ventajas de trabajar en RAW para obtener la m&aacute;xima calidad en postproducci&oacute;n.<br />\r\n- Interpretaci&oacute;n del histograma. Evaluaci&oacute;n de la exposici&oacute;n en la toma para evitar errores comunes.<br />\r\n- Equipamiento b&aacute;sico recomendado. Gu&iacute;a pr&aacute;ctica para iniciarse en fotograf&iacute;a de interiores con buenos resultados.<br />\r\n<strong>Introducci&oacute;n a la Fotograf&iacute;a Arquitect&oacute;nica</strong><br />\r\n- Sensores y resoluci&oacute;n (ISO). Importancia del tama&ntilde;o del sensor y la resoluci&oacute;n para obtener nitidez y detalle.<br />\r\n- Modos de disparo: manual, prioridad de apertura o velocidad. Selecci&oacute;n del modo seg&uacute;n el tipo de espacio y luz.<br />\r\n- Profundidad de campo y enfoque selectivo. T&eacute;cnicas para dirigir la atenci&oacute;n visual dentro de una composici&oacute;n arquitect&oacute;nica.<br />\r\n- Tipos de c&aacute;maras recomendadas. Revisi&oacute;n del equipamiento ideal seg&uacute;n nivel de experiencia y exigencia del trabajo.<br />\r\n- Lentes para arquitectura e interiores. Uso de gran angular y otras &oacute;pticas para evitar distorsiones y abarcar el espacio.<br />\r\n- Estabilidad en la toma. Herramientas como tr&iacute;podes, niveladores y disparadores remotos para asegurar nitidez y precisi&oacute;n.<br />\r\n<strong>Gesti&oacute;n de la luz y el color.</strong><br />\r\n- Luz natural y horarios recomendados. Aprovechamiento de la luz ambiente para lograr tomas realistas y est&eacute;ticas.<br />\r\n- Control de la exposici&oacute;n en condiciones mixtas de luz INSERT INTO `contenidos` (`idcontenido`, `N_Accion`, `Anno`, `Contenido`) VALUES
(36, 42, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">DECORACI&Oacute;N EN TIENDAS<br />\r\n&nbsp;&nbsp; - Distribuci&oacute;n y recomendaci&oacute;n del espacio de venta<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - La planeaci&oacute;n.&nbsp; El dibujo.&nbsp; El levantamiento<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Centro de inter&eacute;s<br />\r\n&nbsp;&nbsp; - Cualidades del escaparate<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Concepto de escaparate.&nbsp; Reglas b&aacute;sicas para un buen escaparate<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Composici&oacute;n del escaparate. Cualidades del escaparate</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EL COLOR<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n del color como elemento decorativo. C&iacute;rculo crom&aacute;tico. Clasificaci&oacute;n del color<br />\r\n&nbsp;&nbsp; - Colores fr&iacute;os y calientes. Armon&iacute;a y contraste. La expresividad de los colores. El color como elemento decorativo<br />\r\n&nbsp;&nbsp; - Caracter&iacute;sticas de los colores. El color en los establecimientos. El color en el mobiliario. El color en las estaciones</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LA ILUMINACI&Oacute;N<br />\r\n&nbsp;&nbsp; - La iluminaci&oacute;n. L&aacute;mparas y sistemas de iluminaci&oacute;n. Aplicaci&oacute;n de luz a un local</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EL PRODUCTO Y SU PRESENTACI&Oacute;N<br />\r\n&nbsp;&nbsp; - Conocimiento y disposici&oacute;n del producto. Instalaciones comerciales: clasificaci&oacute;n y ordenaci&oacute;n<br />\r\n&nbsp;&nbsp; - Soportes. Reordenamiento peri&oacute;dico de los productos. Pasos que deben seguirse en la colocaci&oacute;n de los productos<br />\r\n&nbsp;&nbsp; - Temas de temporada. Funciones permanentes de una presentaci&oacute;n visual. Mobiliario. Utiler&iacute;a. Escaparates o vitrinas</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EL MOBILIARIO<br />\r\n&nbsp;&nbsp; - Tipos de mobiliario. Mobiliario en la tienda</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EL ESCAPARATE COMO ELEMENTO<br />\r\n&nbsp;&nbsp; - Mensaje que debe transmitir el escaparate: Mensaje del escaparate<br />\r\n&nbsp;&nbsp; - Funciones y objetivos que debe cumplir el escaparate</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">TIPOS DE ESCAPARATE<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n a los tipos de escaparates. Escaparates seg&uacute;n su estructura<br />\r\n&nbsp;&nbsp; - Escaparates seg&uacute;n su g&eacute;nero: textil, complementos, ocio y otros: Escaparates de textil.&nbsp; Escaparates de complementos. Escaparates de ocio. Otros g&eacute;neros</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MATERIALES Y ATREZO<br />\r\n&nbsp;&nbsp; - Elecci&oacute;n de materiales adecuados. Materiales que utilizar en el escaparate</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">T&Eacute;CNICAS DECORATIVAS<br />\r\n&nbsp;&nbsp;&nbsp; - Paredes<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Pinturas. T&eacute;cnicas de pintura<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Papel pintado<br />\r\n&nbsp;&nbsp; - Suelos</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ESTILOS DECORATIVOS<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n a los tipos de estilos decorativos<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Cl&aacute;sico reinterpretado.&nbsp; R&uacute;stico<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Moderno y minimalista.&nbsp; Vanguardista.&nbsp; El kitsch</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LA IMAGEN COMERCIAL<br />\r\n&nbsp;&nbsp; - La creatividad. Fases de la creatividad<br />\r\n&nbsp;&nbsp; - El logotipo<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - R&oacute;tulos y dem&aacute;s soportes</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MERCHANDISING<br />\r\n&nbsp;&nbsp; - &iquest;Qu&eacute; es el merchandising?<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - El merchandising exterior<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - El merchandising interior</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">VISUAL MERCHANDISING<br />\r\n&nbsp;&nbsp; - Factores del visual merchandising. Distribuci&oacute;n de la mercader&iacute;a. Consejos para el visual merchadising</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PUBLICIDAD<br />\r\n&nbsp;&nbsp; - Publicidad en interiores y exteriores<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Publicidad interior. Publicidad exterior<br />\r\n&nbsp;&nbsp; - Publicidad en el lugar de venta. Puntos fr&iacute;os y calientes</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">STAND DE FERIAS<br />\r\n&nbsp;&nbsp; - Pasos para la presentaci&oacute;n de un stand. Distribuci&oacute;n y recorrido. Clasificaci&oacute;n del stand</span></p>\r\n'),
(37, 8125, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>Reacciones adversas a los alimentos</strong><br />\r\nIntroducci&oacute;n.<br />\r\nIncidencia de las alergias e intolerancias alimentarias en la poblaci&oacute;n.<br />\r\nAlergias alimentarias.<br />\r\nIntolerancias alimentarias.<br />\r\nPrincipales diferencias entre alergias e intolerancias alimentarias.<br />\r\nPrevenci&oacute;n de las reacciones adversas a los alimentos.<br />\r\nProtocolos de actuaci&oacute;n para la asistencia de urgencia de un al&eacute;rgico.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>Informaci&oacute;n al consumidor sobre la presencia en los alimentos de sustancias susceptibles de causar alergias e intolerancias</strong><br />\r\nIntroducci&oacute;n.<br />\r\nMarco legal de referencia.<br />\r\nReglamento (UE) n&ordm;1169/2011.<br />\r\nReal Decreto 126/2015 de 27 de febrero.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>Gesti&oacute;n del riesgo de al&eacute;rgenos en alimentos no envasados</strong><br />\r\nIntroducci&oacute;n.<br />\r\nControl del riesgo: an&aacute;lisis, gesti&oacute;n y comunicaci&oacute;n.<br />\r\nAn&aacute;lisis del riesgo.<br />\r\nGesti&oacute;n del riesgo.<br />\r\nComunicaci&oacute;n del riesgo.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>Buenas pr&aacute;cticas en la manipulaci&oacute;n de alimentos no envasados</strong><br />\r\nIntroducci&oacute;n.<br />\r\nPuntos clave para la aplicaci&oacute;n de buenas pr&aacute;cticas.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>Glosario</strong></span><br />\r\n&nbsp;</p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>Documentaci&oacute;n adicional:</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">- La normativa por la que se regula la norma general relativa a la informaci&oacute;n alimentaria de los alimentos que se presenten sin envasar para la venta al consumidor final y a las colectividades, de los envasados en los lugares de venta a petici&oacute;n del comprador, y de los envasados por los titulares del comercio al por menor.<br />\r\n- Ejemplos de adaptaci&oacute;n documental a disposici&oacute;n del cliente.<br />\r\n- Ejemplos documentaci&oacute;n orientativa interna.</span></p>\r\n'),
(38, 44, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">TABLAS Y LISTAS DE DATOS<br />\r\n&nbsp;&nbsp; - Creaci&oacute;n de una tabla. Modificar los datos y estructura de la tabla.<br />\r\n&nbsp;&nbsp; - Cambiar el estilo de la tabla. Ordenar los datos de la tabla.<br />\r\n&nbsp;&nbsp; - Aplicaci&oacute;n de filtros a la tabla. Crear un resumen de datos.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">BASES DE DATOS<br />\r\n&nbsp;&nbsp; - Obtener datos externos desde el texto.<br />\r\n&nbsp;&nbsp; - Obtener datos externos desde Access. Obtener datos externos desde la web.<br />\r\n&nbsp;&nbsp; - Obtener datos externos de otras fuentes. Funciones de bases de datos.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">TABLAS Y GR&Aacute;FICOS DIN&Aacute;MICOS<br />\r\n&nbsp;&nbsp; - Creaci&oacute;n y manejo de tablas din&aacute;micas. Creaci&oacute;n de campos calculados. Importaci&oacute;n de datos. Gr&aacute;ficos din&aacute;micos.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">AN&Aacute;LISIS DE DATOS<br />\r\n&nbsp; - Creaci&oacute;n y uso de escenarios. B&uacute;squeda de objetivos. La herramienta Solver.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MACROS<br />\r\n&nbsp;&nbsp; - Creaci&oacute;n y ejecuci&oacute;n de una macro. Modificaci&oacute;n y seguimiento de una macro.<br />\r\n&nbsp;&nbsp; - Macros y seguridad. Definici&oacute;n de funciones.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CONOCIENDO VISUAL BASIC PARA APLICACIONES (VBA)<br />\r\n&nbsp;&nbsp; - La pantalla de Visual Basic. La ventana Inmediato. &iquest;Qu&eacute; son y para qu&eacute; sirven las variables y constantes?<br />\r\n&nbsp;&nbsp; - Tipos de operadores en Visual Basic. Sentencias condicionales. Sentencias de repetici&oacute;n.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">OPERACIONES M&Aacute;S COTIDIANAS CON VBA.<br />\r\n&nbsp;&nbsp; - Instrucciones b&aacute;sicas para trabajar con libros. Instrucciones b&aacute;sicas para trabajar con hojas.<br />\r\n&nbsp;&nbsp; - Instrucciones b&aacute;sicas para trabajar con celdas y rangos.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CREACI&Oacute;N DE CUADROS DE DI&Aacute;LOGO.<br />\r\n&nbsp;&nbsp; - Utilizaci&oacute;n de los cuadros de di&aacute;logo predise&ntilde;ados de Excel. Cuadros de mensajes.<br />\r\n&nbsp;&nbsp; - Cuadros de introducci&oacute;n de datos. Creaci&oacute;n de cuadros de di&aacute;logo propios.<br />\r\n&nbsp;<br />\r\nTRABAJO EN GRUPO Y SEGURIDAD.<br />\r\n&nbsp;&nbsp; - Compartir libros. Ver y restaurar versiones anteriores.<br />\r\n&nbsp;&nbsp; - Control de cambios. Limitar el acceso a distintos usuarios.</span></p>\r\n\r\n<p style=\"line-height:0.8\">&nbsp;</p>\r\n'),
(39, 43, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:9px\">EL TRABAJO Y LA SALUD: LOS RIESGOS PROFESIONALES. FACTORES DE RIESGO<br />\r\n&nbsp;&nbsp; - El trabajo y la salud. Los riesgos profesionales. Factores de riesgo. Medidas de seguridad.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">DA&Ntilde;OS DERIVADOS DEL TRABAJO. ACCIDENTE DE TRABAJO Y ENFERMEDADES PROFESIONALES. OTRAS PATOLOG&Iacute;AS DERIVADAS DEL TRABAJO<br />\r\n&nbsp;&nbsp; - Da&ntilde;os derivados del trabajo. Los accidentes de trabajo y las enfermedades profesionales. Medidas de seguridad.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">MARCO NORMATIVO B&Aacute;SICO EN MATERIA DE PREVENCI&Oacute;N DE RIESGOS LABORALES. DERECHOS Y DEBERES B&Aacute;SICOS EN ESTA MATERIA<br />\r\n&nbsp;&nbsp; - Marco normativo b&aacute;sico en materia de Prevenci&oacute;n de Riesgos Laborales. La Ley de Prevenci&oacute;n de Riesgos Laborales (LPRL).<br />\r\n&nbsp;&nbsp; - Ley 54/2003, reforma del marco normativo de la Prevenci&oacute;n de Riesgos Laborales. El Reglamento de los Servicios de Prevenci&oacute;n (RSP).<br />\r\n&nbsp;&nbsp; - Otras normas espec&iacute;ficas derivadas de la Ley de Prevenci&oacute;n de Riesgos Laborales.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">RIESGOS LIGADOS A LAS CONDICIONES DE SEGURIDAD. EL LUGAR DE TRABAJO<br />\r\n&nbsp;&nbsp; - Las herramientas y las m&aacute;quinas. La electricidad. Los incendios. Almacenamiento, manipulaci&oacute;n y transporte. Se&ntilde;alizaci&oacute;n.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">RIESGOS LIGADOS AL MEDIO AMBIENTE DE TRABAJO<br />\r\n&nbsp;&nbsp; - La exposici&oacute;n laboral a agentes qu&iacute;micos. La exposici&oacute;n laboral a agentes f&iacute;sicos. La exposici&oacute;n laboral a agentes biol&oacute;gicos. El control del riesgo.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">LA CARGA DE TRABAJO, LA FATIGA Y LA INSATISFACCI&Oacute;N LABORAL<br />\r\n&nbsp;&nbsp; - La carga de trabajo. La carga f&iacute;sica. La carga mental. La fatiga. La insatisfacci&oacute;n laboral.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">SISTEMAS ELEMENTALES DE CONTROL DE RIESGOS. PROTECCI&Oacute;N COLECTIVA E INDIVIDUAL<br />\r\n&nbsp;&nbsp; - La prevenci&oacute;n y protecci&oacute;n de los trabajadores. La protecci&oacute;n colectiva. La protecci&oacute;n individual.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">EL PLAN DE EMERGENCIA</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">EL CONTROL DE LA SALUD DE LOS TRABAJADORES<br />\r\n&nbsp;&nbsp; - La vigilancia de la salud de los trabajadores en el marco de la Ley de Prevenci&oacute;n de Riesgos laborales.<br />\r\n&nbsp;&nbsp; - Objetivos de vigilancia de la salud. Las t&eacute;cnicas de vigilancia de la salud. Integraci&oacute;n de los programas de vigilancia de la salud en el programa de Prevenci&oacute;n de Riesgos Laborales.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">COMPONENTES IMPLICADOS EN LA PREVENCI&Oacute;N DE RIESGOS LABORALES<br />\r\n&nbsp;&nbsp; - Organismos internacionales. Organismos nacionales. El empresario y su deber de prevenci&oacute;n. El trabajador y sus obligaciones preventivas.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">LA GESTI&Oacute;N DE LA PREVENCI&Oacute;N DE RIESGOS LABORALES EN LA EMPRESA<br />\r\n&nbsp;&nbsp; - Pol&iacute;tica de prevenci&oacute;n. Control de las actuaciones. Organizaci&oacute;n de recursos para las actividades preventivas.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">DOCUMENTACI&Oacute;N PARA LA GESTI&Oacute;N DE LA PREVENCI&Oacute;N DE RIESGOS<br />\r\n&nbsp;&nbsp; - Documentaci&oacute;n necesaria. Elaboraci&oacute;n de la documentaci&oacute;n.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">PRIMEROS AUXILIOS<br />\r\n&nbsp;&nbsp; - &iquest;Qu&eacute; son los primeros auxilios? Activaci&oacute;n del sistema de emergencia. Socorrismo laboral.<br />\r\n&nbsp;&nbsp; - Evaluaci&oacute;n primaria de un accidentado. Principales emergencias m&eacute;dicas. T&eacute;cnicas de reanimaci&oacute;n.</span></p>\r\n\r\n<p style=\"line-height:0.8\">&nbsp;</p>\r\n'),
(40, 41, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LA EMPRESA Y LOS TRABAJADORES<br />\r\nEl departamento de personal. Caracter&iacute;sticas de la relaci&oacute;n laboral. Normativa laboral aplicable</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EL CONTRATO DE TRABAJO<br />\r\nSujetos y elementos del contrato de trabajo. Modalidades de contrataci&oacute;n<br />\r\nFomento del empleo y sus beneficios. El proceso de contrataci&oacute;n</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LA SUSPENSI&Oacute;N Y EXTINCI&Oacute;N DE LA RELACI&Oacute;N LABORAL<br />\r\nLas modificaciones del contrato de trabajo. La suspensi&oacute;n del contrato de trabajo<br />\r\nLa extinci&oacute;n del contrato de trabajo y sus causas. Procedimiento en la extinci&oacute;n por despido</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LA SEGURIDAD SOCIAL<br />\r\nEl sistema de la Seguridad Social. Los reg&iacute;menes que integran la Seguridad Social<br />\r\nLa gesti&oacute;n y financiaci&oacute;n del sistema de la Seguridad Social. Acci&oacute;n protectora de la Seguridad Social<br />\r\nDocumentaci&oacute;n relativa a la Seguridad Social</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CONFECCI&Oacute;N DE LA N&Oacute;MINA Y OBLIGACIONES DE COTIZACI&Oacute;N<br />\r\nEl recibo de salario. El salario<br />\r\nCotizaci&oacute;n a la Seguridad Social. Prestaciones de la Seguridad Social. Incapacidad temporal<br />\r\nSituaciones especiales. Liquidaci&oacute;n y pago de cotizaciones ante la Seguridad Social</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">RETENCIONES E INGRESOS A CUENTA DEL IRPF<br />\r\nObjeto de la tributaci&oacute;n. Obligados a retener<br />\r\nTipos de retenci&oacute;n. Modelos de declaraci&oacute;n-liquidaci&oacute;n</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">SUPUESTOS PR&Aacute;CTICOS<br />\r\nN&oacute;mina diaria. N&oacute;mina mensual<br />\r\nN&oacute;mina con incapacidad temporal por accidente de trabajo (AT). N&oacute;mina con incapacidad temporal por enfermedad com&uacute;n (EC)<br />\r\nN&oacute;mina de fin de contrato y vacaciones devengadas y no disfrutadas<br />\r\nN&oacute;mina con paga extra. N&oacute;mina de pluriempleo. Horas extraordinarias<br />\r\nContrato formativo en alternancia. Contrato a tiempo parcial. Nacimiento y cuidado de menor Contrato indefinido a persona con discapacitada menor de 45 a&ntilde;os<br />\r\nContrato indefinido con v&iacute;ctima de violencia de g&eacute;nero. Extinci&oacute;n del contrato por dimisi&oacute;n del trabajador</span></p>\r\n'),
(41, 3125, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CALIDAD ALIMENTARIA</strong><br />\r\n&nbsp; &nbsp;- Definici&oacute;n de alimentos.<br />\r\n&nbsp; &nbsp;- Clasificaci&oacute;n de los alimentos.<br />\r\n&nbsp; &nbsp;- Criterios de calidad de los alimentos.<br />\r\n<strong>ALTERACIONES DE LOS ALIMENTOS</strong><br />\r\n&nbsp; &nbsp;- Deterioro de los alimentos de origen animal y de origen vegetal.<br />\r\n<strong>MANIPULACI&Oacute;N HIGI&Eacute;NICA DE LOS ALIMENTOS</strong><br />\r\n&nbsp; &nbsp;- Cadena alimentaria: origen, transformaci&oacute;n, tratamientos y trazabilidad de los alimentos.<br />\r\n&nbsp; &nbsp;- El papel del manipulador de alimentos. Manipulaci&oacute;n de los alimentos espec&iacute;ficos del curso.<br />\r\n<strong>LOCALES E INSTALACIONES</strong><br />\r\n&nbsp; &nbsp;- Maquinaria, herramientas y utillaje, limpieza y desinfecci&oacute;n.<br />\r\n&nbsp; &nbsp;- Distribuci&oacute;n de las instalaciones, iluminaci&oacute;n, ventilaci&oacute;n. &nbsp;Eliminaci&oacute;n de basuras y residuos.<br />\r\n<strong>HIGIENE PERSONAL: ASEO, H&Aacute;BITOS HIGI&Eacute;NICOS, ESTADO DE SALUD Y PREVENCI&Oacute;N DE ENFERMEDADES TRANSMISIBLES</strong><br />\r\n&nbsp; &nbsp;- Aseo y h&aacute;bitos higi&eacute;nicos.<br />\r\n&nbsp; &nbsp;- Estado de salud y prevenci&oacute;n de enfermedades transmisibles.<br />\r\n<strong>&nbsp;INFORMACI&Oacute;N DE PRODUCTOS ALIMENTICIOS: IDENTIFICACI&Oacute;N, ETIQUETADO, CADUCIDAD, COMPOSICI&Oacute;N</strong><br />\r\n&nbsp; &nbsp;- Etiquetado: Identificaci&oacute;n y composici&oacute;n. Caducidad.<br />\r\n<strong>HIGIENE ALIMENTARIA: MICROORGANISMOS EN LOS ALIMENTOS, CONTAMINACIONES, INFECCIONES E INTOXICACIONES&nbsp;ALIMENTARIAS CONSERVACI&Oacute;N DE LOS ALIMENTOS</strong><br />\r\n<strong>CARACTER&Iacute;STICAS ESPEC&Iacute;FICAS DE LOS ALIMENTOS Y PRODUCTOS ALIMENTICIOS<br />\r\nPLAN DE AN&Aacute;LISIS DE PELIGROS Y PUNTOS DE CONTROL CR&Iacute;TICOS<br />\r\nGU&Iacute;A DE PR&Aacute;CTICAS CORRECTAS DE HIGIENE</strong><br />\r\n&nbsp; &nbsp;- Fase de recepci&oacute;n de materias primas. Control de proveedores.<br />\r\n&nbsp; &nbsp;- Fase de conservaci&oacute;n y almacenamiento.<br />\r\n&nbsp; &nbsp;- Fase de preparaci&oacute;n, elaboraci&oacute;n y cocinado.<br />\r\n&nbsp; &nbsp;- Fase de recalentamiento y utilizaci&oacute;n de productos cocinados.<br />\r\n<strong>LEGISLACI&Oacute;N APLICABLE AL MANIPULADOR DE ALIMENTOS</strong></span></p>\r\n'),
(42, 46, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:9px\">SEGURIDAD INFORM&Aacute;TICA<br />\r\n&nbsp; - Los dominios y las regulaciones asociadas. Riesgos inform&aacute;ticos.&nbsp; Pol&iacute;tica de seguridad. Ejes principales en las estrategias de seguridad. La seguridad y sus aspectos legales</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">LA SEGURIDAD EN LA EMPRESA I<br />\r\n&nbsp;&nbsp; - Requisitos previos. Generalidades sobre seguridad en redes. Redes privadas virtuales. Componentes utilizados en redes y su seguridad<br />\r\n&nbsp;&nbsp; - Sistemas de detecci&oacute;n y prevenci&oacute;n de intrusos. Servidor DNS</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">SEGURIDAD EN LA EMPRESA II<br />\r\n&nbsp;&nbsp; - Objetivos. Disponibilidad de datos y sistemas. Disponibilidad de la infraestructura. Identificaci&oacute;n y autentificaci&oacute;n.&nbsp; Seguridad f&iacute;sica y de entorno. Protecci&oacute;n frente a virus y malware. Pr&aacute;cticas de seguridad</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">MOVILIDAD Y SEGURIDAD<br />\r\n&nbsp;&nbsp; - Seguridad en dispositivos m&oacute;viles. M&oacute;vil y terminal itinerante. Terminales itinerantes: problemas asociados. Buenas pr&aacute;cticas</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">SEGURIDAD EN LOS DATOS<br />\r\n&nbsp;&nbsp; - &iquest;En qu&eacute; consiste la seguridad de los datos?. Riesgo de p&eacute;rdida de datos<br />\r\n&nbsp;&nbsp; - Respaldo y restauraci&oacute;n.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Objetivo de las copias de seguridad<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - &iquest;Qu&eacute; datos es aconsejable copiar?<br />\r\n&nbsp;&nbsp; - Restauraci&oacute;n de datos. Estrategias de copias de seguridad. El archivo de datos. Administraci&oacute;n y supervisi&oacute;n de copias de seguridad. Recuperaci&oacute;n del servidor de respaldo</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">PLAN DE CONTINGENCIA INFORM&Aacute;TICA<br />\r\n&nbsp;&nbsp; - Plan de contingencia inform&aacute;tica. Preparaci&oacute;n ante un desastre<br />\r\n&nbsp;&nbsp; - Elaboraci&oacute;n de un plan de recuperaci&oacute;n ante desastres<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -Fase 1: Planificaci&oacute;n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Fase 2: Identificaci&oacute;n de riesgos<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Fase 3: Identificaci&oacute;n de soluciones<br />\r\n&nbsp;&nbsp; - Virtualizaci&oacute;n de servidores</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">CLOUD COMPUTING<br />\r\n&nbsp;&nbsp; - &iquest;Qu&eacute; es Cloud Computing?. Principios del Cloud Computing. Cloud Computing: riesgos. Buenas pr&aacute;cticas de seguridad</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">INTERNET DE LOS OBJETOS<br />\r\n&nbsp;&nbsp; - &iquest;Qu&eacute; es internet de los objetos?. Tecnolog&iacute;a. Sectores afectados por la seguridad.&nbsp; Nuevas amenazas y nuevos riesgos. Evaluaci&oacute;n de riesgos. Propuestas de Seguridad</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">SENSIBILIZACI&Oacute;N A LA SEGURIDAD EN LA EMPRESA<br />\r\n&nbsp;&nbsp; - La importancia de la sensibilizaci&oacute;n. Comportamiento de los usuarios/trabajadores. Sensibilizaci&oacute;n de los usuarios/trabajadores. Principios &eacute;ticos</span></p>\r\n'),
(43, 47, 2025, '<p><strong><span style=\"font-size:10px\">GRAMMAR</span></strong></p>\r\n\r\n<p><span style=\"font-size:10px\">1) The Present Perfect Simple Tense.<br />\r\n2) Ability<br />\r\n3) Questions Forms: what kind.? how often.? etc.</span></p>\r\n\r\n<p><strong><span style=\"font-size:10px\">VOCABULARY</span></strong></p>\r\n\r\n<p><span style=\"font-size:10px\">1) Homonyms and Homophones.<br />\r\n2) Business Language: talking about jobs.<br />\r\n3) Multiword Verbs.<br />\r\n4) Education.</span></p>\r\n'),
(44, 7425, 2025, '<p style=\"line-height:1.0\"><span style=\"font-size:11px\"><strong>PARTE TE&Oacute;RICA</strong><br />\r\n- OBJETIVO<br />\r\n- DEFINICI&Oacute;N Y&nbsp;PARTES. TIPOS. APLICACIONES<br />\r\n- RIESGOS Y&nbsp;FACTORES DE RIESGO<br />\r\n- MEDIDAS DE PREVENCI&Oacute;N Y&nbsp;PROTECCI&Oacute;N<br />\r\n&nbsp; &nbsp; &nbsp;- MONTAJE DE LA GR&Uacute;A EN EL VEHICULO PORTANTE<br />\r\n&nbsp; &nbsp; &nbsp;- SISTEMAS DE SEGURIDAD DEL EQUIPO (GHA Y&nbsp;CHASIS)<br />\r\n&nbsp; &nbsp; &nbsp;- NORMAS DE SEGURIDAD EN LA PREPARACI&Oacute;N DEL FUNCIONAMIENTO DE LA GR&Uacute;A<br />\r\n- CUESTIONES PREVIAS<br />\r\n- ENTORNO DE TRABAJO<br />\r\n- NORMAS DE SEGURIDAD EN LA MANIOBRA DE CARGA<br />\r\n- RECOMENDACIONES DE SEGURIDAD FRENTE A OTROS RIESGOS DESCRITOS<br />\r\n- EQUIPOS DE PROTECCI&Oacute;N INDIVIDUAL<br />\r\n- OPERARIO<br />\r\n- MANTENIMIENTO<br />\r\n- REVISIONES<br />\r\n<strong>PARTE PR&Aacute;CTICA</strong></span></p>\r\n'),
(45, 7025, 2025, '<p style=\"line-height:2.0\"><span style=\"font-size:12px\">1 - F&oacute;rmulas y funciones.<br />\r\n2 - Formato condicional.<br />\r\n3 - Obtenci&oacute;n de datos externos.<br />\r\n4 - Opciones de seguridad y protecci&oacute;n en libros y hojas de c&aacute;lculo.</span></p>\r\n'),
(46, 48, 2025, '<p><span style=\"font-size:10px\">- Factores de naturales psicosocial<br />\r\n- Organizaci&oacute;n del trabajo<br />\r\n- La carga de trabajo<br />\r\n- El estr&eacute;s<br />\r\n- Otros problemas psicosociales<br />\r\n- Consecuencias de los factores psicosociales y su evaluaci&oacute;n<br />\r\n- Intervenci&oacute;n psicosocial<br />\r\n- Conclusi&oacute;n</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(47, 45, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">REACCIONES ADVERSAS A LOS ALIMENTOS<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n.<br />\r\n&nbsp;&nbsp; - Incidencia de las alergias e intolerancias alimentarias en la poblaci&oacute;n.<br />\r\n&nbsp;&nbsp; - Alergias alimentarias.<br />\r\n&nbsp;&nbsp; - Intolerancias alimentarias.<br />\r\n&nbsp;&nbsp; - Principales diferencias entre alergias e intolerancias alimentarias.<br />\r\n&nbsp;&nbsp; - Prevenci&oacute;n de las reacciones adversas a los alimentos.<br />\r\n&nbsp;&nbsp; - Protocolos de actuaci&oacute;n para la asistencia de urgencia de un al&eacute;rgico.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">INFORMACI&Oacute;N AL CONSUMIDOR SOBRE LA PRESENCIA EN LOS ALIMENTOS DE SUSTANCIAS SUSCEPTIBLES DE CAUSAR ALERGIAS E INTOLERANCIAS<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n.<br />\r\n&nbsp;&nbsp; - Marco legal de referencia.<br />\r\n&nbsp;&nbsp; - Reglamento (UE) n&ordm;1169/2011.<br />\r\n&nbsp;&nbsp; - Real Decreto 126/2015 de 27 de febrero.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">GESTI&Oacute;N DEL RIESGO DE AL&Eacute;RGENOS EN ALIMENTOS NO ENVASADOS<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n.<br />\r\n&nbsp;&nbsp; - Control del riesgo: an&aacute;lisis, gesti&oacute;n y comunicaci&oacute;n.<br />\r\n&nbsp;&nbsp; - An&aacute;lisis del riesgo.<br />\r\n&nbsp;&nbsp; - Gesti&oacute;n del riesgo.<br />\r\n&nbsp;&nbsp; - Comunicaci&oacute;n del riesgo.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">BUENAS PR&Aacute;CTICAS EN LA MANIPULACI&Oacute;N DE ALIMENTOS NO ENVASADOS<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n.<br />\r\n&nbsp;&nbsp; - Puntos clave para la aplicaci&oacute;n de buenas pr&aacute;cticas.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(49, 35, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">INTRODUCCI&Oacute;N DE LOS DATOS NECESARIOS PARA PODER FACTURAR EN EL SISTEMA<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n<br />\r\n&nbsp;&nbsp; - Creaci&oacute;n de fichas de clientes, art&iacute;culos, tipos de IVA y cuentas contables<br />\r\n&nbsp;&nbsp; - Gesti&oacute;n y creaci&oacute;n de documentos y plantillas<br />\r\n&nbsp;&nbsp; - Gesti&oacute;n de diferentes almacenes, vendedores y cajas<br />\r\n&nbsp;&nbsp; - Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">FACTURACI&Oacute;N EN EL EJERCICIO DE LA ACTIVIDAD DE LA EMPRESA<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n<br />\r\n&nbsp;&nbsp; - Traspaso de pedidos y albaranes a facturas y asientos<br />\r\n&nbsp;&nbsp; - Realizaci&oacute;n de facturas rectificativas con el sistema inform&aacute;tico<br />\r\n&nbsp;&nbsp; - Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CREACI&Oacute;N Y OBTENCI&Oacute;N DE LISTADOS DE FACTURACI&Oacute;N CON EL SISTEMA INFORM&Aacute;TICO<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n<br />\r\n&nbsp;&nbsp; - Extracci&oacute;n de listados de ventas, clientes, art&iacute;culos, etc.<br />\r\n&nbsp;&nbsp; - Edici&oacute;n y creaci&oacute;n de remesas de pago y de cobro, as&iacute; como pagar&eacute;s y talones<br />\r\n&nbsp;&nbsp; - Resumen</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(50, 8, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">INTRODUCCI&Oacute;N Y CONCEPTOS B&Aacute;SICOS<br />\r\n&nbsp;&nbsp; - Nociones b&aacute;sicas del impuesto. Clasificaci&oacute;n e integraci&oacute;n y compensaci&oacute;n de rentas. C&aacute;lculo de la base imponible</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">RENDIMIENTOS DEL TRABAJO<br />\r\n&nbsp;&nbsp; - Concepto y naturaleza. Rendimiento neto del trabajo. Reducciones sobre los rendimientos netos del trabajo<br />\r\n&nbsp;&nbsp; - Retribuciones en especie: modalidades y valoraci&oacute;n. Dietas y asignaciones para gastos. Trabajadores expatriados, impatriados y transfronterizos. Tratamiento de los rendimientos irregulares</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ACTIVIDADES ECON&Oacute;MICAS<br />\r\n&nbsp;&nbsp; - Rendimiento de actividades econ&oacute;micas. R&eacute;gimen de estimaci&oacute;n directa<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Libertad de amortizaci&oacute;n con mantenimiento de empleo de la Ley 4/2008, de 23 de diciembre<br />\r\n&nbsp;&nbsp; - R&eacute;gimen de estimaci&oacute;n objetiva</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">RENDIMIENTOS DE CAPITAL<br />\r\n&nbsp;&nbsp; - Ideas previas. Rendimientos de capital. Rendimientos de capital inmobiliario. Imputaci&oacute;n de rentas inmobiliarias.<br />\r\n&nbsp;&nbsp; - Rendimientos de capital mobiliario</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">GANANCIAS Y P&Eacute;RDIDAS PATRIMONIALES<br />\r\n&nbsp;&nbsp; - Concepto, delimitaci&oacute;n e imputaci&oacute;n temporal. Importe de las ganancias y p&eacute;rdidas patrimoniales<br />\r\n&nbsp;&nbsp; - Normas espec&iacute;ficas de valoraci&oacute;n. Reinversi&oacute;n en los supuestos de transmisi&oacute;n de vivienda habitual<br />\r\n&nbsp;&nbsp; - Compatibilidad de la exenci&oacute;n por reinversi&oacute;n con la deducci&oacute;n por adquisici&oacute;n de vivienda habitual<br />\r\n&nbsp;&nbsp; - Ganancias patrimoniales no justificadas. Individualizaci&oacute;n de las ganancias y p&eacute;rdidas patrimoniales.<br />\r\n&nbsp;&nbsp; - Elementos patrimoniales afectos y no afectos a actividades econ&oacute;micas</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">BASE LIQUIDABLE<br />\r\n&nbsp;&nbsp; - Base liquidable general y del ahorro. Reducciones de la base imponible general. Tratamiento de los sistemas de previsi&oacute;n social<br />\r\n&nbsp;&nbsp; - Tratamiento de la familia. El m&iacute;nimo personal y familiar</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">C&Aacute;LCULO DEL IMPUESTO Y DEDUCCIONES<br />\r\n&nbsp;&nbsp; - Cuesti&oacute;n previa. Cuant&iacute;a &iacute;ntegra estatal. Cuant&iacute;a &iacute;ntegra auton&oacute;mica. Escala auton&oacute;mica del IRPF. Cuota l&iacute;quida<br />\r\n&nbsp;&nbsp; - Cuota diferencial. Otras deducciones. Resultado de la declaraci&oacute;n</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">OBLIGACIONES FORMALES<br />\r\n&nbsp;&nbsp; - Declaraci&oacute;n del impuesto. Declaraci&oacute;n tributaria especial del Real Decreto-Ley 12/2012, de 30 de marzo<br />\r\n&nbsp;&nbsp; - Contabilidad, registros y facturaci&oacute;n. Retenciones. Pagos fraccionados</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">REG&Iacute;MENES ESPECIALES Y REG&Iacute;MENES TRANSITORIOS<br />\r\n&nbsp;&nbsp; - Reg&iacute;menes especiales. Reg&iacute;menes transitorios</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(51, 7325, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CALIDAD ALIMENTARIA</strong><br />\r\n&nbsp; &nbsp;- Definici&oacute;n de alimentos.<br />\r\n&nbsp; &nbsp;- Clasificaci&oacute;n de los alimentos.<br />\r\n&nbsp; &nbsp;- Criterios de calidad de los alimentos.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>ALTERACIONES DE LOS ALIMENTOS</strong><br />\r\n&nbsp; &nbsp;- Deterioro de los alimentos de origen animal y de origen vegetal.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>MANIPULACI&Oacute;N HIGI&Eacute;NICA DE LOS ALIMENTOS</strong><br />\r\n&nbsp; &nbsp;- Cadena alimentaria: origen, transformaci&oacute;n, tratamientos y trazabilidad de los alimentos.<br />\r\n&nbsp; &nbsp;- El papel del manipulador de alimentos. Manipulaci&oacute;n de los alimentos espec&iacute;ficos del curso.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>LOCALES E INSTALACIONES</strong><br />\r\n&nbsp; &nbsp;- Maquinaria, herramientas y utillaje, limpieza y desinfecci&oacute;n.<br />\r\n&nbsp; &nbsp;- Distribuci&oacute;n de las instalaciones, iluminaci&oacute;n, ventilaci&oacute;n. &nbsp;Eliminaci&oacute;n de basuras y residuos.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>HIGIENE PERSONAL: ASEO, H&Aacute;BITOS HIGI&Eacute;NICOS, ESTADO DE SALUD Y PREVENCI&Oacute;N DE ENFERMEDADES TRANSMISIBLES</strong><br />\r\n&nbsp; &nbsp;- Aseo y h&aacute;bitos higi&eacute;nicos.<br />\r\n&nbsp; &nbsp;- Estado de salud y prevenci&oacute;n de enfermedades transmisibles.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>&nbsp;INFORMACI&Oacute;N DE PRODUCTOS ALIMENTICIOS: IDENTIFICACI&Oacute;N, ETIQUETADO, CADUCIDAD, COMPOSICI&Oacute;N</strong><br />\r\n&nbsp; &nbsp;- Etiquetado: Identificaci&oacute;n y composici&oacute;n. Caducidad.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>HIGIENE ALIMENTARIA: MICROORGANISMOS EN LOS ALIMENTOS, CONTAMINACIONES, INFECCIONES E INTOXICACIONES&nbsp;ALIMENTARIAS CONSERVACI&Oacute;N DE LOS ALIMENTOS</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CARACTER&Iacute;STICAS ESPEC&Iacute;FICAS DE LOS ALIMENTOS Y PRODUCTOS ALIMENTICIOS</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>PLAN DE AN&Aacute;LISIS DE PELIGROS Y PUNTOS DE CONTROL CR&Iacute;TICOS</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>GU&Iacute;A DE PR&Aacute;CTICAS CORRECTAS DE HIGIENE</strong><br />\r\n&nbsp; &nbsp;- Fase de recepci&oacute;n de materias primas. Control de proveedores.<br />\r\n&nbsp; &nbsp;- Fase de conservaci&oacute;n y almacenamiento.<br />\r\n&nbsp; &nbsp;- Fase de preparaci&oacute;n, elaboraci&oacute;n y cocinado.<br />\r\n&nbsp; &nbsp;- Fase de recalentamiento y utilizaci&oacute;n de productos cocinados.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>LEGISLACI&Oacute;N APLICABLE AL MANIPULADOR DE ALIMENTOS</strong></span></p>\r\n'),
(52, 24, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>EL DERECHO EN EL MEDIO AMBIENTE</strong><br />\r\n- La protecci&oacute;n jur&iacute;dica del Medio Ambiente.<br />\r\n- El Derecho Ambiental.<br />\r\n- Distribuci&oacute;n de competencias en materia ambiental.<br />\r\n- Normativa ambiental aplicable a la empresa.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>LAS EMISIONES ATMOSF&Eacute;RICAS Y SU REGULACI&Oacute;N</strong><br />\r\n- Contaminantes atmosf&eacute;ricos y fuentes de emisi&oacute;n.<br />\r\n- Actuaciones sobre las emisiones contaminantes.<br />\r\n- Normativa reguladora de las emisiones contaminantes.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>LA REGULACI&Oacute;N DEL MEDIO ACU&Aacute;TICO</strong><br />\r\n- La contaminaci&oacute;n del agua.<br />\r\n- Obligaciones legales para los causantes de vertidos.<br />\r\n- Normativa relacionada con la contaminaci&oacute;n del agua. Calidad del agua.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>LA REGULACI&Oacute;N DE LOS RESIDUOS</strong><br />\r\n- Los residuos. Legislaci&oacute;n b&aacute;sica de residuos.<br />\r\n- Obligaciones legales para las empresas en materia de residuos industriales.<br />\r\n- Planes de minimizaci&oacute;n de residuos.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CONTAMINACI&Oacute;N AC&Uacute;STICA</strong><br />\r\n- El ruido como factor contaminante.<br />\r\n- Efectos producidos por la contaminaci&oacute;n ac&uacute;stica.<br />\r\n- Obligaciones a cumplir por las empresas en materia de ruidos.<br />\r\n- Evaluaci&oacute;n del ruido. Medidas de protecci&oacute;n frente al ruido.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>INSTRUMENTOS PREVENTIVOS PARA LA GESTI&Oacute;N AMBIENTAL</strong><br />\r\n- La Evaluaci&oacute;n de Impacto Ambiental.<br />\r\n- Prevenci&oacute;n y Control Integrado de la Contaminaci&oacute;n. Actividades clasificadas.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>INSTRUMENTOS PARA LA GESTI&Oacute;N AMBIENTAL DE LAS EMPRESAS</strong><br />\r\n- Sistemas de Gesti&oacute;n Ambiental.</span></p>\r\n'),
(53, 25, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>LIDERAZGO</strong><br />\r\n- Introducci&oacute;n. El concepto de empresa: la funci&oacute;n directiva y de mando. Legitimidad del mando<br />\r\n- Principales competencias directivas. Relaciones entre mando y colaborador<br />\r\n- Tipolog&iacute;as. El rol del equipo directivo</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>MOTIVACI&Oacute;N</strong><br />\r\n- Bases te&oacute;ricas de la motivaci&oacute;n<br />\r\n- Teor&iacute;a de Maslow: la pir&aacute;mide de necesidades. Teor&iacute;a de Herzberg. Teor&iacute;a de Pigmali&oacute;n<br />\r\n- La automotivaci&oacute;n</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CONFLICTO Y CONTROL DEL CONFLICTO</strong><br />\r\n- Introducci&oacute;n. Definici&oacute;n de conflicto. Formas del conflicto. Niveles de conflicto<br />\r\n- Ventajas e inconvenientes del conflicto. Estrategias de resoluci&oacute;n del conflicto<br />\r\n- Comportamientos de los miembros del equipo ante el conflicto</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>DIRECCI&Oacute;N DE REUNIONES</strong><br />\r\n- Introducci&oacute;n. Claves de una reuni&oacute;n eficaz. El objetivo de la reuni&oacute;n. El orden del d&iacute;a<br />\r\n- El equipo humano. Dirigir y moderar la reuni&oacute;n. Errores a evitar</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>HERRAMIENTAS PARA CONOCERTE COMO DIRECTOR</strong><br />\r\n- Mapa de la inteligencia emocional. Competencias personales<br />\r\n- Competencias sociales. Directrices del aprendizaje de las habilidades emocionales</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>DIAGN&Oacute;STICO PERSONAL Y ELECCI&Oacute;N DE PRIORIDADES</strong><br />\r\n- &Aacute;reas clave. Metas a largo plazo. Valores<br />\r\n- Cualidades/habilidades personales. Los objetivos 6.6. Identificaci&oacute;n y manejo de prioridades</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>BALANCE PERSONAL DEL TIEMPO</strong><br />\r\n- An&aacute;lisis de los tiempos. Agrupaci&oacute;n de actividades<br />\r\n- Trabajo en bloques de tiempo. La matriz urgente e importante. Revisi&oacute;n de metas a largo plazo</span></p>\r\n\r\n<p style=\"line-height:0.8\"><strong><span style=\"font-size:10px\">ANTES DE PLANIFICAR</span></strong><br />\r\n<span style=\"font-size:10px\">- An&aacute;lisis de las rutinas. Estimaci&oacute;n y asignaci&oacute;n de tiempos. Biorritmos personales<br />\r\n- Regla de los 90 minutos. Leyes de Acosta</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>LA PLANIFICACI&Oacute;N</strong><br />\r\n- El prop&oacute;sito de la planificaci&oacute;n. Herramientas de gesti&oacute;n<br />\r\n- Planificando en la agenda. Control de la planificaci&oacute;n. La planificaci&oacute;n mensual</span></p>\r\n'),
(54, 9324, 2024, '<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><strong>Professional Introductions and Company Information</strong></span></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Introducing yourself and your role in the company</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Talking about departments, roles, and responsibilities</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Describing your company&rsquo;s activities, products, or services</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><strong>Daily Work Routines and Internal Communication</strong></span></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Describing typical work tasks and schedules</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Talking about meetings, tasks, and deadlines</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Giving and receiving simple instructions</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><strong>Business Phone Calls and Email Language (spoken focus)</strong></span></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Answering and making simple phone calls</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Taking and leaving messages</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Using polite and professional expressions</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><strong>Meetings, Appointments, and Travel Planning</strong></span></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Scheduling and rescheduling appointments</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Confirming meetings and logistics</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Talking about business trips and travel plans</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><strong>Customer Service and Handling Basic Requests</strong></span></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Greeting clients or visitors</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Offering assistance and responding to requests</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:10px\">Dealing with simple complaints</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm\">&nbsp;</p>\r\n'),
(55, 3725, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>Unidad 1: Introducci&oacute;n</strong><br />\r\n- Breve introducci&oacute;n al impacto de ChatGPT en la productividad y optimizaci&oacute;n de tareas.<br />\r\n- Din&aacute;mica inicial:<br />\r\n&nbsp;&nbsp; &nbsp;- Presentaci&oacute;n de los participantes.<br />\r\n&nbsp;&nbsp; &nbsp;- Intercambio de experiencias previas con ChatGPT.<br />\r\n<strong>Unidad 2: Contexto y Metodolog&iacute;a</strong><br />\r\n- C&oacute;mo funcionan la Inteligencia Artificial y el Machine Learning: Explicaci&oacute;n b&aacute;sica sobre los principios de estas tecnolog&iacute;as y su relaci&oacute;n con ChatGPT.<br />\r\n- C&oacute;mo funciona ChatGPT:<br />\r\n&nbsp;&nbsp; &nbsp;- Mecanismos de generaci&oacute;n de respuestas. Limitaciones y capacidades.<br />\r\n- Cu&aacute;ndo usar ChatGPT: Identificaci&oacute;n de tareas y procesos donde puede aportar mayor valor.<br />\r\n<strong>Unidad 3: Interactuar con ChatGPT</strong><br />\r\n- La primera conversaci&oacute;n: C&oacute;mo presentarte y establecer un contexto claro con ChatGPT.<br />\r\n- Tareas clave: Identificaci&oacute;n de &aacute;reas donde ChatGPT puede apoyar, como:<br />\r\n&nbsp;&nbsp; &nbsp;- Respuestas automatizadas. Generaci&oacute;n de contenido.<br />\r\n&nbsp;&nbsp; &nbsp;- Resoluci&oacute;n de problemas simples.<br />\r\n- Generaci&oacute;n de prompts efectivos:<br />\r\n&nbsp;&nbsp; &nbsp;- T&eacute;cnicas para a&ntilde;adir contexto relevante.<br />\r\n&nbsp;&nbsp; &nbsp;- Dise&ntilde;ar la estructura de los prompts y definir los datos de salida deseados.<br />\r\n- Mejorar los prompts: M&eacute;todos para iterar y optimizar las interacciones con el modelo.<br />\r\n<strong>Unidad 4: Consejos Profesionales</strong><br />\r\n- La suscripci&oacute;n: Diferencias entre la versi&oacute;n gratuita y ChatGPT Plus, y c&oacute;mo elegir seg&uacute;n las necesidades del negocio.<br />\r\n- Filosof&iacute;a para trabajar con IA:<br />\r\n&nbsp;&nbsp; &nbsp;- Importancia del an&aacute;lisis cr&iacute;tico, la iteraci&oacute;n y la evaluaci&oacute;n constante.<br />\r\n&nbsp;&nbsp; &nbsp;- Integraci&oacute;n de ChatGPT en flujos de trabajo empresariales.<br />\r\n<strong>Unidad 5: Fundamentos de GPT y Tecnolog&iacute;a RAG</strong><br />\r\n- Qu&eacute; son los GPTs: Conceptos b&aacute;sicos sobre los modelos de lenguaje y sus aplicaciones.<br />\r\n- Explorando la Tecnolog&iacute;a RAG (Retrieval-Augmented Generation):<br />\r\n&nbsp;&nbsp; &nbsp;- Introducci&oacute;n a esta t&eacute;cnica y c&oacute;mo potencia la personalizaci&oacute;n de respuestas.<br />\r\n<strong>Unidad 6: Creaci&oacute;n y Personalizaci&oacute;n de Custom GPTs</strong><br />\r\n- Creando nuestro primer GPT personalizado:<br />\r\n&nbsp; &nbsp;- Introducci&oacute;n al proceso de configuraci&oacute;n de un GPT.<br />\r\n&nbsp; &nbsp;- A&ntilde;adir herramientas &uacute;tiles para tareas espec&iacute;ficas.<br />\r\n- Personalizaci&oacute;n avanzada:<br />\r\n&nbsp; &nbsp;- Incorporaci&oacute;n de informaci&oacute;n relevante para la empresa.<br />\r\n&nbsp; &nbsp;- Configuraci&oacute;n de acciones automatizadas.<br />\r\n<strong>Unidad 7: Publicaci&oacute;n y Uso de GPTs</strong><br />\r\n- Completar un flujo completo: Desde la personalizaci&oacute;n hasta la implementaci&oacute;n.<br />\r\n- Exploraci&oacute;n de la GPT Store: C&oacute;mo publicar, compartir y aprovechar herramientas personalizadas.</span></p>\r\n');
INSERT INTO `contenidos` (`idcontenido`, `N_Accion`, `Anno`, `Contenido`) VALUES
(56, 2425, 2025, '<ul>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:10px\">Diagn&oacute;stico de la situaci&oacute;n actual: espacio, carga de trabajo y organizaci&oacute;n.</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:10px\">Propuestas de mejora en distribuci&oacute;n del almac&eacute;n y tipos de estanter&iacute;as.</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:10px\">Clasificaci&oacute;n de productos y m&eacute;todos de almacenamiento: sistema ABC, fijo/aleatorio.</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:10px\">Flujo de mercanc&iacute;as y layout de las instalaciones.</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:10px\">Tecnolog&iacute;a aplicada a la gesti&oacute;n de almacenes: SGA, ERP, c&oacute;digos de barras, RFID, picking por voz/luz.</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:10px\">Nivel de servicio al cliente, canales de distribuci&oacute;n y estrategias log&iacute;sticas.</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:10px\">Sistema de rotaci&oacute;n de mercanc&iacute;as: FIFO, LIFO, trazabilidad y control de obsoletos.</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:10px\">Indicadores de rendimiento, control de inventario y objetivos log&iacute;sticos.</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:10px\">Metodolog&iacute;as de mejora continua: principios LEAN y resoluci&oacute;n de cuellos de botella.</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:10px\">Recomendaciones para la implantaci&oacute;n de un sistema SGA robusto.</span></p>\r\n	</li>\r\n</ul>\r\n'),
(57, 49, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:9px\">Coaching Empresarial. Beneficios para el &aacute;mbito empresarial<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Qu&eacute; es Coaching Empresarial.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Contexto de aplicaci&oacute;n.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Punto de partida.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">El l&iacute;der Coach. Pilares b&aacute;sicos<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Actitudes a fomentar: responsabilidad, conciencia y congruencia.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Creencias Limitantes vs creencias potenciadoras.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Elaborando mi Plan de Acci&oacute;n: redacci&oacute;n de objetivos SMART.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">Recursos a potenciar para lograr tus objetivos<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Comunicaci&oacute;n eficaz, desarrollo de la escucha activa.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Las preguntas poderosas.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Desarrollo de la empat&iacute;a.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Feedback, una herramienta clave en la comunicaci&oacute;n.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\">Gesti&oacute;n de equipos de alto rendimiento<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Liderazgo y tipos de liderazgos.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Caracter&iacute;sticas de un buen L&iacute;der.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Valores empresariales y cohesi&oacute;n de grupo.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; Acciones b&aacute;sicas: motivaci&oacute;n, participaci&oacute;n, implicaci&oacute;n y creatividad.</span></p>\r\n\r\n<p style=\"line-height:0.8\">&nbsp;</p>\r\n'),
(58, 50, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">GENERALIDADES DEL SISTEMA AN&Aacute;LISIS DE PELIGROS Y PUNTOS DE CONTROL CR&Iacute;TICO (APPCC)<br />\r\n&nbsp;&nbsp;&nbsp; - Introducci&oacute;n al sistema APPCC y glosario de t&eacute;rminos relacionados.<br />\r\n&nbsp;&nbsp; - Sistema tradicional de control de los alimentos.<br />\r\n&nbsp;&nbsp; - Conceptos de APPCC en la industria alimentaria.<br />\r\n&nbsp;&nbsp; - Objetivos del sistema de autocontrol.<br />\r\n&nbsp;&nbsp; - Caracter&iacute;sticas generales del sistema APPCC.<br />\r\n&nbsp;&nbsp; - Ventajas de la aplicaci&oacute;n del sistema APPCC.<br />\r\n&nbsp;&nbsp; - Problemas en la aplicaci&oacute;n del sistema APPCC.<br />\r\n&nbsp;&nbsp; - &Aacute;mbito de aplicaci&oacute;n y requisitos para la implantaci&oacute;n del sistema APPCC.<br />\r\n&nbsp;&nbsp; - Etapas y evoluci&oacute;n de la aplicaci&oacute;n del sistema APPCC.<br />\r\n&nbsp;&nbsp; - An&aacute;lisis de riesgos, identificaci&oacute;n y valoraci&oacute;n de los mismos. Acciones correctoras y/o preventivas.<br />\r\n&nbsp;&nbsp; - L&iacute;mites, seguimiento y vigilancia del sistema APPCC. Verificaci&oacute;n y validaci&oacute;n de registros y documentaci&oacute;n del sistema.<br />\r\n&nbsp;&nbsp; - Consideraciones previas a la implantaci&oacute;n del APPCC.<br />\r\n&nbsp;&nbsp; - Legislaci&oacute;n. Reglamento 852/2004, entre otros.<br />\r\n&nbsp;&nbsp; - Papel de la Administraci&oacute;n en los sistemas APPCC.<br />\r\n&nbsp;&nbsp; - APPCC y sistemas de Gesti&oacute;n de la Calidad.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">DIRECTRICES GENERALES DEL SISTEMA APPCC.<br />\r\n&nbsp;&nbsp; - Directrices del APPCC.<br />\r\n&nbsp;&nbsp; - Plan APPCC.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">APLICACI&Oacute;N DEL SISTEMA APPCC.<br />\r\n&nbsp;&nbsp; - El APPCC en las materias primas e ingredientes, productos en curso de fabricaci&oacute;n o productos terminados.<br />\r\n&nbsp;&nbsp; - El APPCC aplicado al proceso de producci&oacute;n.<br />\r\n&nbsp;&nbsp; - El APPCC en el personal.<br />\r\n&nbsp;&nbsp; - El APPCC en las instalaciones, locales y equipos.<br />\r\n&nbsp;&nbsp; - El APPCC en el transporte.<br />\r\n&nbsp;&nbsp; - El APPCC en el proceso de limpieza y desinfecci&oacute;n.<br />\r\n&nbsp;&nbsp; - El APPCC en la lucha contra insectos y roedores.<br />\r\n&nbsp;&nbsp; - El APPCC en el tratamiento de residuos y desperdicios y aguas residuales.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">M&Oacute;DULO ESPEC&Iacute;FICO SECTORIAL</span></p>\r\n'),
(59, 6024, 2024, '<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>1) Preparaci&oacute;n de la piel</strong></span></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:9px\">Limpieza y tonificaci&oacute;n r&aacute;pida.</span> <span style=\"font-size:9px\">Hidrataci&oacute;n seg&uacute;n tipo de piel</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:9px\">Aplicaci&oacute;n de prebase</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>2) Maquillaje base</strong></span></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:9px\">Elecci&oacute;n del tono y tipo de base (l&iacute;quida, compacta, BB cream)</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:9px\">Aplicaci&oacute;n de corrector.</span> <span style=\"font-size:9px\">Sellado con polvos transl&uacute;cidos</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>3) Maquillaje de ojos</strong></span></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:9px\">Correcci&oacute;n de cejas (peinado, definici&oacute;n suave)</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:9px\">Sombras neutras: tonos tierra, beige, rosados</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:9px\">T&eacute;cnicas de difuminado.</span> <span style=\"font-size:9px\">Deliniado suave</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:9px\">M&aacute;scara de pesta&ntilde;as</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>4) Rubor, contorno suave e iluminador</strong></span></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:9px\">Aplicaci&oacute;n sutil para realzar el rostro</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>5) Labios</strong></span></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:9px\">Elecci&oacute;n de tonos naturales: nude, rosados, melocot&oacute;n</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.5\"><span style=\"font-size:9px\">Aplicaci&oacute;n de perfilador (opcional) y labial o gloss</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(60, 26, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>INTRODUCCI&Oacute;N</strong><br />\r\n- Introducci&oacute;n<br />\r\n- Factura electr&oacute;nica y firma digital<br />\r\n- Obligaciones de las partes<br />\r\n- Anexo. Obtenci&oacute;n de certificados digitales FNMT<br />\r\n<strong>LEGISLACI&Oacute;N</strong><br />\r\n- Firma electr&oacute;nica. Ley 6/2020<br />\r\n- Impulso de la sociedad de la informaci&oacute;n<br />\r\n<strong>FACTURA ELECTR&Oacute;NICA Y FORMATO</strong><br />\r\n- Formato Facturae<br />\r\n- Datos administrativos<br />\r\n- Contenidos de la factura y l&iacute;neas de detalle<br />\r\n<strong>GESTI&Oacute;N B&Aacute;SICA DE LA FACTURACI&Oacute;N ELECTR&Oacute;NICA</strong><br />\r\n- Gesti&oacute;n b&aacute;sica de la facturaci&oacute;n electr&oacute;nica<br />\r\n- Gesti&oacute;n de emisores<br />\r\n- Gesti&oacute;n de receptores<br />\r\n- Conceptos de facturaci&oacute;n. Productos y servicios<br />\r\n- Configuraciones adicionales<br />\r\n- Borradores de facturas. Facturas proforma<br />\r\n- Emisi&oacute;n de facturas<br />\r\n- Env&iacute;o de facturas<br />\r\n- Rectificaci&oacute;n de facturas<br />\r\n- Recepci&oacute;n de facturas<br />\r\n- Visualizaci&oacute;n e impresi&oacute;n<br />\r\n- B&uacute;squeda<br />\r\n- Generaci&oacute;n de libros de IVA<br />\r\n- Exportaci&oacute;n e importaci&oacute;n de facturas<br />\r\n- Ficheros XML Facturae<br />\r\n<strong>HERRAMIENTAS AVANZADAS</strong><br />\r\n- PDF417<br />\r\n- Introducci&oacute;n<br />\r\n- Legislaci&oacute;n<br />\r\n- Factura electr&oacute;nica y formato Facturae<br />\r\n- Gesti&oacute;n b&aacute;sica de la facturaci&oacute;n electr&oacute;nica</span></p>\r\n'),
(61, 34, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>DEFINICI&Oacute;N Y OR&Iacute;GENES DE LA PNL</strong><br />\r\n- Definici&oacute;n. Or&iacute;genes. &iquest;Qu&eacute; puede conseguir con la PNL?<br />\r\n- PNL en el &aacute;mbito empresarial. Cr&iacute;ticas a la PNL.<br />\r\n<strong>MEJORA DE LAS HABILIDADES DE COMUNICACI&Oacute;N A TRAV&Eacute;S DE LA PNL</strong><br />\r\n- &iquest;Qu&eacute; hay dentro del cerebro?.&iquest;C&oacute;mo construye cada uno su realidad?<br />\r\n- El metamodelo del lenguaje.<br />\r\n- Sistemas de representaci&oacute;n sensorial y exploraci&oacute;n de las submodalidades.<br />\r\n- Calibrar: c&oacute;mo detectar la informaci&oacute;n disponible en las interacciones.<br />\r\n- Ponerse en el lugar del otro: diferentes posiciones de percepci&oacute;n.<br />\r\n- Gesti&oacute;n del fracaso.<br />\r\n- Recuerdos, creencias y valores.<br />\r\n- Generar cambios.<br />\r\n<strong>EL TRABAJO EN EQUIPO</strong><br />\r\n- &iquest;Qu&eacute; es un equipo?<br />\r\n- Los roles integrantes de un equipo.<br />\r\n- Los objetivos.<br />\r\n- Causas por las que suelen fallar los equipos.<br />\r\n- Establecer relaciones saludables.<br />\r\n<strong>HACIA UN LIDERAZGO-SEGUIMIENTO EFECTIVO</strong><br />\r\n- Sincronizar y liderar.<br />\r\n- La motivaci&oacute;n.<br />\r\n- El cambio de paradigma y la creatividad como factores de mejora de la efectividad en el trabajo.<br />\r\n- La correcta comunicaci&oacute;n entre el jefe del equipo y sus colaboradores.<br />\r\n<strong>PNL EN LAS T&Eacute;CNICAS DE VENTAS</strong><br />\r\n- La PNL como herramienta de negociaci&oacute;n.<br />\r\n- La PNL en el marketing.</span></p>\r\n'),
(62, 33, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>INTRODUCCI&Oacute;N A LA MOTIVACI&Oacute;N</strong><br />\r\n- &iquest;Qu&eacute; es la motivaci&oacute;n?<br />\r\n- Motivaci&oacute;n y voluntad.<br />\r\n- Motivaci&oacute;n y emoci&oacute;n.<br />\r\n- C&oacute;mo y para qu&eacute; motivarse.<br />\r\n- Proceso motivacional.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>ENFOQUES DE LA MOTIVACI&Oacute;N</strong><br />\r\n- Motivaci&oacute;n por necesidades. Pir&aacute;mide de Maslow.<br />\r\n- Teor&iacute;a de Alderfer ERC.<br />\r\n- Teor&iacute;a de McClelland.<br />\r\n- Fijaci&oacute;n de Metas. Edwin Locke.<br />\r\n- Enfoque Social. Bandura.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>TIPOS DE MOTIVACI&Oacute;N</strong><br />\r\n- &iquest;Qu&eacute; es lo que nos motiva?<br />\r\n- Motivaci&oacute;n laboral.<br />\r\n- Motivaci&oacute;n personal. Automotivaci&oacute;n.</span></p>\r\n'),
(63, 37, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>INTRODUCCI&Oacute;N A LA REVISI&Oacute;N DE LA NORMA ISO 9001</strong><br />\r\n- Certificando la calidad: Norma ISO 9001.<br />\r\n- Origen y evoluci&oacute;n de la Norma ISO 9001.<br />\r\n- Proceso de transici&oacute;n.<br />\r\n- Anexo, S.L.<br />\r\n- Enfoque a procesos y pensamiento basado en riesgos.<br />\r\n- Cambios clave en ISO 9001:2015.<br />\r\n- T&eacute;rminos y definiciones.<br />\r\n- Justificaci&oacute;n del cambio.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>AN&Aacute;LISIS DE LA NORMA ISO 9001</strong><br />\r\n- Estructura de la Norma ISO 9001:2015.<br />\r\n- Objeto y Campo de aplicaci&oacute;n.<br />\r\n- Referencias Normativas.<br />\r\n- T&eacute;rminos y Definiciones.<br />\r\n- Contexto de la organizaci&oacute;n.<br />\r\n- Liderazgo.<br />\r\n- Planificaci&oacute;n.<br />\r\n- Apoyo.<br />\r\n- Operaci&oacute;n.<br />\r\n- Evaluaci&oacute;n del desempe&ntilde;o.<br />\r\n- Mejora.<br />\r\n- Transici&oacute;n de la norma ISO 9001: an&aacute;lisis de correlaciones.</span></p>\r\n'),
(64, 56, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">INTRODUCCI&Oacute;N A LOS PRIMEROS AUXILIOS<br />\r\n&nbsp;&nbsp; - Concepto de primeros auxilios. Limitaciones.<br />\r\n&nbsp;&nbsp; - &iquest;Qu&eacute; hacer ante una situaci&oacute;n de urgencia? El botiqu&iacute;n de primeros auxilios.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EL SISTEMA INTEGRAL DE EMERGENCIAS<br />\r\n&nbsp;&nbsp; - Conceptos. Caracter&iacute;sticas y estructura de un sistema integral de urgencias y emergencias (SIE). La cadena asistencial.<br />\r\n&nbsp;&nbsp; - Centro coordinador de urgencias y emergencias (CCUE).<br />\r\n&nbsp;&nbsp; - Actuaci&oacute;n prehospitalaria al paciente en situaci&oacute;n de emergencia.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PRIMEROS AUXILIOS EN SITUACIONES B&Aacute;SICAS<br />\r\n&nbsp;&nbsp; - Quemaduras. Otras quemaduras.<br />\r\n&nbsp;&nbsp; - Hemorragias. Heridas.<br />\r\n&nbsp;&nbsp; - Lesiones m&uacute;sculo-esquel&eacute;ticas.<br />\r\n&nbsp;&nbsp; - Cuerpos extra&ntilde;os.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">SITUACIONES GRAVES QUE PODEMOS ENCONTRARNOS<br />\r\n&nbsp;&nbsp; - Fracturas especiales. Intoxicaciones.<br />\r\n&nbsp;&nbsp; - Lesiones por calor. Shock.<br />\r\n&nbsp;&nbsp; - Problemas del sistema nervioso.<br />\r\n&nbsp;&nbsp; - Problemas del sistema respiratorio.<br />\r\n&nbsp;&nbsp; - Problemas cardiacos.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">RECOMENDACIONES EN REANIMACI&Oacute;N CARDIOPULMONAR B&Aacute;SICA<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n. An&aacute;lisis de la situaci&oacute;n.<br />\r\n&nbsp;&nbsp; - Planes de actuaci&oacute;n en RCP b&aacute;sica.<br />\r\n&nbsp;&nbsp; - T&eacute;cnicas de RPC b&aacute;sica.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ACTUACI&Oacute;N EN ACCIDENTES DE TR&Aacute;FICO<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n.<br />\r\n&nbsp;&nbsp; - Proteger.<br />\r\n&nbsp;&nbsp; - Avisar.<br />\r\n&nbsp;&nbsp; - Socorrer.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">USO DEL DESFIBRILADOR (DESA)</span></p>\r\n'),
(65, 55, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ESCENARIO ACTUAL Y CONCEPTOS B&Aacute;SICOS DE SEGURIDAD Y SALUD LABORAL. ORGANIZACI&Oacute;N PREVENTIVA Y REPRESENTACI&Oacute;N Y PARTICIPACI&Oacute;N DE LOS TRABAJADORES<br />\r\n&nbsp;&nbsp; - Escenario actual<br />\r\n&nbsp;&nbsp; - Coste de los accidentes laborales<br />\r\n&nbsp;&nbsp; - Conceptos b&aacute;sicos en materia de prevenci&oacute;n<br />\r\n&nbsp;&nbsp; - Seguridad y salud laboral<br />\r\n&nbsp;&nbsp; - &Oacute;rganos de representaci&oacute;n y participaci&oacute;n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Delegados de Prevenci&oacute;n. Comit&eacute; de Seguridad y Salud<br />\r\n&nbsp;&nbsp; - Opciones para la gesti&oacute;n de la prevenci&oacute;n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Autogesti&oacute;n de la prevenci&oacute;n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Servicio de prevenci&oacute;n ajeno<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Servicio de prevenci&oacute;n propio</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EL PLAN DE PREVENCI&Oacute;N DE RIESGOS LABORALES. ORGANIZACI&Oacute;N DEL TRABAJO PREVENTIVO<br />\r\n&nbsp;&nbsp; - Metodolog&iacute;a<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Evaluaci&oacute;n de riesgos. Planificaci&oacute;n de la prevenci&oacute;n. El plan de prevenci&oacute;n<br />\r\n&nbsp;&nbsp; - La investigaci&oacute;n de accidentes<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Metodolog&iacute;a. El &aacute;rbol de causas. T&eacute;cnicas estad&iacute;sticas</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MARCO NORMATIVO. DERECHOS Y OBLIGACIONES. VIGILANCIA DE LA SALUD. LA INSPECCI&Oacute;N DE TRABAJO. ORGANISMOS P&Uacute;BLICOS<br />\r\n&nbsp;&nbsp; - Marco normativo<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Ley 31/1995, de 8 de noviembre, de Prevenci&oacute;n de Riesgos Laborales<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Real Decreto 39/1997, de 17 de enero, por el que se aprueba el Reglamento de los Servicios de Prevenci&oacute;n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Real Decreto 485/1997, de 14 de abril, sobre disposiciones m&iacute;nimas en materia de se&ntilde;alizaci&oacute;n de seguridad y salud en el trabajo<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Real Decreto 486/1997, de 14 de abril, por el que se establecen las disposiciones m&iacute;nimas de seguridad y salud en los lugares de trabajo<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Otras normas<br />\r\n&nbsp;&nbsp; - Derechos, obligaciones y responsabilidades<br />\r\n&nbsp;&nbsp; - Vigilancia de la salud<br />\r\n&nbsp;&nbsp; - La Inspecci&oacute;n de Trabajo y Seguridad Social (ITSS)<br />\r\n&nbsp;&nbsp; - Organismos p&uacute;blicos relacionados con la prevenci&oacute;n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Organismos nacionales. Organismos internacionales</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(66, 51, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:10px\">CALIDAD ALIMENTARIA<br />\r\n- Definici&oacute;n de alimentos. Clasificaci&oacute;n de los alimentos<br />\r\n- Criterios de calidad de los alimentos</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">ALTERACIONES DE LOS ALIMENTOS<br />\r\n- Deterioro de los alimentos de origen animal y de origen vegetal</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">MANIPULACI&Oacute;N HIGI&Eacute;NICA DE LOS ALIMENTOS<br />\r\n- Cadena alimentaria: origen, transformaci&oacute;n, tratamientos y trazabilidad de los alimentos<br />\r\n- El papel del manipulador de alimentos<br />\r\n- Manipulaci&oacute;n de los alimentos espec&iacute;ficos del curso</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">LOCALES E INSTALACIONES<br />\r\n- Distribuci&oacute;n de las instalaciones, iluminaci&oacute;n, ventilaci&oacute;n<br />\r\n- Maquinaria, herramientas y utillaje, limpieza y desinfecci&oacute;n<br />\r\n- Eliminaci&oacute;n de basuras y residuos</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">HIGIENE PERSONAL: ASEO, H&Aacute;BITOS HIGI&Eacute;NICOS, ESTADO DE SALUD Y PREVENCI&Oacute;N DE ENFERMEDADES TRANSMISIBLES<br />\r\n- Aseo y h&aacute;bitos higi&eacute;nicos<br />\r\n- Estado de salud y prevenci&oacute;n de enfermedades transmisibles</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">INFORMACI&Oacute;N DE PRODUCTOS ALIMENTICIOS: IDENTIFICACI&Oacute;N, ETIQUETADO, CADUCIDAD, COMPOSICI&Oacute;N<br />\r\n- Etiquetado: Identificaci&oacute;n y composici&oacute;n<br />\r\n- Caducidad</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">HIGIENE ALIMENTARIA: MICROORGANISMOS EN LOS ALIMENTOS, CONTAMINACIONES, INFECCIONES E INTOXICACIONES ALIMENTARIAS</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">CONSERVACI&Oacute;N DE LOS ALIMENTOS</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">CARACTER&Iacute;STICAS ESPEC&Iacute;FICAS DE LOS ALIMENTOS Y PRODUCTOS ALIMENTICIOS</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">PLAN DE AN&Aacute;LISIS DE PELIGROS Y PUNTOS DE CONTROL CR&Iacute;TICOS<br />\r\n- Diagrama de flujo sector peque&ntilde;o comercio y ultramarinos</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">GU&Iacute;A DE PR&Aacute;CTICAS CORRECTAS DE HIGIENE<br />\r\n- Programa de prerrequisitos<br />\r\n- Control de procesos<br />\r\n- Revisiones de autocontrol peri&oacute;dicas</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">LEGISLACI&Oacute;N APLICABLE AL MANIPULADOR DE ALIMENTOS</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(67, 54, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MOTORES T&Eacute;RMICOS<br />\r\n&nbsp;&nbsp; - Termodin&aacute;mica: ciclos te&oacute;ricos y reales. Motores de dos, cuatro tiempos Otto y rotativos<br />\r\n&nbsp;&nbsp; - Motores de ciclo diesel, tipos principales, diferencias con los de ciclo Otto<br />\r\n&nbsp;&nbsp; - Rendimiento t&eacute;rmico y consumo de combustible<br />\r\n&nbsp;&nbsp; - Curvas caracter&iacute;sticas de los motores. Aplicaciones pr&aacute;cticas</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MOTORES POLICIL&Iacute;NDRICOS<br />\r\n&nbsp;&nbsp; - Colocaci&oacute;n del motor y disposici&oacute;n de los cilindros<br />\r\n&nbsp;&nbsp; - La c&aacute;mara de compresi&oacute;n, tipos de c&aacute;maras e influencia de la misma<br />\r\n&nbsp;&nbsp; - Numeraci&oacute;n de los cilindros y orden de encendido. Normas UNE 10052-72 y DIN 7302-1<br />\r\n&nbsp;&nbsp; - Motores de ciclo otto y motores diesel, diferencias constructivas. Aplicaciones pr&aacute;cticas</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ELEMENTOS DE LOS MOTORES ALTERNATIVOS, EL BLOQUE DE CILINDROS<br />\r\n&nbsp;&nbsp; - Funciones y solicitaci&oacute;n de los elementos del motor, esfuerzos mec&aacute;nicos, rozamientos, disipaci&oacute;n del calor y materiales<br />\r\n&nbsp;&nbsp; - Pistones, formas constructivas, constituci&oacute;n y refuerzos<br />\r\n&nbsp;&nbsp; - Biela, constituci&oacute;n, verificaci&oacute;n y tipos<br />\r\n&nbsp;&nbsp; - El cig&uuml;e&ntilde;al, constituci&oacute;n, equilibrado est&aacute;tico y din&aacute;mico, cojinetes del cig&uuml;e&ntilde;al, volante motor y amortiguador de oscilaciones<br />\r\n&nbsp;&nbsp; - Aver&iacute;as y comprobaciones en elementos m&oacute;viles<br />\r\n&nbsp;&nbsp; - Aplicaciones pr&aacute;cticas</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ELEMENTOS DE LOS MOTORES ALTERNATIVOS, LA CULATA Y LA DISTRIBUCI&Oacute;N<br />\r\n&nbsp;&nbsp; - Culata del motor, c&aacute;mara de compresi&oacute;n, tipos de c&aacute;maras y prec&aacute;maras. La junta de culata, tipos y c&aacute;lculo de la junta en los motores di&eacute;sel<br />\r\n&nbsp;&nbsp; - Distribuci&oacute;n del motor, tipos y constituci&oacute;n. Elementos de arrastre de la distribuci&oacute;n<br />\r\n&nbsp;&nbsp; - V&aacute;lvulas y asientos, taqu&eacute;s y &aacute;rboles de levas, reglajes<br />\r\n&nbsp;&nbsp; - Taqu&eacute;s hidr&aacute;ulicos &nbsp;<br />\r\n&nbsp;&nbsp; - Diagramas de trabajo y de mando de la distribuci&oacute;n<br />\r\n&nbsp;&nbsp; - Distribuci&oacute;n variable. Reglajes y marcas. Puesta a punto. El c&aacute;rter</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MANTENIMIENTO PERI&Oacute;DICO Y DIAGN&Oacute;STICO DE AVER&Iacute;AS<br />\r\n&nbsp;&nbsp; - Tablas de mantenimiento peri&oacute;dico de motores<br />\r\n&nbsp;&nbsp; - T&eacute;cnicas de diagnosis de aver&iacute;as en elementos mec&aacute;nicos<br />\r\n&nbsp;&nbsp; - Manuales de taller y reparaciones desarrollados por fabricantes<br />\r\n&nbsp;&nbsp; - Aplicaciones pr&aacute;cticas</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(68, 8425, 2025, '<p style=\"line-height:1.0\"><span style=\"font-size:12px\"><strong>Maderoterapia corporal.</strong><br />\r\n- T&eacute;cnicas b&aacute;sicas (rodillo de bolas, estriado, etc..)<br />\r\n- Maderoterapia anticelul&iacute;tica.<br />\r\n- Maderoterapia facial.<br />\r\n- T&eacute;cnicas b&aacute;sicas (rodillo liso, estriado, de cubos, etc..)<br />\r\n- Protocolos y movimientos de maderas.</span><br />\r\n&nbsp;</p>\r\n'),
