ht:0.8\"><span style=\"font-size:9px\"><span style=\"color:black\">Reglas de mantenimiento</span></span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><span style=\"color:black\">2.2 C&oacute;digo de seguridad para su utilizaci&oacute;n y mantenimiento</span></span></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><span style=\"color:black\">Reglas generales de utilizaci&oacute;n</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><span style=\"color:black\">Reglas para el conductor</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><span style=\"color:black\">Consignas de entretenimiento</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><span style=\"color:black\">Primeros auxilios</span></span></p>\r\n	</li>\r\n</ul>\r\n'),
(73, 6125, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><strong>Unidad 1: Introducci&oacute;n</strong><br />\r\n- Breve introducci&oacute;n al impacto de ChatGPT en la productividad y optimizaci&oacute;n de tareas.<br />\r\n- Din&aacute;mica inicial:<br />\r\n&nbsp;&nbsp; &nbsp;- Presentaci&oacute;n de los participantes.<br />\r\n&nbsp;&nbsp; &nbsp;- Intercambio de experiencias previas con ChatGPT.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><br />\r\n<span style=\"font-size:10px\"><strong>Unidad 2: Contexto y Metodolog&iacute;a</strong><br />\r\n- C&oacute;mo funcionan la Inteligencia Artificial y el Machine Learning: Explicaci&oacute;n b&aacute;sica sobre los principios de estas tecnolog&iacute;as y su relaci&oacute;n con ChatGPT.<br />\r\n- C&oacute;mo funciona ChatGPT:<br />\r\n&nbsp;&nbsp; &nbsp;- Mecanismos de generaci&oacute;n de respuestas.<br />\r\n&nbsp;&nbsp; &nbsp;- Limitaciones y capacidades.<br />\r\n- Cu&aacute;ndo usar ChatGPT: Identificaci&oacute;n de tareas y procesos donde puede aportar mayor valor.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><br />\r\n<span style=\"font-size:10px\"><strong>Unidad 3: Interactuar con ChatGPT</strong><br />\r\n- La primera conversaci&oacute;n: C&oacute;mo presentarte y establecer un contexto claro con ChatGPT.<br />\r\n- Tareas clave: Identificaci&oacute;n de &aacute;reas donde ChatGPT puede apoyar, como:<br />\r\n&nbsp;&nbsp; &nbsp;- Respuestas automatizadas.<br />\r\n&nbsp;&nbsp; &nbsp;- Generaci&oacute;n de contenido.<br />\r\n&nbsp;&nbsp; &nbsp;- Resoluci&oacute;n de problemas simples.<br />\r\n- Generaci&oacute;n de prompts efectivos:<br />\r\n&nbsp;&nbsp; &nbsp;- T&eacute;cnicas para a&ntilde;adir contexto relevante.<br />\r\n&nbsp;&nbsp; &nbsp;- Dise&ntilde;ar la estructura de los prompts y definir los datos de salida deseados.<br />\r\n- Mejorar los prompts: M&eacute;todos para iterar y optimizar las interacciones con el modelo.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><br />\r\n<span style=\"font-size:10px\"><strong>Unidad 4: Consejos Profesionales</strong><br />\r\n- La suscripci&oacute;n: Diferencias entre la versi&oacute;n gratuita y ChatGPT Plus, y c&oacute;mo elegir seg&uacute;n las necesidades del negocio.<br />\r\n- Filosof&iacute;a para trabajar con IA:<br />\r\n&nbsp;&nbsp; &nbsp;- Importancia del an&aacute;lisis cr&iacute;tico, la iteraci&oacute;n y la evaluaci&oacute;n constante.<br />\r\n&nbsp;&nbsp; &nbsp;- Integraci&oacute;n de ChatGPT en flujos de trabajo empresariales.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><br />\r\n<span style=\"font-size:10px\"><strong>Unidad 5: Fundamentos de GPT y Tecnolog&iacute;a RAG</strong><br />\r\n- Qu&eacute; son los GPTs: Conceptos b&aacute;sicos sobre los modelos de lenguaje y sus aplicaciones.<br />\r\n- Explorando la Tecnolog&iacute;a RAG (Retrieval-Augmented Generation):<br />\r\n&nbsp;&nbsp; &nbsp;- Introducci&oacute;n a esta t&eacute;cnica y c&oacute;mo potencia la personalizaci&oacute;n de respuestas.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><br />\r\n<span style=\"font-size:10px\"><strong>Unidad 6: Creaci&oacute;n y Personalizaci&oacute;n de Custom GPTs</strong><br />\r\n- Creando nuestro primer GPT personalizado:<br />\r\n&nbsp; &nbsp;- Introducci&oacute;n al proceso de configuraci&oacute;n de un GPT.&nbsp;A&ntilde;adir herramientas &uacute;tiles para tareas espec&iacute;ficas.<br />\r\n- Personalizaci&oacute;n avanzada:<br />\r\n&nbsp; &nbsp;- Incorporaci&oacute;n de informaci&oacute;n relevante para la empresa.&nbsp;Configuraci&oacute;n de acciones automatizadas.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><br />\r\n<span style=\"font-size:10px\"><strong>Unidad 7: Publicaci&oacute;n y Uso de GPTs</strong><br />\r\n- Completar un flujo completo: Desde la personalizaci&oacute;n hasta la implementaci&oacute;n.<br />\r\n- Exploraci&oacute;n de la GPT Store: C&oacute;mo publicar, compartir y aprovechar herramientas personalizadas.</span></p>\r\n'),
(74, 59, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LEGISLACI&Oacute;N B&Aacute;SICA DE APLICACI&Oacute;N EN LA RELACI&Oacute;N LABORAL<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n.<br />\r\n&nbsp;&nbsp; - El derecho laboral y sus fuentes.<br />\r\n&nbsp;&nbsp; - La Constituci&oacute;n espa&ntilde;ola.<br />\r\n&nbsp;&nbsp; - El Estatuto de los Trabajadores.<br />\r\n&nbsp;&nbsp; - Ley Org&aacute;nica de Libertad Sindical.<br />\r\n&nbsp;&nbsp; - Ley General de la Seguridad Social.<br />\r\n&nbsp;&nbsp; - Inscripci&oacute;n de las empresas en la seguridad.<br />\r\n&nbsp;&nbsp; - Ley de Prevenci&oacute;n de Riesgos Laborales.<br />\r\n&nbsp;&nbsp; - La negociaci&oacute;n colectiva.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CONTRATACI&Oacute;N DE RECURSOS HUMANOS<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n.<br />\r\n&nbsp;&nbsp; - Organismos y &oacute;rganos que intervienen en relaci&oacute;n con el contrato de trabajo.<br />\r\n&nbsp;&nbsp; - El contrato de trabajo.<br />\r\n&nbsp;&nbsp; - Obligaciones con la Seguridad Social derivadas del contrato de trabajo.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MODIFICACI&Oacute;N, SUSPENSI&Oacute;N Y EXTINCI&Oacute;N DE LAS CONDICIONES DE TRABAJO<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n.<br />\r\n&nbsp;&nbsp; - Modificaci&oacute;n de las condiciones de trabajo.<br />\r\n&nbsp;&nbsp; - Suspensi&oacute;n del contrato de trabajo.<br />\r\n&nbsp;&nbsp; - Extinci&oacute;n del contrato de trabajo.<br />\r\n&nbsp;&nbsp; - Indemnizaciones en funci&oacute;n del tipo de extinci&oacute;n del contrato practicado.<br />\r\n&nbsp;&nbsp; - Actuaciones ante la jurisdicci&oacute;n social en los distintos supuestos de sanci&oacute;n, modificaci&oacute;n y extinci&oacute;n del contrato.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MANTENIMIENTO, CONTROL Y ACTUALIZACI&Oacute;N DEL FICHERO DE PERSONAL<br />\r\n&nbsp;