(75, 61, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">INTRODUCCI&Oacute;N A LA COMUNICACI&Oacute;N DIGITAL<br />\r\n&nbsp;&nbsp; - &iquest;Qu&eacute; es la comunicaci&oacute;n digital?<br />\r\n&nbsp;&nbsp; - &iquest;El cambio de la comunicaci&oacute;n?<br />\r\n&nbsp;&nbsp; - Beneficios<br />\r\n&nbsp;&nbsp; - Repercusi&oacute;n del uso de las redes sociales<br />\r\n&nbsp;&nbsp; - Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ENTORNOS DE COMUNICACI&Oacute;N DIGITAL<br />\r\n&nbsp;&nbsp; - El blog<br />\r\n&nbsp;&nbsp; - Redes sociales<br />\r\n&nbsp;&nbsp; - YouTube<br />\r\n&nbsp;&nbsp; - Desarrollo del aprendizaje y competencias<br />\r\n&nbsp;&nbsp; - Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">TRABAJO COLABORATIVO EN RED<br />\r\n&nbsp;&nbsp; - Herramientas<br />\r\n&nbsp;&nbsp; - Demandas actuales<br />\r\n&nbsp;&nbsp; - Nuevas formas de trabajo<br />\r\n&nbsp;&nbsp; - Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PREVENCI&Oacute;N DE UN MAL USO DE LAS REDES SOCIALES<br />\r\n&nbsp;&nbsp; - Riesgos de las redes sociales<br />\r\n&nbsp;&nbsp; - Seguridad y buenas pr&aacute;cticas<br />\r\n&nbsp;&nbsp; - Plagio<br />\r\n&nbsp;&nbsp; - Resumen</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(76, 60, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">INTRODUCCI&Oacute;N A LA DESCONEXI&Oacute;N DIGITAL<br />\r\n&nbsp;&nbsp; - El estr&eacute;s: la otra pandemia del siglo XXI<br />\r\n&nbsp;&nbsp; - El impacto de las tecnolog&iacute;as en el &aacute;mbito empresarial<br />\r\n&nbsp;&nbsp; - S&iacute;ndrome de burnout: tipos y diagn&oacute;stico<br />\r\n&nbsp;<br />\r\nDESCONEXI&Oacute;N DIGITAL EN EL TRABAJO<br />\r\n&nbsp;&nbsp; - Desconexi&oacute;n digital. El Derecho digital del trabajador en la LOPDGDD<br />\r\n&nbsp;&nbsp; - Adicci&oacute;n a la conexi&oacute;n: &iquest;C&oacute;mo superarla con tecnolog&iacute;a?<br />\r\n&nbsp;&nbsp; - Volver a lo b&aacute;sico: el gran ant&iacute;doto</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">&iquest;PORQU&Eacute; UNA POL&Iacute;TICA DE DESCONEXI&Oacute;N DIGITAL?<br />\r\n&nbsp;&nbsp; - Riesgos y desaf&iacute;os relacionados con el uso de las herramientas digitales.<br />\r\n&nbsp;&nbsp; - Objetivos de la desconexi&oacute;n digital.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ENTORNO NORMATIVO Y ASPECTOS CLAVE<br />\r\n&nbsp;&nbsp; - La Ley Org&aacute;nica de Protecci&oacute;n de Datos Personales y garant&iacute;a de los derechos digitales (LOPDGDD)<br />\r\n&nbsp;&nbsp; - Texto Refundido de la Ley del Estatuto de los Trabajadores<br />\r\n&nbsp;&nbsp; - Real Decreto Ley 28/2020, de 22 de septiembre de trabajo a distancia<br />\r\n&nbsp;&nbsp; - Ley 10/2021, de 9 de julio, de trabajo a distancia<br />\r\n&nbsp;&nbsp; - Enfoque preventivo del derecho a la desconexi&oacute;n digital (arts.14-16 LPRL y 36,5ET)<br />\r\n&nbsp;&nbsp; - Incumplimientos y sanciones.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ELABORACI&Oacute;N DE UNA POL&Iacute;TICA DE DESCONEXI&Oacute;N DIGITAL<br />\r\n&nbsp;&nbsp; - &iquest;Qu&eacute; debemos tener en cuenta en una Pol&iacute;tica de Desconexi&oacute;n Digital?<br />\r\n&nbsp;&nbsp; - Teletrabajo y desconexi&oacute;n digital.<br />\r\n&nbsp;&nbsp; - Modalidades de trabajo y desconexi&oacute;n digital: BYOD, trabajo flexible&hellip;&hellip;&hellip;<br />\r\n&nbsp;&nbsp; - Ejemplos de pol&iacute;ticas de desconexi&oacute;n digital</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(77, 58, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PREVENCI&Oacute;N DE RIESGOS LABORALES: PRINCIPIOS B&Aacute;SICOS Y CONCEPTOS GENERALES<br />\r\n&nbsp;&nbsp; - Conceptos b&aacute;sicos. Derechos y deberes<br />\r\n&nbsp;&nbsp; - Riesgos generales en la prevenci&oacute;n. Medidas de prevenci&oacute;n en la prevenci&oacute;n<br />\r\n&nbsp;&nbsp; - Protecci&oacute;n colectiva. Protecci&oacute;n individual. Se&ntilde;alizaci&oacute;n<br />\r\n&nbsp;&nbsp; - Interferencias entre actividades. Seguridad vial<br />\r\n&nbsp;&nbsp; - Medidas de emergencia y evacuaci&oacute;n. Primeros auxilios</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PREVENCI&Oacute;N DE RIESGOS LABORALES: APARATOS ELEVADORES<br />\r\n&nbsp;&nbsp; - Carga: definici&oacute;n, caracter&iacute;sticas, almacenamiento y equipos de manipulaci&oacute;n<br />\r\n&nbsp;&nbsp; - Eslingado. Concepto, caracter&iacute;sticas y buenas pr&aacute;cticas<br />\r\n&nbsp;&nbsp; - Equipos de trabajo. Normativa y descripci&oacute;n. Gr&uacute;as. Tipos, riesgos y medidas preventivas<br />\r\n&nbsp;&nbsp; - Mantenimiento de equipos de trabajo</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CAMI&Oacute;N GR&Uacute;A<br />\r\n&nbsp;&nbsp; - Definici&oacute;n y caracter&iacute;sticas. Accesorios y componentes de seguridad. Riesgos asociados<br />\r\n&nbsp;&nbsp; - Medidas de seguridad y buenas pr&aacute;cticas. Equipos de protecci&oacute;n individual<br />\r\n&nbsp;&nbsp; - Mantenimiento y documentaci&oacute;n. Se&ntilde;alizaci&oacute;n</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PUENTE GR&Uacute;A<br />\r\n&nbsp;&nbsp; - Definici&oacute;n y caracter&iacute;sticas. Componentes del puente gr&uacute;a. Tipos de puente gr&uacute;a<br />\r\n&nbsp;&nbsp; - Accesorios y componentes de seguridad. Riesgos asociados. Medidas de seguridad<br />\r\n&nbsp;&nbsp; - Requisitos del operador. Operaciones y manejo. Protecci&oacute;n colectiva e individual. Mantenimiento. Se&ntilde;alizaci&oacute;n</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">OPERACIONES SEGURAS EN EL USO DE POLIPASTOS</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(78, 63, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ESTRUCTURA, MANEJO E INSTALACI&Oacute;N DE LOS AUT&Oacute;MATAS PROGRAMABLES<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n.<br />\r\n&nbsp;&nbsp; - Arquitectura interna de un aut&oacute;mata.<br />\r\n&nbsp;&nbsp; - Ciclo de funcionamiento de un aut&oacute;mata y control en tiempo real.<br />\r\n&nbsp;&nbsp; - Instalaci&oacute;n y mantenimiento de aut&oacute;matas programables.<br />\r\n&nbsp;&nbsp; - Resumen.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LENGUAJES Y PROGRAMAS EN LOS AUT&Oacute;MATAS PROGRAMABLES<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n.<br />\r\n&nbsp;&nbsp; - Dise&ntilde;o de automatismos l&oacute;gicos.<br />\r\n&nbsp;&nbsp; - Programaci&oacute;n del aut&oacute;mata.<br />\r\n&nbsp;&nbsp; - Programaci&oacute;n de bloques funcionales.<br />\r\n&nbsp;&nbsp; - Estructuras de programaci&oacute;n.<br />\r\n&nbsp;&nbsp; - Programaci&oacute;n en TIA PORTAL.<br />\r\n&nbsp;&nbsp; - Resumen.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EJEMPLOS B&Aacute;SICOS DE PROGRAMACI&Oacute;N<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n.<br />\r\n&nbsp;&nbsp; - Identificaci&oacute;n de entradas y salidas.<br />\r\n&nbsp;&nbsp; - Programas con operaciones combinacionales.<br />\r\n&nbsp;&nbsp; - Programas con contadores.<br />\r\n&nbsp;&nbsp; - Programas con operadores de comparaci&oacute;n.<br />\r\n&nbsp;&nbsp; - Programas con operadores de memoria.<br />\r\n&nbsp;&nbsp; - Programas con temporizadores.<br />\r\n&nbsp;&nbsp; - Ejemplo: m&aacute;quina empaquetadora.<br />\r\n&nbsp;&nbsp; - Ejemplo: m&aacute;quina mezcladora.<br />\r\n&nbsp;&nbsp; - Resumen.</span></p>\r\n'),
(79, 36, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ANTECEDENTES HIST&Oacute;RICOS Y SOCIALES DE LA IGUALDAD<br />\r\n&nbsp;&nbsp; - Los movimientos reivindicativos.&nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n&nbsp;&nbsp; - La construcci&oacute;n social de la realidad.<br />\r\n&nbsp;&nbsp; - La figura del agente de igualdad de oportunidades.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">BASES LEGALES DE LA IGUALDAD<br />\r\n&nbsp;&nbsp; - La igualdad formal.<br />\r\n&nbsp;&nbsp; - La negociaci&oacute;n colectiva como herramienta para la igualdad.<br />\r\n&nbsp;&nbsp; - La Ley Org&aacute;nica 3/2007 o Ley de Igualdad.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ASPECTOS B&Aacute;SICOS SOBRE EL PLAN DE IGUALDAD<br />\r\n&nbsp;&nbsp;&nbsp; - Concepto y contenido de los planes.<br />\r\n&nbsp;&nbsp; - Metodolog&iacute;a para la elaboraci&oacute;n de un plan de igualdad.<br />\r\n&nbsp;&nbsp; - Consideraciones generales. Agentes implicados.<br />\r\n&nbsp;&nbsp; - Fases de elaboraci&oacute;n del plan.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">T&Eacute;CNICAS PARA LA DEFINICI&Oacute;N, PLANIFICACI&Oacute;N, DESARROLLO Y EVALUACI&Oacute;N DE PLANES Y MEDIDAS DE DESARROLLO EN IGUALDAD<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n a las t&eacute;cnicas de investigaci&oacute;n.<br />\r\n&nbsp;&nbsp; - T&eacute;cnicas de investigaci&oacute;n social.<br />\r\n&nbsp;&nbsp; - La investigaci&oacute;n-acci&oacute;n participativa.<br />\r\n&nbsp;&nbsp; - T&eacute;cnicas de gesti&oacute;n de planes para la igualdad.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n');
INSERT INTO `contenidos` (`idcontenido`, `N_Accion`, `Anno`, `Contenido`) VALUES
(80, 64, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CALIDAD ALIMENTARIA<br />\r\n&nbsp;&nbsp; - Definici&oacute;n de alimentos. - Clasificaci&oacute;n de los alimentos.&nbsp; Criterios de calidad de los alimentos</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ALTERACIONES DE LOS ALIMENTOS<br />\r\n&nbsp;&nbsp; - Deterioro de los alimentos de origen animal y de origen vegetal</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MANIPULACI&Oacute;N HIGI&Eacute;NICA DE LOS ALIMENTOS<br />\r\n&nbsp;&nbsp; - Cadena alimentaria: origen, transformaci&oacute;n, tratamientos y trazabilidad de los alimentos<br />\r\n&nbsp;&nbsp; - El papel del manipulador de alimentos. - Manipulaci&oacute;n de los alimentos espec&iacute;ficos del curso</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LOCALES E INSTALACIONES<br />\r\n&nbsp; - Distribuci&oacute;n de las instalaciones, iluminaci&oacute;n, ventilaci&oacute;n<br />\r\n&nbsp;&nbsp; - Maquinaria, herramientas y utillaje, limpieza y desinfecci&oacute;n. Eliminaci&oacute;n de basuras y residuos</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">HIGIENE PERSONAL: ASEO, H&Aacute;BITOS HIGI&Eacute;NICOS, ESTADO DE SALUD Y PREVENCI&Oacute;N DE ENFERMEDADES TRANSMISIBLES<br />\r\n&nbsp;&nbsp; - Aseo y h&aacute;bitos higi&eacute;nicos.&nbsp; Estado de salud y prevenci&oacute;n de enfermedades transmisibles</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">INFORMACI&Oacute;N DE PRODUCTOS ALIMENTICIOS: IDENTIFICACI&Oacute;N, ETIQUETADO, CADUCIDAD, COMPOSICI&Oacute;N<br />\r\n&nbsp;&nbsp; - Etiquetado: Identificaci&oacute;n y composici&oacute;n.&nbsp; Caducidad</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">HIGIENE ALIMENTARIA: MICROORGANISMOS EN LOS ALIMENTOS, CONTAMINACIONES, INFECCIONES E INTOXICACIONES ALIMENTARIAS</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CONSERVACI&Oacute;N DE LOS ALIMENTOS</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CARACTER&Iacute;STICAS ESPEC&Iacute;FICAS DE LOS ALIMENTOS Y PRODUCTOS ALIMENTICIOS</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PLAN DE AN&Aacute;LISIS DE PELIGROS Y PUNTOS DE CONTROL CR&Iacute;TICOS<br />\r\n&nbsp;&nbsp; - Diagrama de flujo sector panader&iacute;a, pasteler&iacute;a y confiter&iacute;a<br />\r\n&nbsp;&nbsp; - Diagrama de flujo sector moliner&iacute;a</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">GU&Iacute;A DE PR&Aacute;CTICAS CORRECTAS DE HIGIENE<br />\r\n&nbsp;&nbsp; - Programa de prerrequisitos.&nbsp; Control de procesos.&nbsp; Revisiones de autocontrol peri&oacute;dicas</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LEGISLACI&Oacute;N APLICABLE AL MANIPULADOR DE ALIMENTOS</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(81, 9025, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><strong>1. CARRETILLAS PARA EL TRANSPORTE DE MERCANC&Iacute;AS</strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Clasificaci&oacute;n, tipos y usos de las carretillas manuales y automotoras. Motores t&eacute;rmicos y motores el&eacute;ctricos</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Elementos principales de los distintos tipos de carretillas</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Mantenimiento b&aacute;sico e indicadores de funcionamiento incorrecto</span></p>\r\n\r\n<p style=\"line-height:0.5\">&nbsp;</p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><strong>2. MANEJO Y CONDUCCI&Oacute;N DE CARRETILLAS</strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Eje directriz. Acceso y descenso de la carretilla</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Uso de sistemas de retenci&oacute;n: cabina y cintur&oacute;n de seguridad</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Puesta en marcha y detenci&oacute;n de la carretilla</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Circulaci&oacute;n: velocidad de desplazamiento, trayectoria, naturaleza, piso, etc.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Maniobras. Frenado, aparcado, marcha atr&aacute;s, descenso en pendiente</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Aceleraciones y maniobras incorrectas</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Maniobras de carga y descarga. Circulaci&oacute;n</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Elevaci&oacute;n de la carga</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Prevenci&oacute;n de Riesgos laborales en el manejo de la carretilla</span></p>\r\n\r\n<p style=\"line-height:0.5\">&nbsp;</p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\"><strong>3. CARGA Y DESCARGA DE MERCANC&Iacute;AS</strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Estabilidad de la carga y de la carretilla. Nociones de equilibrio</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Evitaci&oacute;n de vuelcos transversales o longitudinales</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Comportamiento din&aacute;mico y est&aacute;tico de la carretilla cargada</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Colocaci&oacute;n incorrecta de la carga en la carretilla. Sobrecarga</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:10px\">- Modos de colocaci&oacute;n de las mercanc&iacute;as en las estanter&iacute;as</span></p>\r\n'),
(82, 65, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CONTENIDO TE&Oacute;RICO-PR&Aacute;CTICO</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MODULO 1. PLATAFORMA ELEVADORA<br />\r\n1.1 DEFINICIONES<br />\r\n1.2 MOVIMIENTOS<br />\r\n1.3 CLASIFICACI&Oacute;N<br />\r\n1.4 SISTEMA MOTRIZ E HIDR&Aacute;ULICO<br />\r\n1.5. NORMAS DE USO.<br />\r\n1.6. MEDIDAS DE PROTECCI&Oacute;N Y PREVENCI&Oacute;N.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MODULO 2. PLATAFORMAS ELEVADORAS. CONSEJOS Y C&Oacute;DIGOS<br />\r\n2.1 CONSEJOS PARA SU UTILIZACI&Oacute;N<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; DISPOSITIVOS DE SEGURIDAD<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; VERIFICACIONES DIARIAS<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; NORMAS GENERALES DE CONDUCCI&Oacute;N Y CIRCULACI&Oacute;N &nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; PROHIBICIONES<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; REGLAS DE MANTENIMIENTO<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; REGLAS GENERALES DE UTILIZACI&Oacute;N<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; REGLAS PARA EL CONDUCTOR<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; CONSIGNAS DE ENTRETENIMIENTO<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; PRIMEROS AUXILIOS<br />\r\n2.2 C&Oacute;DIGOS DE SEGURIDAD PARA LA UTILIZACI&Oacute;N DE LA PLATAFORMA Y&nbsp; SU MANTENIMIENTO</span></p>\r\n'),
(83, 10925, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><strong><span style=\"color:black\">CONTENIDO TE&Oacute;RICO</span></strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">1. Introducci&oacute;n.&nbsp;</span></span><span style=\"font-size:8px\"><span style=\"color:black\">Definiciones. </span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">2. Clases de puente gr&uacute;a.&nbsp;</span></span><span style=\"font-size:8px\"><span style=\"color:black\">Componentes.</span></span><span style=\"font-size:8px\"><span style=\"color:black\">&nbsp;Par&aacute;metros.</span></span><span style=\"font-size:8px\"><span style=\"color:black\">&nbsp;Operaciones.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">3. Riesgos y factores de riesgo.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">4. Medidas de prevenci&oacute;n. Equipamiento de las gr&uacute;as.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">&nbsp; &nbsp; a. Dispositivos de seguridad.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">&nbsp; &nbsp; b. Normas b&aacute;sicas de seguridad en las gr&uacute;as.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">&nbsp; &nbsp; c. Elementos de seguridad b&aacute;sicos para una gr&uacute;a puente.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">5. Accesorios de elevaci&oacute;n y eslingado.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">6. Mantenimiento.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">7. Operaci&oacute;n de las gr&uacute;as.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">8. Comunicaciones para la operaci&oacute;n de gr&uacute;as.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">9. Instrucciones generales de operaci&oacute;n. </span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">10. El procedimiento de izado.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><strong><span style=\"color:black\">CONTENIDO PR&Aacute;CTICO</span></strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">1. Utilizaci&oacute;n de los mandos y aparatos de control.</span></span><span style=\"font-size:8px\"><span style=\"color:black\">&nbsp;Ejecuci&oacute;n de maniobras (en vac&iacute;o y en carga).</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">2. Manipulaci&oacute;n de cargas con accesorios espec&iacute;ficos.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">3.</span></span><span style=\"font-size:8px\"><span style=\"color:black\">&nbsp;Ejercicios de eslingado y guiado de cargas.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">4. Combinaci&oacute;n de maniobras (en vac&iacute;o y en carga).</span></span><span style=\"font-size:8px\"><span style=\"color:black\">&nbsp;</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">5. Control y reducci&oacute;n del balanceo de la carga.</span></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><span style=\"color:black\">6. Ejercicios de se&ntilde;alizaci&oacute;n gestual.</span></span></p>\r\n'),
(84, 28, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><strong>M&Oacute;DULO 1. MARKETING</strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">LA FIGURA DEL COMMUNITY MANAGER.<br />\r\n&nbsp;&nbsp; - &iquest;Qu&eacute; es un community manager? Habilidades, aptitudes y actitudes.&nbsp; Funciones y responsabilidades.. Los objetivos de un community manager. Tipos de community managers.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">REDES Y WEB 2.0 (I)<br />\r\n&nbsp;&nbsp; - Medios sociales. Redes sociales. Blogs. Microblogging. Wikis. Podcast. Plataformas de v&iacute;deo. Plataformas de fotograf&iacute;a. Herramientas b&aacute;sicas para el community manager.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><strong>M&Oacute;DULO 2. GESTI&Oacute;N FINANCIERA</strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">SOLVENCIA<br />\r\n&nbsp;&nbsp; - Liquidez. Disponibilidad. Tesorer&iacute;a. An&aacute;lisis financiero mediante porcentajes.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">ENDEUDAMIENTO<br />\r\n&nbsp;&nbsp; - Endeudamiento total. Autonom&iacute;a financiera. Garant&iacute;a. Calidad de la deuda. Peso de los recursos permanentes. Otros ratios de inter&eacute;s.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">EL FONDO DE MANIOBRA<br />\r\n&nbsp;&nbsp; - Activo corriente. Sus componentes. Pasivo corriente. Sus componentes. Valores del fondo de maniobra y su significado. Fondo de maniobra aparente y fondo de maniobra necesario.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">RENTABILIDAD.<br />\r\n&nbsp;&nbsp; - Rentabilidad econ&oacute;mica (ROI). Rentabilidad financiera (ROE). Umbral de rentabilidad</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><strong>M&Oacute;DULO 3. RECURSOS HUMANOS</strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">INTRODUCCI&Oacute;N A LA GESTI&Oacute;N DE RECURSOS HUMANOS.<br />\r\n&nbsp;&nbsp;&nbsp; - El departamento de recursos humanos. Perfil del directivo de recursos humanos. La gesti&oacute;n de recursos humanos.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">DIRECCI&Oacute;N ESTRAT&Eacute;GICA DE RECURSOS HUMANOS.<br />\r\n&nbsp;&nbsp; - An&aacute;lisis del entorno y del medio interno de la empresa. Misi&oacute;n de la empresa. Estrategias.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">LA PLANIFICACI&Oacute;N DE RECURSOS HUMANOS.<br />\r\n&nbsp;&nbsp; - Concepto de planificaci&oacute;n de RRHH. Objetivos de la planificaci&oacute;n de RRHH. La planificaci&oacute;n de efectivos. La planificaci&oacute;n de carreras.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">AN&Aacute;LISIS Y DESCRIPCI&Oacute;N DE PUESTOS DE TRABAJO.<br />\r\n&nbsp;&nbsp; - Concepto y objetivos. Proceso de an&aacute;lisis y descripci&oacute;n de puestos.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">LA GESTI&Oacute;N POR COMPETENCIAS Y EVALUACI&Oacute;N DEL DESEMPE&Ntilde;O<br />\r\n&nbsp;&nbsp; - La gesti&oacute;n por competencias. La evaluaci&oacute;n del desempe&ntilde;o.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\"><strong>M&Oacute;DULO 4. CALIDAD</strong></span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">INTRODUCCI&Oacute;N A LA REVISI&Oacute;N DE LA NORMA ISO 9001.<br />\r\n&nbsp;&nbsp; - Certificando la calidad: Norma ISO 9001. Origen y evoluci&oacute;n de la Norma ISO 9001. Proceso de transici&oacute;n. Anexo, S.L.<br />\r\n&nbsp;&nbsp; - Enfoque a procesos y pensamiento basado en riesgos. Cambios clave en ISO 9001:2015. T&eacute;rminos y definiciones. Justificaci&oacute;n del cambio.</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:8px\">AN&Aacute;LISIS DE LA NORMA ISO 9001<br />\r\n&nbsp;&nbsp; - Estructura de la Norma ISO 9001:2015. Objeto y Campo de aplicaci&oacute;n. Referencias Normativas. T&eacute;rminos y Definiciones.<br />\r\n&nbsp;&nbsp; - Contexto de la organizaci&oacute;n. Liderazgo. Planificaci&oacute;n. Apoyo. Operaci&oacute;n. Evaluaci&oacute;n del desempe&ntilde;o. Mejora. Transici&oacute;n de la norma ISO 9001: an&aacute;lisis de correlaciones.</span></p>\r\n'),
(85, 27, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>CONOCE MEJOR C&Oacute;MO FUNCIONA INSTAGRAM.</strong><br />\r\n&nbsp;&nbsp; - Breve historia de Instagram.<br />\r\n&nbsp;&nbsp; - Instagram en cifras.<br />\r\n&nbsp;&nbsp; - Instagram para empresas.<br />\r\n&nbsp;&nbsp; - Empezando en Instagram.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>DISE&Ntilde;A TU ESTRATEGIA EN INSTAGRAM.</strong><br />\r\n&nbsp;&nbsp; - Objetivos.<br />\r\n&nbsp;&nbsp; - P&uacute;blico objetivo.<br />\r\n&nbsp;&nbsp; - Estudio de la competencia.<br />\r\n&nbsp;&nbsp; - Estudio del propio negocio.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>DISE&Ntilde;A TU PLAN DE MARKETING EN INSTAGRAM.</strong><br />\r\n&nbsp;&nbsp; - Creaci&oacute;n del perfil de empresa.<br />\r\n&nbsp;&nbsp; - Definici&oacute;n y planificaci&oacute;n de las publicaciones.<br />\r\n&nbsp;&nbsp; - Funcionalidades.<br />\r\n&nbsp;&nbsp; - Publicidad en Instagram. Marketing de influencers.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>HERRAMIENTAS PARA GESTIONAR TU ESTRATEGIA EN INSTAGRAM.</strong><br />\r\n&nbsp;&nbsp; - Herramientas para la gesti&oacute;n de publicaciones. SocialGest y Hootsuite.<br />\r\n&nbsp;&nbsp; - Herramientas de edici&oacute;n de fotos.<br />\r\n&nbsp;&nbsp; - Herramientas de edici&oacute;n de v&iacute;deo.<br />\r\n&nbsp;&nbsp; - Herramientas de monitorizaci&oacute;n.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>IMPLEMENTA TU PLAN CON LAS MEJORES PR&Aacute;CTICAS.</strong><br />\r\n&nbsp;&nbsp; - Buenas pr&aacute;cticas para conseguir &eacute;xito.<br />\r\n&nbsp;&nbsp; - Malas pr&aacute;cticas a evitar en Instagram.<br />\r\n&nbsp;&nbsp; - Casos de &eacute;xito en Instagram.<br />\r\n&nbsp;&nbsp; - Gesti&oacute;n de crisis de reputaci&oacute;n.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>SEGUIMIENTO Y AJUSTE.</strong><br />\r\n&nbsp;&nbsp; - M&eacute;tricas relevantes.<br />\r\n&nbsp;&nbsp; - Calcular el ROI.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(86, 8625, 2025, '<p><span style=\"font-size:10px\"><strong>Presentaciones personales</strong>: informaci&oacute;n b&aacute;sica (nombre, edad, cumplea&ntilde;os, lugar de origen, situaci&oacute;n familiar, gustos, aficiones y aspiraciones personales).</span></p>\r\n\r\n<p><span style=\"font-size:10px\"><strong>Descripciones de rutina diaria y vida profesional:</strong> tareas habituales, descripci&oacute;n del entorno de trabajo, expresi&oacute;n de logros personales y metas profesionales.</span></p>\r\n\r\n<p><span style=\"font-size:10px\"><strong>Vocabulario y expresiones para el &aacute;mbito laboral: </strong>administraci&oacute;n, reuniones, informes, citas y organizaci&oacute;n del trabajo diario.</span></p>\r\n\r\n<p><span style=\"font-size:10px\"><strong>Pr&aacute;ctica de la descripci&oacute;n oral de im&aacute;genes y situaciones: </strong>ubicaci&oacute;n de personas y objetos, interpretaci&oacute;n de escenas laborales o cotidianas, uso de expresiones funcionales.</span></p>\r\n\r\n<p><span style=\"font-size:10px\"><strong>Descripciones de empleos y tareas asociadas: </strong>mediante juegos de deducci&oacute;n y actividades colaborativas (&ldquo;Guess my job&rdquo;).</span></p>\r\n\r\n<p><span style=\"font-size:10px\"><strong>Viajes y transporte:</strong> vocabulario relacionado con el aeropuerto, el avi&oacute;n, la seguridad y los controles fronterizos, as&iacute; como narraci&oacute;n de experiencias de viaje.</span></p>\r\n\r\n<p><span style=\"font-size:10px\"><strong>Alojamiento y hotel:</strong> tipos de habitaci&oacute;n, servicios, reserva, check-in/check-out, y resoluci&oacute;n de problemas en recepci&oacute;n.</span></p>\r\n\r\n<p><span style=\"font-size:10px\"><strong>Restauraci&oacute;n: </strong>pedir comida y bebida en un restaurante, hacer reservas, vocabulario de men&uacute;s, conversaciones con camareros y formas de pago.</span></p>\r\n\r\n<p><span style=\"font-size:10px\"><strong>Ventajas y desventajas de distintos medios de transporte:</strong> debate guiado y pr&aacute;ctica oral sobre movilidad urbana y viajes.</span></p>\r\n'),
(87, 8725, 2025, '<p><span style=\"font-size:11px\"><strong>Presentaciones personales y conversaci&oacute;n b&aacute;sica:</strong> nombre, edad, lugar de origen y residencia, cumplea&ntilde;os, relaciones personales, gustos y preferencias.</span></p>\r\n\r\n<p><span style=\"font-size:11px\"><strong>Descripci&oacute;n de rutinas diarias y vida profesional:</strong> hablar sobre el propio trabajo, responsabilidades y tareas cotidianas.</span></p>\r\n\r\n<p><span style=\"font-size:11px\"><strong>Vocabulario espec&iacute;fico del entorno laboral:</strong> administraci&oacute;n, uso de herramientas de oficina (computer, laptop, printer, scanner, folder, appointment, meeting, report, etc.)</span></p>\r\n\r\n<p><span style=\"font-size:11px\"><strong>Expresi&oacute;n de experiencias, logros y aspiraciones personales:</strong> sue&ntilde;os, metas, miedos superados y motivaciones.</span></p>\r\n\r\n<p><span style=\"font-size:11px\"><strong>Vocabulario tem&aacute;tico sobre viajes:</strong> situaciones y expresiones comunes en un aeropuerto.</span></p>\r\n\r\n<p><span style=\"font-size:11px\"><strong>Descripci&oacute;n de im&aacute;genes y situaciones cotidianas:</strong> uso de estructuras &uacute;tiles para describir lugares, personas, objetos y acciones en diferentes contextos.</span></p>\r\n\r\n<p><span style=\"font-size:11px\"><strong>Pr&aacute;ctica de estructuras comunicativas &uacute;tiles:</strong> hacer preguntas, expresar opiniones, describir lugares y rutinas laborales, organizar el discurso (first, then, after that, finally&hellip;).</span></p>\r\n'),
(88, 67, 2025, '<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>EL TRABAJO Y LA SALUD: LOS RIESGOS PROFESIONALES. FACTORES DE RIESGO</strong><br />\r\n&nbsp;&nbsp; - El trabajo y la salud. Los riesgos profesionales. Factores de riesgo</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>DA&Ntilde;OS DERIVADOS DEL TRABAJO. ACCIDENTE DE TRABAJO Y ENFERMEDADES PROFESIONALES. OTRAS PATOLOG&Iacute;AS DERIVADAS DEL TRABAJO</strong><br />\r\n&nbsp;&nbsp; - Da&ntilde;os derivados del trabajo. Los accidentes de trabajo y las enfermedades profesionales</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>MARCO NORMATIVO B&Aacute;SICO EN MATERIA DE PREVENCI&Oacute;N DE RIESGOS LABORALES. DERECHOS Y DEBERES B&Aacute;SICOS EN ESTA MATERIA</strong><br />\r\n&nbsp;&nbsp; - Marco normativo b&aacute;sico en materia de prevenci&oacute;n de riesgos laborales. La Ley de Prevenci&oacute;n de Riesgos Laborales (LPRL)<br />\r\n&nbsp;&nbsp; - Ley 54/2003, reforma del marco normativo de la prevenci&oacute;n de riesgos laborales. El Reglamento de los Servicios de Prevenci&oacute;n (RSP)<br />\r\n&nbsp;&nbsp; - Otras normas espec&iacute;ficas derivadas de la Ley de Prevenci&oacute;n de Riesgos Laborales</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>RIESGOS LIGADOS A LAS CONDICIONES DE SEGURIDAD</strong><br />\r\n&nbsp;&nbsp; - El lugar de trabajo. Las herramientas y las m&aacute;quinas. La electricidad. Los incendios. Almacenamiento, manipulaci&oacute;n y transporte. Se&ntilde;alizaci&oacute;n</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>RIESGOS LIGADOS AL MEDIO AMBIENTE DE TRABAJO</strong><br />\r\n&nbsp;&nbsp; - La exposici&oacute;n laboral a agentes qu&iacute;micos. La exposici&oacute;n laboral a agentes f&iacute;sicos. La exposici&oacute;n laboral a agentes biol&oacute;gicos. El control del riesgo</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>LA CARGA DE TRABAJO, LA FATIGA Y LA INSATISFACCI&Oacute;N LABORAL</strong><br />\r\n&nbsp;&nbsp; - La carga de trabajo. La carga f&iacute;sica. La carga mental. La fatiga. La insatisfacci&oacute;n laboral</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>SISTEMAS ELEMENTALES DE CONTROL DE RIESGOS. PROTECCI&Oacute;N COLECTIVA E INDIVIDUAL</strong><br />\r\n&nbsp;&nbsp; - La prevenci&oacute;n y protecci&oacute;n de los trabajadores. La protecci&oacute;n colectiva. La protecci&oacute;n individual</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>EL PLAN DE EMERGENCIA</strong><br />\r\n&nbsp;&nbsp; - Actuaci&oacute;n frente a emergencias. El plan de emergencia</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>EL CONTROL DE LA SALUD DE LOS TRABAJADORES</strong><br />\r\n&nbsp;&nbsp; - La vigilancia de la salud de los trabajadores en el marco de la Ley de Prevenci&oacute;n de Riesgos laborales.<br />\r\n&nbsp;&nbsp; - Objetivos de vigilancia de la salud. Las t&eacute;cnicas de vigilancia de la salud.<br />\r\n&nbsp;&nbsp; - Integraci&oacute;n de los programas de vigilancia de la salud en el programa de prevenci&oacute;n de riesgos laborales</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>COMPONENTES IMPLICADOS EN LA PREVENCI&Oacute;N DE RIESGOS LABORALES</strong><br />\r\n&nbsp;&nbsp; - Organismos internacionales. Organismos nacionales. El empresario y su deber de prevenci&oacute;n. El trabajador y sus obligaciones preventivas</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>LA GESTI&Oacute;N DE LA PREVENCI&Oacute;N DE RIESGOS LABORALES EN LA EMPRESA</strong><br />\r\n&nbsp;&nbsp; - Pol&iacute;tica de prevenci&oacute;n. Control de las actuaciones. Organizaci&oacute;n de recursos para las actividades preventivas</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>DOCUMENTACI&Oacute;N PARA LA GESTI&Oacute;N DE LA PREVENCI&Oacute;N DE RIESGOS</strong><br />\r\n&nbsp;&nbsp; - Documentaci&oacute;n necesaria. Elaboraci&oacute;n de la documentaci&oacute;n</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>PRIMEROS AUXILIOS</strong><br />\r\n&nbsp;&nbsp; - &iquest;Qu&eacute; son los primeros auxilios?. Activaci&oacute;n del sistema de emergencia. Socorrismo laboral. Evaluaci&oacute;n primaria de un accidentado<br />\r\n&nbsp;&nbsp; - Principales emergencias m&eacute;dicas. T&eacute;cnicas de reanimaci&oacute;n</span></p>\r\n\r\n<p style=\"line-height:0.5\"><span style=\"font-size:9px\"><strong>RIESGOS ESPEC&Iacute;FICOS Y SU PREVENCI&Oacute;N EN EL SECTOR OFICINA-COMERCIO</strong><br />\r\n&nbsp;&nbsp; - Riesgos para la seguridad de las personas. Medidas de prevenci&oacute;n de los riesgos. Riesgos para la salud. Riesgos en la manipulaci&oacute;n de cargas</span></p>\r\n'),
(89, 5925, 2025, '<p style=\"line-height:1.0\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p style=\"line-height:1.0\"><span style=\"font-size:11px\">Conocimiento de los diferentes tipos de u&ntilde;as</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:1.0\"><span style=\"font-size:11px\">Posibles enfermedades de las u&ntilde;as</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:1.0\"><span style=\"font-size:11px\">Preparaci&oacute;n de la u&ntilde;a para una puesta de gel</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:1.0\"><span style=\"font-size:11px\">Uso del torno</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:1.0\"><span style=\"font-size:11px\">Pr&aacute;ctica de extensi&oacute;n de gel tradicional (color, francesa)</span></p>\r\n	</li>\r\n	<li>\r\n	<p style=\"line-height:1.0\"><span style=\"font-size:11px\">Pr&aacute;ctica de extensiones de gel en botella (natural, color )</span></p>\r\n	</li>\r\n</ul>\r\n'),
(90, 68, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">GENERALIDADES DEL SISTEMA AN&Aacute;LISIS DE PELIGROS Y PUNTOS DE CONTROL CR&Iacute;TICO (APPCC).<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n al sistema APPCC y glosario de t&eacute;rminos relacionados.<br />\r\n&nbsp;&nbsp; - Sistema tradicional de control de los alimentos.<br />\r\n&nbsp;&nbsp; - Conceptos de APPCC en la industria alimentaria.<br />\r\n&nbsp;&nbsp; - Objetivos del sistema de autocontrol.<br />\r\n&nbsp;&nbsp; - Caracter&iacute;sticas generales del sistema APPCC.<br />\r\n&nbsp;&nbsp; - Ventajas de la aplicaci&oacute;n del sistema APPCC.<br />\r\n&nbsp;&nbsp; - Problemas en la aplicaci&oacute;n del sistema APPCC.<br />\r\n&nbsp;&nbsp; - &Aacute;mbito de aplicaci&oacute;n y requisitos para la implantaci&oacute;n del sistema APPCC.<br />\r\n&nbsp;&nbsp; - Etapas y evoluci&oacute;n de la aplicaci&oacute;n del sistema APPCC.<br />\r\n&nbsp;&nbsp; - An&aacute;lisis de riesgos, identificaci&oacute;n y valoraci&oacute;n de los mismos. Acciones correctoras y/o preventivas.<br />\r\n&nbsp;&nbsp; - L&iacute;mites, seguimiento y vigilancia del sistema APPCC. Verificaci&oacute;n y validaci&oacute;n de registros y documentaci&oacute;n del sistema.<br />\r\n&nbsp;&nbsp; - Consideraciones previas a la implantaci&oacute;n del APPCC.<br />\r\n&nbsp;&nbsp; - Legislaci&oacute;n. Reglamento 852/2004, entre otros.<br />\r\n&nbsp;&nbsp; - Papel de la Administraci&oacute;n en los sistemas APPCC.<br />\r\n&nbsp;&nbsp; - APPCC y sistemas de Gesti&oacute;n de la Calidad.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">DIRECTRICES GENERALES DEL SISTEMA APPCC.<br />\r\n&nbsp;&nbsp; - Directrices del APPCC.<br />\r\n&nbsp;&nbsp; - Plan APPCC.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">APLICACI&Oacute;N DEL SISTEMA APPCC.<br />\r\n&nbsp;&nbsp; - El APPCC en las materias primas e ingredientes, productos en curso de fabricaci&oacute;n o productos terminados.<br />\r\n&nbsp;&nbsp; - El APPCC aplicado al proceso de producci&oacute;n.<br />\r\n&nbsp;&nbsp; - El APPCC en el personal.<br />\r\n&nbsp;&nbsp; - El APPCC en las instalaciones, locales y equipos.<br />\r\n&nbsp;&nbsp; - El APPCC en el transporte.<br />\r\n&nbsp;&nbsp; - El APPCC en el proceso de limpieza y desinfecci&oacute;n.<br />\r\n&nbsp;&nbsp; - El APPCC en la lucha contra insectos y roedores.<br />\r\n&nbsp;&nbsp; - El APPCC en el tratamiento de residuos y desperdicios y aguas residuales.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">M&Oacute;DULO ESPEC&Iacute;FICO SECTORIAL.<br />\r\n&nbsp;&nbsp; - Normativa y contenidos espec&iacute;ficos del sector en el que se imparte esta especialidad.</span></p>\r\n'),
(91, 69, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">IDENTIFICACI&Oacute;N DEL &Aacute;MBITO MATERIAL, SUBJETIVO, TEMPORAL Y TERRITORIAL<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n<br />\r\n&nbsp;&nbsp; - Sujeto pasivo, hecho imponible y devengo<br />\r\n&nbsp;&nbsp; - Base imponible, tipos impositivos y territorio de aplicaci&oacute;n del impuesto<br />\r\n&nbsp;&nbsp; - Exenciones<br />\r\n&nbsp;&nbsp; - Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">AN&Aacute;LISIS DEL R&Eacute;GIMEN GENERAL DEL IVA<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n<br />\r\n&nbsp;&nbsp; - Obligaciones formales<br />\r\n&nbsp;&nbsp; - Repercusi&oacute;n del impuesto<br />\r\n&nbsp;&nbsp; - Deducibilidad del IVA. Regla de prorrata<br />\r\n&nbsp;&nbsp; - Liquidaci&oacute;n y declaraci&oacute;n del IVA<br />\r\n&nbsp;&nbsp; - Correcci&oacute;n y modificaci&oacute;n de operaciones de IVA<br />\r\n&nbsp;&nbsp; - Recuperaci&oacute;n del IVA devengado no cobrado<br />\r\n&nbsp;&nbsp; - Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">IDENTIFICACI&Oacute;N DE LOS REG&Iacute;MENES ESPECIALES (RE) DE IVA<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n<br />\r\n&nbsp;&nbsp; - RE del recargo de equivalencia<br />\r\n&nbsp;&nbsp; - RE de la agricultura, ganader&iacute;a y pesca<br />\r\n&nbsp;&nbsp; - Otros reg&iacute;menes especiales<br />\r\n&nbsp;&nbsp; - Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CLASIFICACI&Oacute;N DE LAS OPERACIONES EXTERIORES<br />\r\n&nbsp;&nbsp; - Introducci&oacute;n<br />\r\n&nbsp;&nbsp; - Operaciones intracomunitarias<br />\r\n&nbsp;&nbsp; - Importaci&oacute;n y exportaci&oacute;n<br />\r\n&nbsp;&nbsp; - Resumen</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
