(96, 75, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>INTRODUCCI&Oacute;N A&nbsp;GOOGLE DRIVE<br />\r\nQu&eacute; es y qu&eacute; hace&nbsp;Google Drive. Computaci&oacute;n en la nube. Plataformas y Formatos. Cuenta de&nbsp;Google Drive. Aplicaciones de&nbsp;Google Drive</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>INTRODUCCI&Oacute;N AL ESPACIO DE TRABAJO DE&nbsp;GOOGLE DRIVE<br />\r\nServicios de&nbsp;Google. Configurar la cuenta de&nbsp;Google. Los men&uacute;s de&nbsp;Google Drive</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>SERVICIOS ADICIONALES DE&nbsp;GOOGLE<br />\r\nGmail. Calendar. Fotos. Reader. B&uacute;squeda. M&aacute;s y mucho m&aacute;s</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>GESTI&Oacute;N DE ARCHIVOS<br />\r\nGesti&oacute;n avanzada. Carpetas. Gesti&oacute;n de los archivos en&nbsp;Google Drive</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>CREACI&Oacute;N Y EDICI&Oacute;N EN&nbsp;GOOGLE&nbsp;DOCUMENTOS<br />\r\nCreaci&oacute;n y edici&oacute;n b&aacute;sica en&nbsp;Google&nbsp;Documentos. Visualizaci&oacute;n y edici&oacute;n de documentos<br />\r\nOpciones de formato. Edici&oacute;n avanzada en&nbsp;Google&nbsp;Documentos. Insertar otros elementos. Configuraci&oacute;n de p&aacute;gina e impresi&oacute;n</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>CREACI&Oacute;N Y EDICI&Oacute;N EN&nbsp;GOOGLE&nbsp;PRESENTACIONES<br />\r\nCreaci&oacute;n y edici&oacute;n b&aacute;sica en&nbsp;Google&nbsp;Presentaciones. Operaciones con diapositivas. Navegar y editar. Barra de herramientas de formato<br />\r\nInsertar formas de texto. Insertar im&aacute;genes. Edici&oacute;n avanzada en&nbsp;Google&nbsp;Presentaciones. Imprimir, exportar, compartir y publicar presentaciones</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>CREACI&Oacute;N Y EDICI&Oacute;N EN&nbsp;GOOGLE&nbsp;HOJAS DE C&Aacute;LCULO<br />\r\nCreaci&oacute;n y edici&oacute;n b&aacute;sica en&nbsp;Google&nbsp;Hojas de c&aacute;lculo. Restricciones<br />\r\nNavegaci&oacute;n. Formato. F&oacute;rmulas y funciones. Configuraci&oacute;n de impresi&oacute;n. Herramientas en Hojas de c&aacute;lculo<br />\r\nOrdenaci&oacute;n. Tipos de datos. Extras. Funciones avanzadas. Gr&aacute;ficos. Comentarios. Extra: tablas din&aacute;micas</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>CREACI&Oacute;N Y EDICI&Oacute;N EN&nbsp;GOOGLE&nbsp;FORMULARIOS<br />\r\nCreaci&oacute;n de Formularios. Edici&oacute;n avanzada en formularios</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>CREACI&Oacute;N Y EDICI&Oacute;N EN&nbsp;GOOGLE&nbsp;DIBUJOS<br />\r\nCrear nuevo dibujo. Subir archivos. Ver, editar y dar formato<br />\r\nElementos del dibujo. P&iacute;xeles y vectores. Conectores. Men&uacute; Disponer. Modificadores de teclado</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>COMPARTIR DOCUMENTOS EN&nbsp;GOOGLE DRIVE<br />\r\nCompartir documentos. Colaboraci&oacute;n en documentos</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>UTILIDADES PARA LAS APLICACIONES DE&nbsp;GOOGLE DRIVE<br />\r\nPlantillas. Atajos de teclado. Nuevas caracter&iacute;sticas</strong></span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:9px\"><strong>SOLUCI&Oacute;N DE PROBLEMAS EN&nbsp;GOOGLE DRIVE<br />\r\nSoluci&oacute;n de problemas de conexi&oacute;n. Soluci&oacute;n de problemas de acceso. Ayuda de&nbsp;Google Drive. Blog de&nbsp;Google Drive. Otros recursos</strong></span></p>\r\n'),
(97, 53, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CALIDAD ALIMENTARIA<br />\r\n- Definici&oacute;n de alimentos<br />\r\n- Clasificaci&oacute;n de los alimentos<br />\r\n- Criterios de calidad de los alimentos</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ALTERACIONES DE LOS ALIMENTOS<br />\r\n- Deterioro de los alimentos de origen animal y de origen vegetal</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MANIPULACI&Oacute;N HIGI&Eacute;NICA DE LOS ALIMENTOS<br />\r\n- Cadena alimentaria: origen, transformaci&oacute;n, tratamientos y trazabilidad de los alimentos<br />\r\n- El papel del manipulador de alimentos<br />\r\n- Manipulaci&oacute;n de los alimentos espec&iacute;ficos del curso</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LOCALES E INSTALACIONES<br />\r\n- Distribuci&oacute;n de las instalaciones, iluminaci&oacute;n, ventilaci&oacute;n<br />\r\n- Maquinaria, herramientas y utillaje, limpieza y desinfecci&oacute;n<br />\r\n- Eliminaci&oacute;n de basuras y residuos</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">HIGIENE PERSONAL: ASEO, H&Aacute;BITOS HIGI&Eacute;NICOS, ESTADO DE SALUD Y PREVENCI&Oacute;N DE ENFERMEDADES TRANSMISIBLES<br />\r\n- Aseo y h&aacute;bitos higi&eacute;nicos<br />\r\n- Estado de salud y prevenci&oacute;n de enfermedades transmisibles</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">INFORMACI&Oacute;N DE PRODUCTOS ALIMENTICIOS: IDENTIFICACI&Oacute;N, ETIQUETADO, CADUCIDAD, COMPOSICI&Oacute;N<br />\r\n- Etiquetado: Identificaci&oacute;n y composici&oacute;n<br />\r\n- Caducidad</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">HIGIENE ALIMENTARIA: MICROORGANISMOS EN LOS ALIMENTOS, CONTAMINACIONES, INFECCIONES E INTOXICACIONES ALIMENTARIAS</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CONSERVACI&Oacute;N DE LOS ALIMENTOS</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CARACTER&Iacute;STICAS ESPEC&Iacute;FICAS DE LOS ALIMENTOS Y PRODUCTOS ALIMENTICIOS</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(98, 8925, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>M&Oacute;DULO I ESPACIOS CONFINADOS</strong><br />\r\n<strong>1. Definici&oacute;n de espacios confinados.</strong><br />\r\n1.1. &iquest;Qu&eacute; se entiende por espacio confinado?<br />\r\n<strong>2. Clasificaci&oacute;n de espacios confinados:</strong><br />\r\n2.1. Caracter&iacute;sticas geom&eacute;tricas: - abiertos.- cerrados.<br />\r\n2.2. Ejemplos de espacios confinados.<br />\r\n<strong>3. Riesgos y medidas preventivas en espacios confinados.</strong><br />\r\n3.1. Generales (falta visibilidad, iluminaci&oacute;n inadecuada, higiene, etc.).<br />\r\n3.2. Espec&iacute;ficos:<br />\r\n3.2.1. Riesgos atmosf&eacute;ricos.<br />\r\n3.2.2. Riesgos f&iacute;sicos.<br />\r\n3.2.3. Otros riesgos.<br />\r\n<strong>4. Normas de acceso a espacios confinados.</strong><br />\r\n4.1. Precauciones a seguir antes de acceder al espacio confinado por parte del trabajador.<br />\r\n4.2. Condiciones de entrada. Mediciones.<br />\r\n4.3. Autorizaciones de entrada y acceso a espacios confinados. Permiso de trabajo.<br />\r\n4.4. Control exterior de espacios confinados<br />\r\n<strong>5. Rescate y auxilio en espacios confinados.</strong><br />\r\n5.1. Rescate y auxilio.<br />\r\n5.2. Accidentes en espacios confinados: ejemplos y medidas preventivas.<br />\r\n<strong>6. Pr&aacute;cticas.</strong><br />\r\n6.1. Acompa&ntilde;amiento con cuerda en acceso a espacios confinados por escalera vertical (entrada y salida).<br />\r\n6.2. Descenso y ascenso a espacio confinado con acceso con cuerda suspendido.<br />\r\n6.3. Rescate de operario inconsciente en espacio confinado con acceso por escalera.<br />\r\n6.4. Rescate de operario inconsciente en espacio confinado con acceso por suspensi&oacute;n.</span><br />\r\n&nbsp;</p>\r\n');
INSERT INTO `contenidos` (`idcontenido`, `N_Accion`, `Anno`, `Contenido`) VALUES
(99, 8825, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>M&Oacute;DULO II TRABAJOS EN ALTURA<br />\r\nParte te&oacute;rica:</strong><br />\r\n&bull; Legislaci&oacute;n y Normativa y seguridad.<br />\r\n&bull; La cadena de seguridad: protecci&oacute;n colectiva y protecci&oacute;n individual.<br />\r\n&bull; Material: colectivo e individual, mantenimiento y cuidados, materiales especiales.<br />\r\n&bull; Nudos b&aacute;sicos y complejos.<br />\r\n&bull; Instalaciones: anclajes en soporte variado, sistemas de anclaje de seguridad, l&iacute;neas de vida en todo tipo de planos y situaciones, tirolinas y movilidad lateral.<br />\r\n&bull; Maniobras de rescate de un compa&ntilde;ero en apuros<br />\r\n<strong>Parte pr&aacute;ctica:</strong><br />\r\n&bull; Descensos: rappel simple y con paso de nudos o fraccionamientos, p&eacute;ndulos y desplazamientos laterales, descenso por estructuras asegurado.<br />\r\n&bull; Ascensos: ascenso simple y con paso de nudos y fraccionamientos, ascensos por estructuras aseguradas.<br />\r\n&bull; Desplazamientos: l&iacute;neas de vida, enlaces de l&iacute;neas de vida con instalaciones verticales, tirolinas y desplazamientos laterales, trepadas y ascensiones.<br />\r\n&bull; Instalaciones: triangulaciones de S.A.S. instalaciones de S.A.S. con la propia cuerda, S.A.S. reenviadas, S.A.S. embragables, instalaci&oacute;n de l&iacute;neas de vida flexibles.<br />\r\n&bull; Maniobras de rescate (descenso de un operario herido o inconsciente)</span></p>\r\n'),
(100, 15125, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\"><strong>Teor&iacute;a</strong><br />\r\n- Definici&oacute;n.<br />\r\n- Tipos y componentes.<br />\r\n- Definici&oacute;n de capacidad nominal.<br />\r\n- Operador de carretillas.<br />\r\n- Utilizaci&oacute;n: normas b&aacute;sicas para el uso seguro de una carretilla.<br />\r\n- Mantenimiento.<br />\r\n- Dispositivos de seguridad.<br />\r\n- Normas de conducci&oacute;n de carretillas.<br />\r\n- Principios b&aacute;sicos del equilibrio de cargas y estabilidad.<br />\r\n- Compatibilidad carretilla elevadora-locales de trabajo<br />\r\n- Riesgos, medidas preventivas y recomendaciones b&aacute;sicas en la operaci&oacute;n de carretillas.<br />\r\n<strong>Pr&aacute;ctica</strong><br />\r\n- Introducci&oacute;n.<br />\r\n- Circulaci&oacute;n y normativa.<br />\r\n- Comprobaciones previas.<br />\r\n- Puesta en marcha.<br />\r\n- Maniobras habituales:<br />\r\n- Circulaci&oacute;n en l&iacute;nea recta, marcha adelante y marcha atr&aacute;s.<br />\r\n- Circulaci&oacute;n en &ldquo;S&rdquo; marcha adelante y marcha atr&aacute;s.<br />\r\n- Apilado y desapilado en superficie.<br />\r\n- Apilado y desapilado a distintas alturas.<br />\r\n- Uso de accesorios.<br />\r\n- Aparcado e inmovilizaci&oacute;n.</span></p>\r\n'),
(101, 62, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PREVENCI&Oacute;N DE RIESGOS LABORALES: PRINCIPIOS B&Aacute;SICOS Y CONCEPTOS GENERALES<br />\r\n&nbsp; &nbsp;- Introducci&oacute;n. Conceptos b&aacute;sicos. Derechos y deberes<br />\r\n&nbsp; &nbsp;- Riesgos generales en la prevenci&oacute;n. Medidas de prevenci&oacute;n en la prevenci&oacute;n<br />\r\n&nbsp; &nbsp;- Protecci&oacute;n colectiva. Protecci&oacute;n individual<br />\r\n&nbsp; &nbsp;- Se&ntilde;alizaci&oacute;n<br />\r\n&nbsp; &nbsp;- Interferencias entre actividades<br />\r\n&nbsp; &nbsp;- Seguridad vial<br />\r\n&nbsp; &nbsp;- Medidas de emergencia y evacuaci&oacute;n<br />\r\n&nbsp; &nbsp;- Primeros auxilios</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PREVENCI&Oacute;N DE RIESGOS LABORALES: APARATOS ELEVADORES<br />\r\n&nbsp; &nbsp;- Carga: definici&oacute;n, caracter&iacute;sticas, almacenamiento y equipos de manipulaci&oacute;n<br />\r\n&nbsp; &nbsp;- Eslingado. Concepto, caracter&iacute;sticas y buenas pr&aacute;cticas<br />\r\n&nbsp; &nbsp;- Equipos de trabajo. Normativa y descripci&oacute;n<br />\r\n&nbsp; &nbsp;- Gr&uacute;as. Tipos, riesgos y medidas preventivas<br />\r\n&nbsp; &nbsp;- Mantenimiento de equipos de trabajo</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CAMI&Oacute;N GR&Uacute;A<br />\r\n&nbsp; &nbsp;- Definici&oacute;n y caracter&iacute;sticas. Accesorios y componentes de seguridad<br />\r\n&nbsp; &nbsp;- Riesgos asociados. Medidas de seguridad y buenas pr&aacute;cticas<br />\r\n&nbsp; &nbsp;- Equipos de protecci&oacute;n individual. Mantenimiento y documentaci&oacute;n<br />\r\n&nbsp; &nbsp;- Se&ntilde;alizaci&oacute;n</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PUENTE GR&Uacute;A<br />\r\n&nbsp; &nbsp;- Definici&oacute;n y caracter&iacute;sticas. Componentes del puente gr&uacute;a<br />\r\n&nbsp; &nbsp;- Tipos de puente gr&uacute;a. Accesorios y componentes de seguridad<br />\r\n&nbsp; &nbsp;- Riesgos asociados. Medidas de seguridad<br />\r\n&nbsp; &nbsp;- Requisitos del operador. Operaciones y manejo<br />\r\n&nbsp; &nbsp;- Protecci&oacute;n colectiva e individual<br />\r\n&nbsp; &nbsp;- Mantenimiento. Se&ntilde;alizaci&oacute;n</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(102, 79, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">SOCIAL MEDIA MARKETING.<br />\r\n&nbsp; &nbsp;- Social media marketing. Social media engagement. Social CRM.<br />\r\n&nbsp; &nbsp;- El community manager. &iquest;Por qu&eacute; elegir Facebook?<br />\r\n&nbsp; &nbsp;- Caso de &eacute;xito: Obermutten..</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">FACEBOOK MARKETING<br />\r\n&nbsp; &nbsp;- eBranding. Facebook marketing. &iquest;Perfil, grupo o p&aacute;gina?<br />\r\n&nbsp; &nbsp;- Caso de &eacute;xito: hotel Entremares..</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LAS P&Aacute;GINAS.<br />\r\n&nbsp; &nbsp;- Crear una p&aacute;gina paso a paso. Interfaz de Facebook.<br />\r\n&nbsp; &nbsp;- Caso de &eacute;xito: Oreo..</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">APLICACIONES.<br />\r\n&nbsp; &nbsp;- Aplicaciones. Aplicaciones propias: eventos y notas. Aplicaciones profesionales.<br />\r\n&nbsp; &nbsp;- Caso de &eacute;xito: Red Bull..</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LOS GRUPOS.<br />\r\n&nbsp; &nbsp;- El grupo y su creaci&oacute;n. Losgrupos como herramienta de comunicaci&oacute;n interna.<br />\r\n&nbsp; &nbsp;- Caso de &eacute;xito: Imagina... Crea..</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">INTEGRACI&Oacute;N CON OTRAS HERRAMIENTAS.<br />\r\n&nbsp; &nbsp;- Twitter. Wordpress. SlideShare. Marcadores sociales. Pinterest. Instagram. YouTube. Foursquare. Google Glass.<br />\r\n&nbsp; &nbsp;- Caso de &eacute;xito: Real Madrid F.C..</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MARKETING PARA FANS.<br />\r\n&nbsp; &nbsp;- Inbound marketing. EdgeRank. Marketing para fans. Optimizar la interacci&oacute;n. Convertir usuarios en compradores. Rentabilizar.<br />\r\n&nbsp; &nbsp;- Caso de &eacute;xito: Hawkers..</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PLATAFORMA PUBLICITARIA.<br />\r\n&nbsp; &nbsp;- Publicidad en Facebook.<br />\r\n&nbsp; &nbsp;- Caso de &eacute;xito: Privalia.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">M&Eacute;TRICAS Y MONITORIZACI&Oacute;N.<br />\r\n&nbsp; &nbsp;- Key Performance Indicators. Facebook Insights. Monitorizaci&oacute;n: del ROI al IOR.<br />\r\n&nbsp; &nbsp;- Caso de &eacute;xito: Coca-Cola.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(103, 11425, 2025, '<p style=\"line-height:1.0\"><span style=\"font-size:11px\">TEMA 1: COMPOSICI&Oacute;N PATRIMONIO. MASAS PATRIMONIALES<br />\r\nExplicaci&oacute;n de las cuentas de activo, pasivo y masas patrimoniales.<br />\r\nTEMA 2: INVENTARIO Y BALANCE DE SITUACI&Oacute;N<br />\r\nExplicaci&oacute;n y ejercicios pr&aacute;cticos de Inventarios y Balances de situaci&oacute;n.<br />\r\nTEMA 3: EL REGISTRO CONTABLE DE LAS OPERACIONES<br />\r\nExplicaci&oacute;n de la teor&iacute;a del cargo y del abono. Ejercicios pr&aacute;cticos con asientos contables.<br />\r\nTEMA 4: CUENTAS DE INGRESOS Y GASTOS<br />\r\nExplicaci&oacute;n y funcionamiento de las cuentas de ingresos y gastos. Ejercicios pr&aacute;cticos con asientos contables.<br />\r\nTEMA 5: IVA. IMPUESTO VALOR A&Ntilde;ADIDO<br />\r\nExplicaci&oacute;n de la aplicaci&oacute;n del IVA en los asientos contables, liquidaci&oacute;n trimestral del impuesto. Ciclo contable con regularizaci&oacute;n y cierre. Ejercicios pr&aacute;cticos con asientos contables. Contabilizaci&oacute;n de asientos utilizando facturas, para aplicar los conocimientos te&oacute;ricos, a la realidad de la empresa.<br />\r\nTEMA 6: COMPRA Y VENTA DE MERCADER&Iacute;AS<br />\r\nExplicaci&oacute;n descuentos dentro y fuera de factura, rappels, devoluciones y descuentos pronto pago. Contabilizaci&oacute;n de transportes en la compra y en la venta. Anticipos de proveedores y clientes. Ejercicios pr&aacute;cticos con asientos contables. Contabilizaci&oacute;n de asientos utilizando facturas, para aplicar los conocimientos te&oacute;ricos, a la realidad de la empresa.<br />\r\nTEMA 7: DESCUENTO EFECTOS<br />\r\nExplicaci&oacute;n descuento de efectos.</span></p>\r\n'),
(104, 77, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">RESPUESTA AUTOM&Aacute;TICA EN EL &Aacute;MBITO LABORAL<br />\r\n&nbsp; &nbsp;- &iquest;Qu&eacute; es la respuesta autom&aacute;tica?<br />\r\n&nbsp; &nbsp;- Caracter&iacute;sticas de personas con respuesta autom&aacute;tica<br />\r\n&nbsp; &nbsp;- Causas que generan la respuesta autom&aacute;tica<br />\r\n&nbsp; &nbsp;- Consecuencias para la salud laboral<br />\r\n&nbsp; &nbsp;- Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">ACTITUD ANTE LA RESPUESTA AUTOM&Aacute;TICA<br />\r\n&nbsp; &nbsp;- Actitudes personales<br />\r\n&nbsp; &nbsp;- Iniciativa y resoluci&oacute;n de problemas<br />\r\n&nbsp; &nbsp;- Optimismo inteligente<br />\r\n&nbsp; &nbsp;- Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EMOCIONES EN EL &Aacute;MBITO LABORAL<br />\r\n&nbsp; &nbsp;- &iquest;C&oacute;mo afectan las emociones en la respuesta autom&aacute;tica?<br />\r\n&nbsp; &nbsp;- Gesti&oacute;n de la respuesta autom&aacute;tica<br />\r\n&nbsp; &nbsp;- Habilidades para la regulaci&oacute;n emocional<br />\r\n&nbsp; &nbsp;- Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">HABILIDADES PARA LA RESPUESTA ADAPTADA<br />\r\n&nbsp; &nbsp;- Comunicaci&oacute;n<br />\r\n&nbsp; &nbsp;- Empat&iacute;a<br />\r\n&nbsp; &nbsp;- Escucha activa<br />\r\n&nbsp; &nbsp;- Motivaci&oacute;n<br />\r\n&nbsp; &nbsp;- Resumen</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(105, 76, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">IGUALDAD DE G&Eacute;NERO EN MATERIA RETRIBUTIVA. NORMATIVA Y PRINCIPIOS<br />\r\n&nbsp; &nbsp;- Normativa reguladora de la igualdad retributiva.<br />\r\n&nbsp; &nbsp;- Objeto y &aacute;mbito de aplicaci&oacute;n del R. D. 902/2020.<br />\r\n&nbsp; &nbsp;- Elementos b&aacute;sicos del derecho a la igualdad de trato y no discriminaci&oacute;n.<br />\r\n&nbsp; &nbsp;- Principio de igualdad retributiva de las personas trabajadoras a tiempo parcial.<br />\r\n&nbsp; &nbsp;- Recursos disponibles en las instituciones p&uacute;blicas.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">&iquest;C&Oacute;MO CUMPLIR CON LA NORMATIVA DE IGUALDAD RETRIBUTIVA?<br />\r\n&nbsp; &nbsp;- Mecanismos del principio de transparencia retributiva.<br />\r\n&nbsp; &nbsp;- Auditor&iacute;a retributiva.<br />\r\n&nbsp; &nbsp;- Valoraci&oacute;n de los puestos de trabajo.<br />\r\n&nbsp; &nbsp;- Registro retributivo.<br />\r\n&nbsp; &nbsp;- Incumplimientos del Real Decreto 902/2020 y sus consecuencias.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(106, 74, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">INTRODUCCI&Oacute;N A LA FACTURACI&Oacute;N ELECTR&Oacute;NICA<br />\r\n&nbsp; &nbsp;- Introducci&oacute;n<br />\r\n&nbsp; &nbsp;- Conceptos b&aacute;sicos de la factura electr&oacute;nica<br />\r\n&nbsp; &nbsp;- Utilizaci&oacute;n de la factura electr&oacute;nica<br />\r\n&nbsp; &nbsp;- Obligaciones legales de los expedidores de factura electr&oacute;nica<br />\r\n&nbsp; &nbsp;- Obligaciones legales de los receptores de factura electr&oacute;nica<br />\r\n&nbsp; &nbsp;- Aspectos privado y p&uacute;blico de las facturas electr&oacute;nicas<br />\r\n&nbsp; &nbsp;- Normativa<br />\r\n&nbsp; &nbsp;- Iniciativas nacionales y europeas en los sectores p&uacute;blico y privado<br />\r\n&nbsp; &nbsp;- Resumen</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">LA OPERATIVA DE LA FACTURACI&Oacute;N ELECTR&Oacute;NICA<br />\r\n&nbsp; &nbsp;- Introducci&oacute;n<br />\r\n&nbsp; &nbsp;- Requisitos previos para facturar electr&oacute;nicamente<br />\r\n&nbsp; &nbsp;- Formatos de factura electr&oacute;nica<br />\r\n&nbsp; &nbsp;- El formato EDI. Intercambio electr&oacute;nico de datos<br />\r\n&nbsp; &nbsp;- Las aplicaciones inform&aacute;ticas habituales<br />\r\n&nbsp; &nbsp;- Conservaci&oacute;n de facturas electr&oacute;nicas<br />\r\n&nbsp; &nbsp;- Resumen</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(107, 73, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CONCEPTOS B&Aacute;SICOS<br />\r\n&nbsp; &nbsp;- Una revisi&oacute;n del dise&ntilde;o editorial. El proyecto gr&aacute;fico. InDesign como aplicaci&oacute;n de maquetaci&oacute;n.<br />\r\n&nbsp; &nbsp;- InDesign como aplicaci&oacute;n para preimpresi&oacute;n. InDesign como herramienta para la web.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EL ENTORNO DE TRABAJO EN INDESIGN<br />\r\n&nbsp; &nbsp;- Elementos principales. Paleta de herramientas.<br />\r\n&nbsp; &nbsp;- Barra de control. Reglas. Cuadr&iacute;cula: L&iacute;neas de base.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CONFIGURACI&Oacute;N DE P&Aacute;GINAS EN INDESIGN<br />\r\n&nbsp; &nbsp;- Nuevo. Configuraci&oacute;n del documento. Trabajar con p&aacute;ginas y dobles p&aacute;ginas.<br />\r\n&nbsp; &nbsp;- Ajustes de dise&ntilde;o. Marcos y columnas. Uso de los masters. Numeraci&oacute;n de p&aacute;ginas.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">TRABAJAR CON TEXTO EN INDESIGN<br />\r\n&nbsp; &nbsp;- Marcos de texto. Enlace de texto. Inserci&oacute;n de caracteres de fuente. Estilos de texto y de p&aacute;rrafo.<br />\r\n&nbsp; &nbsp;- Visualizaci&oacute;n de elementos no imprimibles. B&uacute;squeda y cambio de texto. Revisi&oacute;n ortogr&aacute;fica. Personalizaci&oacute;n del diccionario.<br />\r\n&nbsp; &nbsp;- Trabajo con tablas. El editor de art&iacute;culos.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">HERRAMIENTAS DE INDESIGN<br />\r\n&nbsp; &nbsp;- Paleta de capas. Paleta de navegaci&oacute;n. Paleta de p&aacute;ginas. Paletas de v&iacute;nculos. Paleta de car&aacute;cter. Paleta de formato de p&aacute;rrafos.<br />\r\n&nbsp; &nbsp;- Paleta de tabulaciones. Paleta de contorneo de texto. Paleta de art&iacute;culo. Otras paletas de texto. Paleta localizador de trazados.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">HERRAMIENTAS AVANZADAS CON INDESIGN<br />\r\n&nbsp; &nbsp;- Paleta de transformaciones. Paleta de l&iacute;neas. Paleta de color y transparencia. Paleta de degradados. Paleta de muestras.<br />\r\n&nbsp; &nbsp;- Paletas de biblioteca. Paleta de atributos. Paletas de vista previa de salida.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">T&Eacute;CNICAS DE MAQUETACI&Oacute;N CON INDESIGN<br />\r\n&nbsp; &nbsp;- Herramientas de selecci&oacute;n. Herramienta de la pluma. Definir el contenido de un marco. Pegar texto dentro de imagen. Pegar imagen dentro de trazado.<br />\r\n&nbsp; &nbsp;- Invertir un trazado. Trayectoria de recortes. Efectos de v&eacute;rtice. Desvanecer una imagen.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">T&Eacute;CNICAS AVANZADAS DE MAQUETACI&Oacute;N CON INDESIGN<br />\r\n&nbsp; &nbsp;- Trazados compuestos. Conversi&oacute;n de contornos de texto en trazados. Agrupaci&oacute;n y desagrupaci&oacute;n. Alineaci&oacute;n de objetos. Bloqueo de objetos.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EXPORTACI&Oacute;N<br />\r\n&nbsp; &nbsp;- Exportaci&oacute;n en HTML. Exportaci&oacute;n en EPS. Exportaci&oacute;n en archivo de preimprenta. Exportaci&oacute;n en PDF.</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">PREPARACI&Oacute;N DE IMPRESI&Oacute;N CON INDESIGN<br />\r\n&nbsp; &nbsp;- Sobreimpresi&oacute;n y transparencia. Uso de las zonas de reventado.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(108, 70, 2025, '<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MANIPULACI&Oacute;N Y TRANSPORTE DE MERCANC&Iacute;AS<br />\r\n&nbsp; &nbsp;- Flujo log&iacute;stico interno de cargas y servicios. Importancia socioecon&oacute;mica<br />\r\n&nbsp; &nbsp;- Almacenamiento, suministro y expedici&oacute;n de mercanc&iacute;as<br />\r\n&nbsp; &nbsp;- Normativa comunitaria y espa&ntilde;ola sobre manipulaci&oacute;n de mercanc&iacute;as<br />\r\n&nbsp; &nbsp;- Prevenci&oacute;n de riesgos laborales y medidas de seguridad en el transporte de mercanc&iacute;as<br />\r\n&nbsp; &nbsp;- Medios de transporte internos y externos de las mercanc&iacute;as. Condiciones b&aacute;sicas<br />\r\n&nbsp; &nbsp;- Simbolog&iacute;a y se&ntilde;alizaci&oacute;n de entorno y medios de transporte: placas, se&ntilde;ales informativas luminosas y ac&uacute;sticas<br />\r\n&nbsp; &nbsp;- Unidad de carga. Medici&oacute;n y c&aacute;lculo de cargas. Documentaci&oacute;n que acompa&ntilde;a a las mercanc&iacute;as<br />\r\n&nbsp; &nbsp;- Documentaci&oacute;n que genera el movimiento de cargas. Transmisi&oacute;n por v&iacute;as digitales</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">EMBALAJE Y PALETIZACI&Oacute;N DE MERCANC&Iacute;AS<br />\r\n&nbsp; &nbsp;- Tipos de embalajes y envases en la industria. Condiciones de los embalajes para la protecci&oacute;n de los productos<br />\r\n&nbsp; &nbsp;- Condiciones de los embalajes para el transporte seguro de los productos. Tipos de paletizaciones. Aplicaciones seg&uacute;n tipos de mercanc&iacute;as<br />\r\n&nbsp; &nbsp;- Condiciones que deben cumplir las unidades de carga. Precauciones y medidas a adoptar con cargas peligrosas</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CARRETILLAS PARA EL TRANSPORTE DE MERCANC&Iacute;AS<br />\r\n&nbsp; &nbsp;- Clasificaci&oacute;n, tipos y usos de las carretillas manuales y automotoras. Motores t&eacute;rmicos y motores el&eacute;ctricos<br />\r\n&nbsp; &nbsp;- Elementos principales de los distintos tipos de carretillas. Mantenimiento b&aacute;sico e indicadores de funcionamiento incorrecto</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">MANEJO Y CONDUCCI&Oacute;N DE CARRETILLAS<br />\r\n&nbsp; &nbsp;- Eje directriz. Acceso y descenso de la carretilla<br />\r\n&nbsp; &nbsp;- Uso de sistemas de retenci&oacute;n: cabina y cintur&oacute;n de seguridad. Puesta en marcha y detenci&oacute;n de la carretilla<br />\r\n&nbsp; &nbsp;- Circulaci&oacute;n: velocidad de desplazamiento, trayectoria, naturaleza y estado del piso, etc.<br />\r\n&nbsp; &nbsp;- Maniobras. Frenado, aparcado, marcha atr&aacute;s, descenso en pendiente. Aceleraciones y maniobras incorrectas<br />\r\n&nbsp; &nbsp;- Maniobras de carga y descarga. Circulaci&oacute;n. Elevaci&oacute;n de la carga</span></p>\r\n\r\n<p style=\"line-height:0.8\"><span style=\"font-size:10px\">CARGA Y DESCARGA DE MERCANC&Iacute;AS<br />\r\n&nbsp; &nbsp;- Estabilidad de la carga y de la carretilla. Nociones de equilibrio<br />\r\n&nbsp; &nbsp;- Evitaci&oacute;n de vuelcos transversales o longitudinales<br />\r\n&nbsp; &nbsp;- Comportamiento din&aacute;mico y est&aacute;tico de la carretilla cargada<br />\r\n&nbsp; &nbsp;- Colocaci&oacute;n incorrecta de la carga en la carretilla. Sobrecarga<br />\r\n&nbsp; &nbsp;- Modos de colocaci&oacute;n de las mercanc&iacute;as en las estanter&iacute;as</span></p>\r\n');
